insert  into `th_brand`(`brandId`,`brandDesc`,`brandLetter`,`brandLogo`,`brandNameCh`,`brandNameEn`) values (1,'德国领先的高端奶粉品牌，是德国市场份额第一的奶粉，也是欧洲销量最好的奶粉之一。 爱他美奶粉产自德国，是德国美乐宝（Milupa）集团旗下品牌，后美乐宝被达能集团收购。2007年，达能再收购Royal Numico（纽迪希亚持有人），将旗下的婴幼儿营养及医学营养进行了内部合并。爱他美与诺优能、可瑞康三个奶粉品牌均属于纽迪希亚旗下。','A','ddea100a-62e6-40a8-aa1c-deca10dabd59.jpg','爱他美','Aptamil'),(2,'NUTRICIA全球婴儿健康领导者，专注婴儿健康116年。自1896年在荷兰发明了婴粉配方奶粉，一直专注婴儿健康。有世界一流的营养师，助产师，科研专家组成。旗下产品覆盖全球，成为英国，法国，意大利，德国等销量第一的品牌。在世界各地，牛栏牌一直担当着领导高质素婴幼儿奶粉制造的地位，故此深受全世界过百万专业医护人员和母亲的信赖。','N','d8907ece-de7b-4427-8c56-6db08f384407.png','牛栏','Nutrilon'),(3,'Hero Baby，原FRISO（美素），2014年由于HERO品牌统一化推广在荷兰本土销售的FRISO（美素）陆续变成Hero Baby标，荷兰本土生产的Hero Baby有着其他产地不可取代的优越性。产品均经过荷兰奶类制品检定局严格的品质鉴定，能全面配合每个小宝宝不同生长阶段的发展。百年历史的品牌信誉，如意创新的科技应用，始终如一的质量保证，是其畅销不衰的秘密，也是妈妈们信赖支持的原因。荷兰本土生产的Hero Baby有着其他产地不可取代的优越性。产品均经过荷兰奶类制品检定局严格的品质鉴定，能全面配合每个小宝宝不同生长阶段的发展。百年历史的品牌信誉，如意创新的科技应用，始终如一的质量保证，是其畅销不衰的秘密，也是妈妈们信赖支持的原因。荷兰本土生产的Hero Baby有着其他产地不可取代的优越性。产品均经过荷兰奶类制品检定局严格的品质鉴定，能全面配合每个小宝宝不同生长阶段的发展。百年历史的品牌信誉，如意创新的科技应用，始终如一的质量保证，是其畅销不衰的秘密，也是妈妈们信赖支持的原因。荷兰本土生产的Hero Baby有着其他产地不可取代的优越性。产品均经过荷兰奶类制品检定局严格的品质鉴定，能全面配合每个小宝宝不同生长阶段的发展。百年历史的品牌信誉，如意创新的科技应用，始终如一的质量保证，是其畅销不衰的秘密，也是妈妈们信赖支持的原因。荷兰本土生产的Hero Baby有着其他产地不可取代的优越性。产品均经过荷兰奶类制品检定局严格的品质鉴定，能全面配合每个小宝宝不同生长阶段的发展。百年历史的品牌信誉，如意创新的科技应用，始终如一的质量保证，是其畅销不衰的秘密，也是妈妈们信赖支持的原因。','H','dea82cc2-2950-4f94-9c10-a5d61a2db24f.jpg','玺乐','Hero Baby'),(4,'美赞臣营养品公司创立于1905年，创始人为爱德华 · 美赞臣，公司总部位于美国伊利诺斯州的格伦维尤，其全球研发中心及全球运作生产中心则位于美国印地安纳州的埃文思威尔镇。美赞臣汇聚前沿的营养科研力量，一直致力于配方的研发和创新，为全世界婴幼儿的健康成长提供从科学探索到临床科学研究的全面支持。同时，美赞臣已与多家大学和研究机构合作，拥有婴幼儿营养研究平台和专业能力。所生产的70多种营养产品行销50多个国家和地区。','M','b99fc54f-3e97-4fb9-a6de-48facaba08be.jpg','美赞臣','MeadJohnson'),(5,'严苛是雅培生产产品时永不妥协的标准，从原料选择到奶源认证，再到包装出厂严格采取高度自动化全程封闭的生产线、通过严苛的质量检测，确保每一勺高品质奶粉的卓越品质后，才会送到消费者手中。雅培国际领先成分分析技术，配方经过多达43个国际研究验证。拥有1级循证证据级别。奶粉品质获得全球婴幼儿营养专家Ziegler博士肯定。雅培奶粉获得全球130多个国家妈妈的信赖。','A','02060e63-1b9a-4923-96c9-9a29403b04f1.jpg','雅培','Abbott'),(6,'原野的奶源是澳大利亚，澳佳集团旗下的牛奶制品品牌，自然不用担心，毕竟澳大利亚是出了名的健康无污染奶源圣地；原粉的话，原来德运的原粉厂家就是原野的厂家，同属于Murray Goulburn迈高，澳洲最大的乳制品生产商，也是获得政府认可的澳洲两大乳业工厂之一，包括包装生产也与生产德运的包装加工是同一厂家，同条生产线上完成的。','O','','原野','Outback'),(7,'英国牛栏奶粉Cow&gate起源于1711年，专业从事乳业制造至今已有300多年的历史，是全球历史最悠久的乳业公司。Cow&Gate1981年被荷兰Numico（纽蜜可）旗下的纽迪西亚公司收购。作为纽迪希亚的母公司Numico公司，是欧洲婴幼儿营养品和医药营养品的领导者。其产品线包括从婴幼儿配方奶粉，为特殊婴幼儿专门配制的营养品到给母乳喂养的妈妈提供的营养品。','C','5731da5c-e532-49cd-9c2c-6d925f4d7454.jpg','英国牛栏','Cow&Gate'),(8,'Blackmores，又名澳佳宝。是澳大利亚的第一品牌保健品。提供一系列高品质的维生素、矿物质、草药以及营养补充品。澳佳宝成立于1930年，已经有近80年历史。经过80年努力，它已经成长为澳洲本土及全世界最被信任的生活科技健康食品公司。在1985年5月正式成为上市公司。目前拥有超过400名员工 ，总部设在澳大利亚悉尼。','B','21826642-18c5-4fc2-ae3e-73cb6e6f49fc.png','澳佳宝','Blackmores'),(9,'1899年Jaseph Hipp 先生在Pfaffenhofen 创立了 HIPP公司（喜宝）。经过80多年的发展，包括婴儿奶粉等多个系列婴幼儿营养食品进入市场。与其它品牌婴儿食品公司相比，率先取得欧盟12星环保标章认证。虽然整体自然环境日益困难，HiPP（喜宝）仍旧尝试采用更多自然生长的原料。在维持天然原料的传统之下，同时投资购置了更现代化的环保生产设备，既保证提供消费者健康的食品，为确保优质的品质，HiPP（喜宝）在产品出厂前实施了高达260道品管测验程序，兼顾到健康美味的原则，并以‘’与大自然和谐共存‘’的原则生产。','H','e63201c3-696a-473f-b14d-c98856748c28.png','喜宝','HiPP'),(10,'Karicare起源于1896年，由Truby King博士开发的，他最早开发这个产品的动力是“帮助辛劳的妈妈，保护可爱的宝宝”。经过百年发展，Karicare现已成为新西兰和澳大利亚市场领导品牌，是新西兰和澳大利亚妈妈们的首选品牌，尤以Karicare金装系列最受消费者青睐。Karicare金装系列婴幼儿配方奶粉，适合0-3岁宝宝。特含先进的科学营养配方，为宝宝每个成长阶段提供最佳的营养支持。','K','e2df3273-1791-42e4-a69d-13f73fe2c4b6.jpg','可瑞康','Karicare'),(11,'BabyGanics是美国热销品牌，以“家是宝宝的安全城堡”为己任，发展一系列婴幼童肌肤保养、居家清洁系列商品，并在美国生产制造，采用天然原料制成，皆通过HRIPT皮肤测试及眼睛刺激性测试，温柔呵护宝宝柔嫩肌肤。','B','6045c7a5-18c6-400a-b05f-c181b27fed58.jpg','甘尼克宝贝','BabyGanics'),(12,'加州宝贝California Baby是美国专为婴幼儿发展天然产品及个人护理的领导品牌，更是许多担心受化学刺激伤害的父母们的第一选择。因为所使用的成分是如此的 \"纯净\" ，加州宝贝California Baby 广受小儿科、妇产科、及皮肤科医生的推荐。此品牌是为婴儿所研发而成，但产品也同时适用于成人，特别被那些对化学成分过敏而造成皮肤问题的人们所喜爱。','C','5efbdabb-d7c8-4e47-b9af-0ecc7c44627d.jpg','加州宝宝','California Baby'),(13,'SAVIQ蜂毒面膜是目前唯一一款荣获EcoCert认证的蜂毒面膜。高达8的BVA值！完胜其它新西兰产蜂毒面膜的蜂毒活性成分含量，由于其价格太过高大上，所以之前国内鲜有人推。这是一款能代替肉毒杆菌的天然产物，其精华提炼自蜂毒生物活性成分，含有多种蛋白质和55种以上的酶类元素，具有深层抗氧化能力，可刺激胶原蛋白及弹性蛋白的循环再生。','S','','SAVIQ','SAVIQ'),(14,'GNC品牌创立于1935年，公司总部位于宾夕法尼亚的匹兹堡，是全球最大的健康营养产品的专业零售商，包括维生素、矿物质、基本提取物和其他专业营养补充剂和运动营养品。GNC一直是致力于消费者健康和保健的先驱者和主导力量。','G','733d9e80-e890-4b99-a8e0-25703f3409b8.jpg','健安喜','GNC'),(15,'childlife是一款美国专业的婴幼儿营养品品牌。 childlife童年时光产品均 获得美国FDA自由销售证书。有着全系列宝宝健康营养产品，纯天然提取，有机工艺；液体配方，极易吸收；自然好味道，宝宝乐于接受，是美国热销的儿童营养补充液，获得美国儿科医生的普遍认可。','C','23ba0199-599e-40bf-88cd-08e6fb2f317f.png','童年时光','Childlife'),(16,'日本品牌Natural Healthy Standard.以“健康胜于财富”为理念，关注人们的身心健康，提出了一种全新的生活方式。旗下产品曾荣登多个排行榜榜首，在海外也极富盛名。我们旨在为大家提供更高信赖感与安全感产品体验，让繁忙的都市人享受到更时尚，健康，快乐的生活。','n','','自然健康标准','natural healthy standard'),(17,'La Tourangelle手工风味油因其一丝不苟的传统工艺和纯良的口感及品质在法国美食业享有盛名。而在世界范围内，La Tourangelle系列油品的销售网络已覆盖全球超过40个国家，是顶级名厨的指定用油。','L','e762b0b2-1116-41aa-a948-b1840d1fa61b.png','拉杜蓝乔','La Tourangelle'),(18,'花王株式会社成立于1887年，花王前身是西洋杂货店“长濑商店”（花王石碱），主要销售美国产化妆香皂以及日本国产香皂和进口文具等，花王创业人是长濑富郎。花王产品涉及化妆品等600多种，大都是高分子化学品。','K','a24e55d5-20ba-4a1a-a34a-a42c747899c7.jpg','花王','Kao'),(19,'宝丽POLA，是创立于日本静冈的品牌，至今已经有78年的历史了，在日本被誉为“化妆界四大花旦之一”。基于皮肤咨询分析系统缔造每一个人独特\"肌肤之美\"，通过丰富内在和提供整体时尚理念来实现感性之美，以扎实的技术和细心周到的想法，历经10年、20年孕育出与肌肤相称的\"美丽关系\"。这些理念，帮助POLA提出\"支持顾客一生的美丽\"的承诺。','P','ef7c9402-fe6b-4433-b735-52914d9818d0.jpg','宝丽','POLA'),(20,'Swisse公司始创于本世纪50年代末成立于澳大利亚墨尔本，是澳洲自然医学疗法的先驱之一。本着“以科学实现健康，以成效主导市场”的宗旨，该公司推出了Swisse品牌的系列保健品，如Swisse深海鱼油、Swisse胶原蛋白口服液、Swisse胶原蛋白片等。Swisse在研究产品配方时唯一关注的是品质，从不考虑成本。','S','315826e7-191c-4ba7-a84c-e43e1403793f.png','Swisse','Swisse'),(21,'Beats是世界领先的音频设备品牌，推出过一系列顶级头戴式、入耳式耳机、扬声器，将录音室里的能量、情感以及激情, 全部如实还原给世界各地的音乐爱好者。 Beats由饶舌歌手Dr. Dre及环球唱片下属的Interscope唱片公司董事长Jimmy Iovine联合创建于2008年，并独家授权由魔声（Monster Cable）制造和销售。2012年两公司宣布停止合作。','B','9c1f4c30-a294-4f51-9f9f-48d7d2138e0b.png','Beats','Beats'),(22,'创建于1947年，是世界上第一双无缝连裤袜的开创者， 是日本第一大袜业生产商，拥有世界上一流的高科技纤维研发和生产技术，不仅生产自己的品牌，同时也是世界上很多顶级品牌的代工商 是日本第一大袜业品牌，是其他日本产品无法比拟的国际性品牌。ATSUGI品牌的袜装使用功能性纤维、技术不断推陈出新、以高品质、高品位的格调闪光制胜。 同时，厚木在打底裤、少女文胸、生理内裤等类别也享受世界级地位。','A','928d64e6-765a-484b-b2de-b741d0299422.jpg','厚木','ATSUGI'),(23,'Earth Mama Angel Baby地球妈妈天使宝宝，是美国著名的天然有机草本母婴护理品牌，坚持用高质量的、纯天然有机的植物配方来生产制造产品，100%不含人造防腐剂、芳香剂、色素及染料等有毒刺激性物质。其产品涉及母亲的整个怀孕、产后、哺乳、宝宝护理及成长的过程。','E','13d34a61-b3bc-4c36-b7dc-45b2203471d7.jpg','地球妈妈天使宝宝','EarthMama AngelBaby'),(24,'NUXE是法国纯植物美容品牌，创立于1957年。NUXE崇尚自然，创立伊始便坚持独创，注重优选成分，不一味追逐潮流，成为天然美学的领导品牌。 NUXE结合现代科技和植物及芳香精油能量，创造出蕴含丰富天然活性成份的温和护肤产品，细腻柔滑，精致优雅，让用户感受源于大自然的轻松舒畅。1989 年由崇尚植物与芳香疗法的知名法国女企业家Aliza Jabes收购，并已经密如制药厂般的制作过程，经严密的企业行销于品质塑造，更促使NUXE成为天然美学的教主品牌。','N','44feb1f1-7a72-479c-8e1b-d8fb219c4e34.jpg','欧树','NUXE'),(25,'Life’s DHA 由全球DHA行业的引导者——美国马泰克（Martek）公司注册品牌。 目前DHA来源主要有动物性的深海鱼油和植物性的海藻，其中海洋微藻是目前优质的DHA来源。life’sDHA研发团队长期在太空飞行中研究海藻的有益用途，经过几十年的研究开发，成功甄选出一种天然富含DHA的海藻。','M','c14b9fd3-ef80-44c6-bbc4-979ecbd08753.png','马泰克','Martek life\'s DHA'),(26,'JAYJUN COSMETIC是韩国化妆品公司，以“Responsible for Beauty(为美丽负责)”为座右铭，一直坚持“美丽至上、客户至上”的服务理念。提出了克服老化的美丽新概念，专注为女性解决肌肤老化暗沉等问题。并运用先进科技，不断对品牌进行提升，追求自然与肌肤的完美融合。','J','3d144a8e-8a06-4058-966f-f2645137664f.jpg','JAYJUN','JAYJUN'),(27,'it\'s skin一个护肤品品牌，在2007年获得英国kifus顶级化妆品有限公司技术配方支持，成为韩国时尚品牌新宠，韩国三大化妆品之一，tsskin是为实现理想的皮肤，根据多年的临床经验，研究和分析顾客的皮肤问题，为了解决问题而开发的。 把自然提取的天然原料和尖端皮肤科学结合在一起，its skin固有配方不仅是使用自然成份，同时更能提高成份的效果，激发皮肤固有的潜在能量。 而且为了皮肤的安全决不使用防腐剂，解决多种皮肤问题的无刺激化妆品。','I','060b96ee-b74d-49c1-a7e3-8729fb750d29.jpg','伊思','IT\'S SKIN'),(28,'娇韵诗是娇韵诗公司旗下一个品牌，成立于1954年，是法国美容界的著名品牌。它的崛起不同于那些由流行服饰起家的化妆品牌，也有别于一般由脸部护肤开始发展的保养品，当大多数品牌将身体保养品列为较晚发展的项目时，娇韵诗却已经以非常完整的身体保养系列为自己在市场上找到明确的定位，并奠定了品牌基础。在娇韵诗的经营理念中，产品的开发设计一直以顾客的需求为主。娇韵诗已开发出细致肌肤护理、特造曲线护理、调和曲线护理、舒爽护理、特殊身体护理、香醒露系列以及美胸护理等，总共30余种不同的保养品系列，带动美体保健新潮。','C','0c415a8a-d3af-4fbe-bab7-8696dff10fda.jpg','娇韵诗','Clarins'),(29,'自然乐园来自韩国，始创于2009年。韩国自然乐园化妆品株式会社在韩国拥有着很髙的知名度，所有产品都是以世界上最优质的天然物质结合先进的技术所研制出来的，对皮肤没有任何刺激和伤害。每一件产品都源于大自然，绿色环保，远离公害，完全没有以往化妆品的那种化学香味。','N','dd719f70-10d7-4dea-a98d-732679e5908e.png','自然乐园','Nature Republic'),(30,'施巴（Sebamed）是德国医学皮肤护理产品的第一品牌，是由德国波昂大学皮肤科医师海兹默尔创办，其首创的符合面部酸碱值、不含皂碱的洁肤皂瞬间风靡欧洲各国。它的全系列pH5.5、不含皂碱的洁护肤产品，是经由科学研发、医学测试、符合皮肤需求的产品，能温和地呵护您的肌肤，不会破坏酸膜的功能。皮肤科医学证实，是最适合用来呵护肌肤的洁护肤产品。施巴也一举成为了欧洲知名的药妆品牌。产品根植于健康皮肤pH5.5微酸性保护膜，是德国施巴的护肤理念。','S','af4a9364-988d-4e56-926a-394fed0c2911.jpg','施巴','Sebamed'),(31,'芭妮兰banilaco是韩国著名时尚彩妆品牌,隶属韩国FNF株式会社旗下，品牌成立于2005年，在各种化妆品品牌云集的韩国极受欢迎，尤其修颜家族的单品一直保持较好销量，获得韩国彩妆节目的好评。芭妮兰是时尚与美丽的代言词，其灵感来自于时尚潮流的20-40岁都市女性生活方式，而自行研发的时尚前卫美妆品牌。','b','252ae1fe-292a-4465-b97e-1bbad484861b.jpg','芭妮兰','banilaco'),(32,'喜本（oc-bon）是100%韩国制造的纯棉卫生巾，是韩国首个经国际公认机构认证的有机纯棉卫生巾的第一品牌，巾身使用美国德克萨州有机纯棉为材质，对皮肤无任何刺激，维持柔软的触感和纯真的感觉。韩国oc-bon在中国的正式命名为喜本，在卫生巾品类中属于中高端品牌，在国内线上线下均有销售。','o','','喜本','oc-bon'),(33,'Healthy Care是Nature\'s Care Australia旗下的产品。Nature\'s Care Australia是澳洲最大的保健品、护肤品生产厂家之一， 是澳洲第一家获得TGA认可的cGMP健康食品护肤品厂。Nature\'s Care原料采用有机、纯天然植物与无污染的海洋生物，在无菌、真空下制造生产。所有生产程序及管理符合GMP的严格控管标准，且所有产品遵照澳洲国家药物管理局(TGA)的法规和要求并符合实际品牌规格。','H','7ab211de-8e86-4071-b99a-e376c7a5b312.png','Healthy Care','Healthy Care'),(34,'澳大利亚的卢卡斯博士在植物学和医学方面有着非常专业的经验，经过数年潜心研究，他发现番木瓜是较好的防腐杀菌消毒剂，可以完全清洁感染部位脏物和伤口，并且用番木瓜治愈了许多疾病。100多年来，Lucas番木瓜膏不断得到世界公认，证明其疗效显著。','L','9a1557d8-6f02-4b26-b4b4-31bff24c4a30.jpg','卢卡斯','Lucas'),(35,'Apivita来自希腊，创立于1979年，以生产纯天然的产品著名，沿袭了自希腊远古祖先崇尚自然的哲学思想及生活愿景，即使在当时那个时候还不流行化妆保养为趋势的时代，他们便开始分享对天然保养品的热情。','A','815ea84d-534c-4d84-b43d-3cfef4a2bd32.jpg','艾蜜塔','Apivita'),(36,'DiaForce是由韩国知名化妆品公司Beauty&Nuri历经两年研发，专门针对眼部肌肤问题的眼贴膜产品。由于其改良了市面上普遍存在的眼膜不服帖、眼部精华滋养不持久的问题，并添加了黄金、宝石等珍贵成分，一直被称为贵妇眼膜，同时也是韩国第一款可以敷着入睡的睡眠眼膜。','D','c14a43a1-b872-4f42-a7f7-bd17faa02ebe.jpg','贵妇','Dia Force'),(37,'Forever New芳新，诞生于1975年美国明尼苏达州，是一款高端衣物洗护品牌。自创始人Sr . John Hedrick在自家厨房里配制出第一罐混合型安心洗剂开始，芳新就坚持为消费者带去无毒、无氯、无磷、无酚、无石化的天然健康。芳新衣物洗剂更出色的表现，令众多高端家庭贵妇们都惊叹不已，深受她们钟爱与推荐。经过四十年的经营，Forever New芳新已成为欧美“精致衣料护理”的品牌。','F','41bef071-541a-43e1-a6d0-b2d12296a055.jpg','芳新','Forever New'),(38,'日本狮王株式会社始创于1891年，至今已有120多年的历史，公司总部位于东京。日本狮王业务涉及以牙膏、牙刷为中心的口腔护理用品领域、个人护理用品领域、家居清洁用品领域、OTC药品领域、化工用品领域等。在日本，狮王旗下的牙膏、牙刷产品常年保持傲人的销售成绩。而洗衣粉、洗衣液、洗洁精、柔顺剂等众多洗涤日化产品也占据了日本本土市场的销量前列。','L','4ab6fac5-9b21-4e12-a741-1af79a587c76.jpg','狮王','LION'),(39,'BRAGG酱油选用一级非转基因黄豆制造，含16种氨基酸成份、植物蛋白质，纯水。非转基因验证和无麸质（很多湿疹宝宝对麸质过敏），一种可以替代Tamari酱油和大豆酱油的调味品。不含酒精，不发酵或加热，不含味精，Bragg有机营养无盐氨基酸酱油调味料适用添加于大部分食物佳肴。同时，独特的喷雾设计，方便又实用。','B','','Bragg','Bragg'),(40,'Bioisland是澳大利亚婴幼儿营养补充剂的第一品牌。Bioisland母公司JBX位于澳大利亚新南威尔士州首府悉尼，JBX自二十世纪以来，一直专注于营养健康、有机天然以及配方食品研发生产，是澳大利亚最早开拓婴幼儿营养品市场的本土企业。Bioisland致力于为您和您的家人提供最优质的营养补充剂，帮助婴幼儿及成年人达到最佳健康状态。','B','39f98101-f966-41dd-ae2c-0ff7f016d19a.jpg','佰澳朗德','Bio island'),(41,'爱茉莉太平洋集团是韩国享誉全球的化妆品集团公司。公司成立于1945年，至今已有70年的历史，旗下子公司跨行数十业，不仅拥有自己的研发中心，而且海外分支机构横跨全球，国际行销网遍及40多个国家，所生产的化妆品项目多达4000多种。品质优良的产品，不仅在韩国，更受到全球消费者及用户欢迎，并已成为世界性企业。爱茉莉太平洋集团以“亚洲之美”为基础，致力于实现亚洲人的美丽之梦，进而与世界共同分享亚洲之美。同时为了携手人类共同探索可持续发展，不断研发可持续的产品以及开展各种各样的社会公益活动','A','400927ff-d84b-4272-b35d-1bb3b9661982.jpg','爱茉莉','Amore'),(42,'海丝蓓康，由成立于1976年的新西兰API药妆公司制造。该公司产品线丰富齐全，遍及新西兰各大医院、药房、百货公司、超市、便利店，并远销至世界各地。海丝蓓康精选纯天然库拉索芦荟源液为主原料，不含皂基，有效改善缺水状况，维持水同平衡，保水嫩肤。海丝蓓康沐浴护肤系列添加防敏香氛因子，弱酸性配方，孕妇、儿童均可使用，温柔呵护全家健康。','H','4f2a1c83-ca88-438f-b621-75dc2e990e51.jpg','海丝蓓康','Health Basics'),(43,'SUNSTAR集团是日本著名的上市多元化集团，是由金田兄弟于1941年在大阪创立的，业务覆盖口腔护理、健康、美容、建筑家居、自动车零部件等领域，其中尤以口腔护理最为著名，旗下四大口腔品牌分别为：GUM、Ora2、SUNSTAR和Butler。2006年，SUNSTAR集团将总部迁至瑞士，旨在以欧洲为中心点，辐射美洲、东南亚、中国和日本本土，以进一步拓展全球业务。','S','e7b1dfb2-2cf6-4b6e-b828-1d84418cac00.png','盛势达','Sunstar'),(44,'1905年创立於德国中部的herbacin德国小甘菊，位於德国风景秀丽的图林根洲自然保护区内赫塞尔河畔，拥有大片的草药种植基地，形成特别的品牌形象。一百年来herbacin德国小甘菊就以自行种植产品所需的植物而闻名全欧洲；而依传统配方制造产品，不但是德国的经典护肤品牌，更是欧洲人手一款的经典护肤品牌。','H','4fbea70b-590b-4125-ad84-78cf91c24306.jpg','贺本清','Herbacin'),(45,'山本汉方制药株式会社承若为呈现给顾客“安全 安心”的产品，严格彻底地实施安全守则。 以制药公司特有的管理体制为基础，在产品的生产过程中严格彻底地执行品质管理制度，而且从20多年前就实施了原料农药检查制度。只有经过严格检查的产品才能被送到顾客的手上。为了使顾客满意，山本汉方人一直追求更高品质的产品。从安心安全又美味的大麦若叶青汁，到近200种美味健康茶、民间茶，还有活用制药公司特有的技术而生的便秘丸等医药品，一切都严格贯彻安全生产指标。','K','9972bc57-d67b-4245-9819-e5e101b173d8.jpg','山本汉方','Kanpo-yamamoto'),(46,'MISSHA谜尚是韩国三大化妆品集团之一ABLE C&C株式会社旗下品牌，它谜尚倡导用合理的价格提供生活必需品的高档化妆品，拥有护肤、彩妆、特殊功能化妆品及工具等共500余种多样化的产品。谜尚化妆品主要包括谜尚妆前乳、谜尚BB霜、谜尚睫毛膏、谜尚眼影、谜尚面膜、谜尚遮瑕膏等。其产品一直深受韩国女性追捧，同时也深受韩国明星的喜爱和拥护。2007年获得英国科夫氏化妆品有限公司技术配方支持。','M','ecc6510d-fe0d-4f5a-b643-44753a46b750.jpg','谜尚','MISSHA'),(47,'\"Straub-Cosmetics由创始人Adolf Straub（阿道夫.施托普）于1949年在德国Wertheim创建。时至今日，其分公司已遍布世界70多个国家，生产的产品种类已经超过500多种，是欧盟第二大化妆品生产集团，旗下产品门类齐全，尤其以各种时尚的、透着名贵香水气味的、高品质沐浴和润肤产品而闻名。工厂配备最尖端科技的生产设备以保证高品质的产品。无论从产品包装的设计，还是产品内在品质，都体现出Straub-Cosmetics对高品质产品的追求。 \"','B','c72e0b0c-673d-457d-bfb1-a8eaa76c7268.jpg','保黛宝','Bettina Barty'),(48,'荷兰本土品牌De Tuinen，是著名荷兰纯天然保健品和护肤品出品商。De Tuinen在荷兰语中是‘花园’的意思，所以荷兰本土俗称‘花园店’。该品牌最大的特点是从生物中提取天然有效成分，主营多种保健品、精油、护肤品、食品等等，所有在售商品全部是纯天然绿色保健！在荷兰家喻户晓！其覆盖面广，用料安全 ，不含化学添加剂，无人工色素及香味剂。清新自然，温和有效，追求自然健康是花园产品的原则。带给大家好的，天然的保健护肤品是花园店的座右铭。','D','ae0982eb-4b45-4016-a376-7eb6410e55ed.jpg','花园店','De Tuinen'),(49,'Reveur是一个來自日本的超人气优质洗护品牌。产品自2010年推出以來，一直备受推崇，曾荣获多项美容大奖！Reveur崭新的无矽洗发概念及超微細泡沫技术，让洗发过程就像女士们卸妆一样，污垢彻底清除；配合比一般护发露更有效的护发膜，美发成份更能深入发丝內部以及每一個毛囊，让长出來的秀发更健康、亮丽。','R','6b710ce1-9070-422d-a557-925b96579142.gif','Reveur','Reveur'),(50,'世界奢侈品集团LVMH旗下的品牌Fresh馥蕾诗1991年创立于纽约。创立伊始，Fresh馥蕾诗就坚持采用天然成分，将久远流长的传统美容智慧和尖端创新科技完美结合，创造出现代美容炼金术。同时，Fresh馥蕾诗从文学、旅行、音乐、电影、时尚中撷取灵感，让每一次体验Fresh都能唤起感官身心的悦动。','F','38a46030-296b-4d2b-af89-b7d9f3859206.jpg','馥蕾诗','Fresh'),(51,'1872年资生堂在日本东京银座创立了第一家西式调剂药房。1897年科学性地开发出了以西洋药学处方为基础，名为红色蜜露（EUDERMINE）的化妆水。从此，资生堂便一直致力于美肌和秀发的研究，研发出了许多革新商品和美容方法。今天的资生堂不仅在日本，在世界范围内也受到众多消费者的喜爱，其产品已在全世界85个国家销售，成为亚洲第一、享誉全球的化妆品集团。','S','f40b9386-b4b2-4ed9-bec6-71286eea8099.png','资生堂','Shiseido'),(52,'Beauty Bar蔚丽吧是美国WEI Beauty International公司旗下时尚青春系列品牌，由美国WeiEast护肤研究中心研发，将全世界带着亿万颗快乐因子的护肤秘籍与爱美的女孩们分享，为年轻女孩带来自信、快乐的护肤体验。','B','df4c4355-d2e2-4776-8e1a-724ff50f1c81.jpg','Beauty Bar','Beauty Bar'),(53,'贵爱娘/Bodyfit品牌隶属于韩国LG SOFY旗下，贵爱娘卫生巾配方参考自朝鲜古代著作《东医宝鉴》并结合现代科学技术研制而成，特别添加江华艾草、当归、香附子等天然养身草本植物成分，不含荧光剂，甲醛，化学香料，色素，氯漂白剂等有害物质，可暖和身体、促进下腹部的血液和淋巴液的循环，从而起到预防和治疗下腹痛，经痛，膝痛，神经痛的功效。贵爱娘卫生巾吸收力强，触感轻柔，按人体曲线设计的巾身，时刻紧贴生理曲线，有效阻挡侧漏，带来超贴身安心防护。为女性特殊的几天带来安心呵护，并能同时去除异味。贵爱娘为女性提供一种关注健康、贴近自然、传统与现代结合的个人护理选择。','B','7e2b3553-9976-4e67-8d74-9063af9d8f65.png','贵爱娘','Bodyfit'),(54,'盛田屋起初只是一家制造豆腐及豆乳的工厂，而在制作豆腐和豆浆的过程中，盛田屋工厂常年工作的女性员工发现自己的手并没有变得更加粗糙，而是变得像豆腐一样嫩滑而富有光泽。原因就在于豆浆中本身所含有丰富的大豆异黄酮和维生素E。也正因为这些女工的发现，给盛田屋经营者以极大的启发，“我们要把这个豆腐的美丽秘诀传递给更多的女性朋友”，由此研发推出了盛田屋豆腐豆乳自然生活系列的化妆品，实现了从传统手工行业向化妆品美容产业的成功转变。盛田屋的豆腐面膜产品，是以真正的第一道大豆原汁作为基料的，所有成分都是天然萃取，敏感肌可用。其保湿美白滋润，促进角质的新陈代谢，提高皮肤的免疫功能，特别是提高对于紫外线伤害的防御功能，让肌肤一天一天比豆乳更加水嫩。','m','a6b5a0e9-5594-4c60-9ef5-ac123971f757.jpg','盛田屋的豆腐','moritaya'),(55,'Fumakilla是日本知名的杀虫剂生产企业，其前身为“大下回春堂”，由大下大蔵创立。在成立起的120年里，Fumakilla的业务由杀虫剂发展至家用、园艺和工业产品，成为一个全球性企业。Fumakilla于1963年发明并推出全世界第一个电热式驱蚊器VAPE，并持续占据日本杀虫剂市场的较高位置。追求“日用质量”是Fumakilla的品牌哲学。','V','','未来','VAPE'),(56,'GUERISSON格丽松与九朵云同属韩国Claire\'s（克莱尔斯）旗下品牌9complex的产品，在2007年获英国KIFUS技术支持之后，成为韩国时尚品牌新宠，更是韩国电视购物三大化妆品之一。GUÉRISSON 格丽松为实现理想的皮肤，根据多年的临床经验，制成了这款无刺激化妆品。且旗下的马油系列产品，成分来自德国，属于韩国药妆化妆品，韩国电视购物三大化妆品之一，创下韩国护肤史上销售奇迹！','G','28416b3f-6e2f-432e-abb8-5b0ef4e5bb99.jpg','格丽松','Guerisson'),(57,'Cloud9（九朵云）是韩国 Claires（克莱尔斯）旗下9complex的品牌，韩国时尚品牌新宠，韩国电视购物三大化妆品之一，在2007年获得英国kifus顶级化妆品有限公司技术配方支持，科学地解决皮肤问题（CLinaical Skin Solution）。把自然提取的天然原料和尖端皮肤科学结合在一起，激发皮肤固有的潜在能量。','C','725679a6-dd86-4990-8c11-025159ae0e9e.jpg','九朵云','Cloud9'),(58,'Holika Holika是由英文\"holic\"和韩国语\"홀리다\"（被迷惑）相结合而成的名字，把所有女性梦寐以求的美丽变成现实。提出新的美妆新趋势，同时也提倡新风格。丢掉平庸的少女面貌，帮你变身成为魅力女性的的专业化妆品牌。Holika Holika通过研究女性心理和女性生活风格的项目，帮你找寻连隐藏的美丽，打造属于你的专属魅力。同时也也致力于兼顾个性和美丽的同时，迅速成长为全球美丽的制造者。','H','9b585c0b-490b-490a-9a56-efa34323e104.gif','惑丽客','Holika Holika'),(59,'Fjallraven是瑞典市场占有率领先的高端户外品牌，是瑞典皇室御用品牌，也是唯一一家获得瑞典皇室御用品牌殊荣的户外品牌。Fjallraven的品牌故事源自1950年，从瑞典北部城市Qrnskoldsvik的一间小地下室开始，从一个木制背包框架开始，50年来，Fjallraven品牌已成长为综合性的专业户外休闲品牌，旗下拥有背包，帐篷，睡袋和户外服装等系列产品，产品和服务遍及全球。','F','6d754653-8856-4d23-a958-f04c71eada5f.jpg','北极狐','Fjallraven'),(60,'蜜泉是澳洲澳佳集团旗下的蜂产品品牌，除了推出乳化蜜、功能性蜂蜜和蜂巢蜜等一系列有特色的蜂蜜产品之外，澳佳集团还推出了蜜泉牌蜂胶液、蜂王浆胶囊和角鲨烯胶囊等保健品以及蜂胶牙膏和蜂胶木瓜霜等日用品。这些产品都是在世界卫生组织GMP标准下的澳洲一流的制药厂生产。','H','154683fe-d3a7-4308-b2cc-6b5694731774.jpg','蜜泉','Honey Spring'),(61,'冈本株式会社创立于昭和九年（1934年），是世界上最早开始生产安全套的厂家之一。作为日本最大规模的橡胶乳胶制品生产商，冈本开发及生产的橡胶、乳胶制品包括安全套、胶带、手套、轮胎、医疗器械、户外活动、运动等用品，产品安全、舒适的品质一直深受日本及全世界消费者的青睐。\"竭尽所能使消费者满意\"是冈本株式会社一贯追求的最根本价值，在未来的日子里，冈本将继续以无限的创意、高品质的标准，制造出更多更好的以人为本、以人类环境为本的优质产品。','O','220436b6-2c45-4c31-a117-6c43a341a88d.jpg','冈本','Okamoto'),(62,'相模橡胶工业株式会社建立于1934年，是日本第一家避孕套生产商，也是第一家制造彩色避孕套和凸点式避孕套的公司，曾以一系列革新发明闻名于世。其产品出口市场包括法国、意大利、西班牙、韩国以及美国。相模原创避孕套是一种以聚氨基甲酸酯为物料制成的非乳胶安全套。薄度仅0.02，是目前世界最薄的安全套。此产品的包装有别于一般安全套，使用有如牛油包装的小盒。更加方便及卫生。','S','8532f04a-30a5-4ae3-b528-c28126a41a0f.jpg','相模','Sagami'),(63,'德国Salus莎露斯——全球最大草本集团，成立于1916年的Salus-Haus，总部位于德国，至今已经有近一百年的历史,是欧洲最大的草本健康品集团。 Salus一词源自拉丁语，取意健康、安宁、繁荣与生机。愿人们健康幸福是Salus-Haus的原动力。 上世纪初叶，欧特·葛莱德博士创立了Salus莎露斯自然疗法，开创了有机自然疗法的新时代。1916年，葛莱德博士在Salus莎露斯自然疗法的基础上，成立了第一家“Salus莎露斯健康理疗店”。 90多年来，大自然植物中与人体隐秘相契的医治力，始终是Salus莎露斯研制产品的秘籍及灵感泉源。Salus莎露斯坚持为顾客研发，有机、无污染、蕴藏自然智慧的健康产品。 时至今日，Salus莎露斯集团旗下Salus Floradix，Schoenenberger，Dr.Dunner，Hensel，Olbas，Extracta，Quickvital，Flugge，Duopharm等诸多子品牌，为全球贡献化妆品，精油，保健品，草药，药品，果汁，有机食品等各类优质有机产品。 Salus莎露斯集团为全球顾客研发了近2,000种安全有效的有机健康品，风靡世界50余国。90余年对自然疗法和有机品质的执着追求，已然令Salus莎露斯成为全球公认的最受尊重的保健品领导者之一。 原材料配料表： 胡萝卜，荨麻，菠菜，白芷根，茴香，海草油，非洲锦葵花，橙皮，梨汁，葡萄浓缩液，黑加仑汁，水，黑莓汁，樱桃汁，橙汁，红甜菜汁，浓缩柠檬汁，浓缩苹果汁。长豆角提取物、蜂蜜，维C，植物酵母铁，维B6, B12。','S','4787fe83-7015-4489-a3ba-892d1625af63.jpg','莎露斯','Salus'),(64,'贝亲是来自日本的著名母婴用品品牌，1957年创立以来，一直秉承爱的理念，致力于为消费者提供高品质和种类齐全的母婴用品和服务，贝亲产品涵盖了母乳喂养、奶瓶奶嘴、宝宝肌肤护理、衣物清洗、水杯餐具等抚育宝宝的方方面面。自2002年正式进入中国市场之后，工厂规模和生产规模不断扩大，如今，贝亲在中国拥有上海外高桥、青浦和常州3家工厂，引进国外先进生产流水线，严格按照PQS（Pigeon Quality Standard）执行管理。2013年，贝亲全新推出芬芳亲子洗护系列以及“真绵实感”婴儿纸尿裤，新品的推出强化了贝亲产品线，从而进一步提升了妈妈们育儿生活的品质。','P','b1f1471e-6801-422b-ac25-2e16a192af52.jpg','贝亲','Pigeon'),(65,'好奇HUGGIES纸尿裤诞生于1978年，是有37年历史的美国金佰利旗下的纸尿裤品牌，于68个国际及地区市场领先，全球约有二分之一的宝宝在使用好奇纸尿裤。好奇HUGGIES努力提供最优秀表现的产品，从每一个细节为宝宝考虑，致力于为宝宝提供最舒适和贴体的纸尿裤穿着体验，让宝宝在他的世界无拘无束的自由探索、发现、快乐地成长。','H','59a0c40a-58ea-4f07-bceb-cd8fca646c71.jpg','好奇','Huggies'),(66,'munchkin是美国知名婴幼儿餐具、玩具用品品牌，成立于1991年，致力于设计“高品质、更安全”的创造性婴儿用品，满足现代父母的需求，让育儿和生活更加容易，继而成为一种享受。munchkin 已在美国获超过30个业界奖项，超过50个美国专利。产品遍布美国的大小超市，无论是授乳顾问、医疗专业人士、玩具业专家以及家长，都一致推崇munchkin产品。','M','d3cae470-d516-4cd6-9ef8-e8e76d32aa9c.jpg','麦肯齐','Munchkin'),(67,'1993年，Peter Thomas Roth先生在美国创立了以自己名字命名的护肤品牌PETER THOMAS ROTH彼得罗夫（简称PTR）。Peter来自匈牙利传统SPA家族，受家族事业的熏陶和启迪，他对于护肤的激情和执着源自于对家族事业的传承及个人对完美健康肌肤的不懈追求。他建立了自己的实验室，亲自参与到每个产品的研究和开发中。他坚持的开发理念—运用最先进的成分和技术，最大最优化每个天然成分和科技成分的含量和配比，以达到最令人震撼的功效。彼得罗夫凭借其高科技、高效能、高端时尚医学护肤品牌的定位和其卓越的功效，针对各种肌肤问题，定制最佳解决方案，很快成为了美国医学护肤领域的殿堂级品牌，并在全球赢得广泛美誉，同时也受到众多中西方明星名流的喜爱与追捧。','P','af84370d-01b0-423a-8df6-5e1950a34484.jpg','彼得罗夫','PTR'),(68,'1993年，Caudalie品牌创始人的马帝德小姐与后来成为她丈夫的唐拓马先生(Bertrand Thomas)在史密斯·拉非特酒庄邂逅波尔多大学药学院教授兼全球多酚抗氧化集州总裁费邓(Vercauteren)博士，也就是成功稳定葡萄籽多酚(Grape-seed polyphenols)的第一人。他们交谈中提起种植酿造葡萄酒后剩下的葡萄籽含有丰富抗氧化元素，是上佳的护肤成分。三人一拍即合，在1994年，注册了“葡萄籽多酚”（grape-seed polyphenols）的稳定性技术。作为多酚研究领域的专家，费邓博士向他们揭示了葡萄籽多酚在皮肤抗氧化方面的卓越功效。当时，稳定葡萄籽多酚还是一个巨大难题，还没有任何实验室在这项研究上取得成功，直至费邓博士和他的研究团队准备迎接这一挑战，掀起美容界革命的“历史时刻”。第一项葡萄籽多酚稳定技术专利的申请成功，标志着费邓教授与马帝德小姐、唐拓马先生密切合作的开端。1995年，马帝德小姐、唐拓马先生创办了Caudalie公司。Caudalie一词原为衡量葡萄酒余香在口中停留时间的单位名称。随后，他们推出了一系列含有稳定葡萄籽多酚、专门对抗皮肤衰老的护理产品。','C','444d9f1a-0e02-46c9-8e1e-cb24e746e6d4.jpg','欧缇丽','Caudalie'),(69,'欧舒丹（L\'OCCITANE）是一家专门制造及售卖个人护理产品及家居产品的国际零售企业，主要生产基地设于法国马诺斯克（Manosque）。公司成立于1976年，创办人为奥利维埃·博桑（Olivier Baussan），他希望建立一家保留并弘扬家乡普罗旺斯传统的公司。公司名字L\'OCCITANE在法语中的意思是“来自欧西坦尼亚的女人”。欧舒丹希望“透过提供独特的个人护理及家居产品，成为提倡地中海式舒适安康感觉的国际模范”，并以“舒适愉悦”、“真实纯净”及“关怀尊重”等为企业理念。2010年5月7日， 欧舒丹在香港联合交易所主板挂牌上市，成为首家在港上市的法国企业。','L','f3fd5036-1ea2-45bf-9760-aed8b6f55f97.jpg','欧舒丹','L\'Occitane'),(70,'1932年，丹麦木匠奥尔·科克·克里斯蒂安森发明了一种可以互相拼插的塑料玩具，并将“Leg”和“Godt”（丹麦语“玩得好”）合在一起，创造了“lego”（乐高）这一品牌。巧合的是“lego”在拉丁语中的意思是“拼在一起”。乐高玩具公司总部位于丹麦Billund, 是一家家族式私有企业。在提供模拟儿童的创造力、想象力和学习能力的高品质产品和体验方面，它是全球的佼佼者，其产品主要通过游戏性的活动来鼓励游戏者动手、动脑创作，激发他们的兴趣，并促进团结和共同思考。','L','9e0c1132-b64a-4282-9e6e-480b96209532.jpg','乐高','LEGO'),(71,'Jumbo来自于世界最老牌的玩具制造商Royal Hausemann&Hotte，建立于1853年。其突破传统的“悬疑系列”更是受到拼图爱好者的追捧，玩家需依照提示而非图片去完成拼图，带来区别于以往的游戏方式。','J','c2e623a7-0c0a-44ed-98d1-5128183c41ff.jpg','Jumbo','Jumbo'),(72,'“米菲”品牌创作灵感来源于布鲁纳先生在1955年的一次家庭度假中。米菲是个令人着迷的小兔子，她简单，无邪，坚决，永远愿意接受新体验。以米菲家族故事来衍生出与之相关服装，用品等商品。其生动，可爱的形象，深受小朋友的欢迎。强调清新，简约，活泼可爱的孩子形象，围绕舒适，实用，俏皮三个理念来展开呈现品牌的组合性及系列感。男童以欧美休闲为主，简单的搭配结合精致的细节，在休闲自然的感觉中加入水洗后的舒适感和陈旧感。女童部分以欧美可爱的感觉为主，颜色亮丽而不失优雅之气。充分利用丰富的色彩与动感的图案，活泼的气息扑面而来。','N','','米菲兔','Nijntje'),(73,'30多年前，Lansinoh由一名母乳喂养的妈妈Resheda Hagen女士在美国俄勒冈州波特兰市成立，并在1978年注册为Lansinoh公司。为哺乳妇女提供了一种安全有效的产品来代替可用于缓解乳头疼痛高度美容产品。虽然是一个只有25年历史的年轻品牌，但是Lansinoh却是国际母乳会（LLL）的推荐品牌，并且受到广大美国妈妈的喜欢、认可推荐。Lansinoh品牌主打三款产品：母乳储存袋、护乳霜、防溢乳垫。','L','1d6ca5ca-d6d7-42f2-a887-57d4df5002b4.png','兰思诺','Lansinoh'),(74,'自然哲理Philosophy是来自美国的美容品牌，产品线包括身体护理、香水、彩妆、美发产品等。Philosophy Creator品牌创始人Cristina Carlino是一名资深的产品开发员和护肤专家，曾任知名药厂BioMedic的执行长。Cristina是结合医学美容的先驱，她开发出的Mircopeel（微晶磨皮换肤）获得全球数以万计的医生认可，普遍的使用在肌肤的治疗上。她负责这些医师的医学专业训练，包含：换肤磨皮、疗程手法以及方法，并且联合医师以及科学家一同研发philosophy商品。Carlino女士不只是philosophy创始人，连同philosophy商品的命名和文案也都由她一手包办。','P','3ac0956e-e099-4fe2-85c8-2e15949aa9b9.png','自然哲学','Philosophy'),(75,'bareMinerals以“彩妆品同时也是护肤品“的健康美妆理念成为美国最畅销的矿物粉底品牌之一，成功开创带妆入睡奇迹, 其矿物彩妆不含有害防腐剂及对肌肤有害的化学物质, 如护肤品般温柔呵护肌肤；更一直寻求并选用地球上优质的矿物质。天然纯净优质之成份, 对肌肤来说是无压力、零负担的彩妆品, 即使睡觉不卸妆, 也不会对肌肤造成伤害。','B','2064a88d-aa6d-4bfb-a7d7-d9ccd65b8afb.jpg','贝茗','BareMinerals'),(76,'h2o+水芝澳于1989在美国芝加哥创立，始创人为仙蒂·梅其，同年在著名的密芝根大道开设首间专门店。h2o+水芝澳是著名化妆品牌，h2o+的创始人仙蒂梅发挥\"以水为本”的革新理念，利用专利海洋矿物合成物，创造性地研制出了源于水的h2o+水芝澳护肤品。','H','1a875f16-6b47-4053-964b-c89cfc10d3f8.jpg','水芝澳','H2O'),(77,'全球闻名遐迩的迪士尼，全称为The Walt Disney Company，取名自其创始人华特·迪士尼，是总部设在美国伯班克的大型跨国公司，主要业务包括娱乐节目制作，主题公园，玩具，图书，电子游戏和传媒网络。皮克斯动画工作室（PIXAR Animation Studio）、惊奇漫画公司（Marvel Entertainment Inc）、试金石电影公司（Touchstone Pictures）、米拉麦克斯（Miramax）电影公司、博伟影视公司（Buena Vista Home Entertainment）、好莱坞电影公司（Hollywood Pictures）、ESPN体育，美国广播公司（ABC）都是其旗下的公司（品牌）。迪士尼于2012年11月收购了卢卡斯影业。','D','4106442b-7d92-48df-bfac-282a6134a786.png','迪士尼','Disney'),(78,'The Body Shop国际股份有限公司（The Body Shop International plc）是高质量面部肌肤及身体护理产品零售商，由Anita Roddick于1976年在英国成立，2007年获得英国kifus化妆品有限公司技术配方支持。The Body Shop零售业务遍布全球55个国家，商店数目超逾2200间，全部不使用动物测试，并透过公平贸易购买天然原材料。','T','c5ae8d49-2cf5-4b56-beb5-66b29acc7d05.png','美体小铺','TBS'),(79,'佳丽宝(Kanebo)的诞生，是日本老字号的东京棉商在1930年所尝试生产的美容馆、香皂等产品，后来发展成为佳丽宝(Kanebo)美容馆的前身。佳丽宝(Kanebo)在美白保养品的研发方面居业界重要地位，护肤主张强调适龄、适肌、适品，精细区分继而发展出各种效能的佳丽宝(Kanebo)保养品系列。1936年佳丽宝(Kanebo)正式从事化妆品事业，从那时起佳丽宝(Kanebo)就希望能以坚实的技术力量、优良品质和细致周到的服务，实现“佳丽宝美丽你人生”的愿望。在技术水平节节攀高的化妆品业界，佳丽宝(Kanebo)始终被誉为“技术的佳丽宝”。','K','8fed4328-40ce-4506-9648-238007d89202.jpg','佳丽宝','Kanebo'),(80,'1978年诞生于日本的男性化妆品品牌。杰士派Gatsby一直坚持“永远符合时尚潮流的男性造型化妆品”的理念。希望能够满足男性的各项时尚需求，不断地研发推出新商品，让种类更齐全多样。而Gatsby在日本也已是深受年轻族群喜爱信赖且认同的品牌。','G','18cfde21-d915-4087-96a5-e673edaca38c.jpg','杰士派','Gatsby'),(81,'Bliss必列斯源于美国，由Marcia Kilgore小姐创办，品牌以全方位Spa生活定位。产品路线非常全面，拥有完整的护肤、彩妆、纤体、脸部护理、身体护理以及头发护理等系列，在销售产品的同时提供美容服务，在美国设有多间spa会所，纽约总店更是客流如潮，要做一次Bliss必列斯的spa往往需要等候3个月，所以特别推出系列产品，顾客可在家中保养肌肤，还能尽情享受Bliss必列斯带来的无限欢愉。','B','71a98b65-84f0-4fce-8aae-20dc2c3d48c6.png','必列斯','Bliss'),(82,'欧乐B(Oral-B)是一个牙刷与其他牙齿护理产品（如牙线）品牌，由2005年收购了吉列公司的宝洁公司生产。该品牌亦包括了电动牙刷与牙间产品（如冲牙机与口腔护理组合）。 吉列公司声称欧乐B牙刷是“全球最多牙医选用的品牌”。','O','85c1582a-b852-4abe-8ac7-3c530d58cdcb.jpg','欧乐B','Oral-B'),(83,'JOZO酿造盐是瑞典最著名的品牌，由AkzoNobel公司生产制造，质量高，很安全。','J','','JOZO','JOZO'),(84,'美国Sassy公司专门为0-3岁的婴幼儿设计启发智能的创意用品，参加许多国际性的儿童智能启发玩具的比赛屡获奖项，最值得称赞的是Sassy在制作玩具时的严谨性是许多玩具厂商所不及的，不但保证使用材料的安全，在用品的色泽上采用最能刺激婴幼儿视觉反应的鲜艳色彩，在造型及功能上，也做了很多贴心的设计。4个月以上的宝宝很适合。','S','c89e51a8-257e-4fc2-b62f-5008edde6421.png','Sassy','Sassy'),(85,'Theramed来自德国，30多年来专注于口腔护理，美白抗过敏是强项，最值得赞叹的是站立姿态和按压式设计，在使用时享受最人性化服务。 隶属于有着近140年历史的德国汉高集团，旗下拥有如施华蔻，宝莹、乐泰等众多家喻户晓品牌。 顶级团队倾力研发，牙科医生鼎力推荐，让每个人都能根据口腔情况选择适合自己的牙膏，在欧洲深受人们喜爱。','T','41bb9b67-a2d6-49b6-99e8-609877d6dd82.jpg','泰瑞美','Theramed'),(86,'Celeste品牌灵感来自于哥斯达黎加中一条土耳其蓝色的河川，这条塞勒斯特河周边被温泉所环绕着并且有瀑布作为它的边际，是纯洁和天然的代表，该品牌发展至今已经成为纯洁，永恒和高质量的代名词。','C','','Celeste','Celeste'),(87,'雅歌布JACOB HOOY是具有近300年历史的荷兰植物护肤权威品牌，用平易近人的价格让您感受着奢华的品质。现在雅歌布是世界上研究香料和精油系列产品历史悠久且专业的公司，现有产品种类达三千余种。雅歌布JACOB HOOY是荷兰皇室御用品牌，著名影星奥黛丽.赫本男爵和她的母亲都是雅歌布品牌的忠实用户。','J','2bc3cf9c-1146-4086-bafc-d455e92c4b00.jpg','雅歌布','Jacob Hooy'),(88,'Aquafresh是葛兰素史克公司旗下的专业口腔护理品牌，1973年起研发专注于口腔护理产品，是世界上最大的口腔护理品牌之一。也是美国比较受欢迎的口腔护理品牌，位列前三，其产品线包含牙膏、漱口水、洁齿灵、牙刷等等，其中牙膏最为受到大家的欢迎，备受年轻人青睐。','A','80e84ae6-c242-4341-bfa5-be2de5ff83c9.png','Aquafresh','Aquafresh'),(89,'difrax（迪福）公司创建于1967年，至今已有48年历史。是荷兰一家做婴儿用品的家族企业，荷兰喂养第一大品牌。在荷兰每2个宝宝中有1个宝宝使用difrax。宗旨是“我们的愿望是为追求时尚、负责任的父母及快乐的孩子们创造出更好的产品”。并荣获了2012年度红点设计大奖（设计界的奥斯卡）。','d','25349798-958d-4471-86e1-de8ed8cbfec1.jpg','迪福','difrax'),(90,'Contigo为美国著名的水杯制造商。始于美国芝加哥，汇集世界精英，在美国、欧盟、中国、日本等世界多个地方均注册了发明专利。颜色搭配适合各年龄阶层用户，已成为美国最畅销的水杯。使用食用级别的材质，柔韧性好，装满的杯身在不超过1米7的情况下，几时摔倒地上也不破裂。适合喜爱室内或室外运动人士。','C','af045649-3fc5-4389-b358-469ffcb3e006.jpg','康迪克','Contigo'),(91,'法国国际品牌，米其林星级主厨，PH大师钟爱的盐之花。纯天然手工严选，无任何添加剂，富含丰富矿物质，有海盐中的皇后美称。是世界上最昂贵海盐，口感非常细致高雅，无论是大厨还是美食家，都是备受追棒的食材。使用范围：各类美食、马卡龙夹馅、蛋糕、西点、饮食（汤）、咖啡、巧克力等等。','C','','卡玛格','Camargue'),(92,'Lotus是莲乐烘焙集团（Lotus Bakeries）的子品牌，莲乐烘焙集团（Lotus Bakeries）专注于饼干和蛋糕行业，生产工艺正宗的经典产品：焦糖饼干（speculoos)、姜饼、蛋糕系列、华夫饼干和薄饼、姜饼人饼干和Dinosaur饼干等。莲乐集团，总部位于比利时，是一家多元化跨国公司，分别在比利时、荷兰、法国和瑞典建有生产工厂，在欧洲的10余个国家、美国、香港、中国内地、智利等地建立销售机构，并设有专门面向其他国家的出口部门。','L','b880328b-3310-49a9-adbb-acc332e04880.jpg','Lotus','Lotus'),(93,'Maldon来自英格兰东海岸的埃塞克斯（Essex），它的外观很质朴，但它在英格兰美食中久负盛名。非常多的顶级英格兰厨师都会毫不犹豫的把最好的盐的殊荣交给Maldon。Maldon的魅力在于它丰富、平衡的天然海洋风味，在日常烹调中，无论是沙拉、炖肉、还是你想尝试一下风味独特的意大利荞麦汤（Pizzoccheri Soup），选择Maldon都绝对不会让你失望。','M','dc0fe5a0-6eec-41de-9e74-4760b844d628.png','玛尔顿','Maldon'),(94,'ZOOCCHiNi由美国业界精英团队打造，该团队拥有90年以上的专业零售、研发儿童经验的服饰，为小宝贝提供优质独特又卡通可爱的产品。ZOOCCHiNi主打动物造型儿童连帽毛巾，可爱的图案让宝宝每次洗澡都变成有趣的事情。立体的头型加上背部的3D立体缝制，每一个图案的可爱模样都栩栩如生！为多少宝贝和家庭带来欢乐！','Z','92c10017-d454-4474-8950-76c3921c995d.jpg','ZOOCCHINI','ZOOCCHINI'),(95,'BabyBjorn是来自瑞典的专业婴儿用品生产商。1961年，Björn Jakobson与他妻子的姐姐Elsa共同在瑞典斯德哥尔摩贝里斯哈姆拉创立了BabyBjorn公司。同年公司推出了第一款产品婴儿椅，受到儿科专家的推荐，在多本瑞典杂志中被报道，市场需求剧增。1973年，BabyBjorn推出了第一款婴儿背袋，取名为\"贴心关怀\"，再次获得父母的青睐。','B','dd393053-767a-41b0-8593-065e7dd36aa1.jpg','Babybjorn','Babybjorn'),(96,'KOWA是日本兴和株式会社集团所拥有的品牌，兴和集团以兴和株式会社为核心，拥有众多关联企业，是一个开展多种企业活动的企业集团。自1891年创业以来，在超过100年的历史中，始终贯彻坚实的产品制造精神、把握时代的变化、锐意挑战和不断进取的精神，将此作为两个支柱，不断发展至今。 在中国市场中，尤其以KOWA的单筒和双筒望远镜享誉盛名，KOWA在医药及医疗器械行业也是名声不菲。','K','d2a4a23a-3d4f-4264-bb1f-776254e97313.jpg','KOWA','KOWA'),(97,'BOON公司的成立是从一个绿色青蛙开始的……那只绿色的大青蛙，用它可移动的铲子，暴风般席卷了欧美市场，获得了2005年婴幼儿用品创新奖，并成立了BOON公司。产品一上市就吸引了众多媒体的关注：包括古纳雅尔旗下PARENTS在内的许多国内外媒体都对BOON的产品进行过报道。','B','4d08b9f3-96db-453c-a246-9a75e834d3c0.png','Boon','Boon'),(98,'娜迪奥Natio，于2009年创立于澳洲专门制造护肤品及化妆品的家族生意。主要种类有护肤、彩妆、身体护理、男士护理。在过去的75年,该家族为全国研制超过4代的国际性品牌。Natio始创人从瑜珈冥想中的享受得到自我启发,及希望能够将其体验,透过Natio的产品及哲学与他人分享。','N','0bc6e755-652f-4a69-aea6-93d166c68fcc.jpg','娜迪奥','Natio'),(99,'\"Santen作为一家专业的制药公司，主要从事眼科领域，Santen已在日本建立的眼科处方药品市场的一个极为重要的地位，已经扩展到全球市场。 Santen将继续致力于提高全球人民的视力和健康。\"','S','f5bd973c-82d9-47e5-a034-f614ee887276.gif','参天','Santen'),(100,'1921年在法兰克福奠下基业，德国BRAUN博朗以精致设计缔造出一个个经典，成为德国设计典范，曾获60多项红点设计大奖。现代、简约、纯正和高品质是博朗的风格。博朗的设计理念，更被其设计大师迪特·拉姆斯总结成那赫赫有名的“十句箴言”，影响着一代又一代设计师。再加上精益求精的德国工匠精神，使其产品在世界各地广受喜爱。旗下10大类200多种产品涵盖男士剃须、女士脱毛、美发护发等，成为全球小家电巨头。','B','af87e523-68c3-4dff-af3e-30bec1035247.jpg','博朗','Braun'),(101,'MARVIS来自意大利，成功把牙膏概念重新演绎，使简单的护齿变成生活享受。英国航空头等舱专用牙膏，时尚界大咖推崇：贝嫂、麦当娜、汤姆·克鲁斯、贾斯汀。创意教父包益民大赞“MARVIS牙膏让刷牙成为夜里除了滚床单外，第二件让人期待的事。”香港填词人黄伟文力捧“MARVIS牙膏绝对是在名品云集的Joyce里唯一不假思索买下的东西。”被网友誉为“牙膏中的爱马仕”。','M','83e22a15-e267-4caa-8518-92d4dc51e7f4.jpg','玛尔斯','Marvis'),(102,'A.H.C隶属韩国CARVER KOREA化妆品集团，为韩国美容专业线高端品牌，也是功效性化妆品牌。A.H.C的品牌理念是；让您在家也能享受到专业美容沙龙的尊贵体验，致力为全世界的女性寻找或创造美丽，笑容，自信！','A','17d262f3-6f00-4a13-8e9c-8f27a4397859.jpg','AHC','AHC'),(103,'Propolinse日本漱口水品牌，非常温和但效果超常，直接将口腔内的蛋白质污垢固化，肉眼就能看得见，前所未有的畅快感受。它没有以往普通超市在卖的漱口水的不良使用感，对牙齿的伤害几乎为零，含蜂胶萃取物、天热木糖醇等，防止蛀牙，帮助口气清新。','P','bfcdb0d2-2153-4de7-9316-283568f5c5bb.jpg','比那氏','Propolinse'),(104,'日本阿斯制药始终专注于为人类提供卓越的生活空间“事业”。“安速”秉承“以高品质，获得顾客的信赖”的企业理念，本着用良好品质与世界共生的经营理念，以充满热意、创意的精神制造消费者信任的产品，同时公司还在不断引进日本先进技术和新的产品，努力扩充丰富自己的产品线，填补国内市场空白，满足更多不同消费者的需求，给卫生杀虫行业带来更新的理念。','A','08eb1534-9085-4971-b49b-468aabbd920b.jpg','安速','ARS'),(105,'BABY BANANA（香蕉宝宝）是美国知名婴儿牙胶牙刷品牌，诞生于2004年，设计出对婴儿最安全的“C”型香蕉牙刷，通过牙刷FDA认证和相关测试，是当时市场上独一无二的可弯曲牙胶牙刷，并在美国华盛顿发布了该产品，受到妈妈和医生的认可。自从香蕉牙刷面世以来，该公司还开发出更多的可弯曲牙刷，包括训练牙刷、玉米牙刷、鲨鱼牙刷等等，堪称宝宝出牙必备神器，风靡全球。','B','4b9537b0-72d9-4665-b2e6-f7f1104ebd7c.jpg','香蕉宝宝','Baby Banana'),(106,'成立于1966年的BRITA（碧然德），总部设在德国陶努斯坦，是全球领先的饮用水优化品牌，发明首个家用滤水壶，在许多国家它已经成为滤水壶的代名词。自1966年碧然德集团发明首个家用滤水壶以来，这个德国家族企业的业务如今已遍及五大洲的60余个国家，拥有18家国内和国际子公司、股份公司、销售和工业合作伙伴，并在德国、英国和瑞士设有多个制造工厂。“我们将改变人们饮水的方式，并保证持续性发展！”','B','e26a34e3-e6e4-4ad5-8abc-005d9c94bce5.jpg','碧然德','Brita'),(107,'BIODERMA贝德玛于1992年连同法国国家级研究院INSERM及CNRS的资深学术研究人员，在位于法国里昂的专业实验室（Laboratoire Dermatologique BIODERMA）成功研发出多系列的医学美容护肤产品，由于产品本身秉承的生物学理念及优异的安全舒适性，更成为可用作皮肤科医生处方及药剂之护肤产品。作为法国三大医学护肤品品牌之一，贝德玛今天已经取得畅销世界七十多个国家的骄人业绩。','B','bc986622-1f58-4591-9367-3c4ba971d82c.jpg','贝德玛','BIODERMA'),(108,'膳魔师（中国）家庭制品有限公司 Thermos (China) Housewares Co Ltd(简称TCC) ，系享誉国际已百年之全球最大知名高真空系列产品品牌THERMOS（膳魔师）家族的一员。于1995 年由港、日合资，进入中国市场。膳魔师（中国）家庭制品有限公司产品主要有高真空不锈钢保温杯、保温瓶、保温壶、保温罐、焖烧锅等高品质保温系列产品以及以高TCC科技太空技术研发的各式复合金炒菜锅、汤锅锅具系列等等之家庭厨房系列用品。','T','debf100e-5668-470f-a37a-3e8cf5801298.png','膳魔师','Thermos'),(109,'虎牌公司是日本的一个高品质真空瓶及消费电子产品制造的跨国公司。虎牌魔法瓶的创业者菊池武范在日本爱媛县三岛村[此后的三瓶现在叫做西予市的一个实业家中诞生，但是由于12岁时父亲事业的失败，加上父亲脑溢血倒下，病魔缠身，小学上到一半退学后不得不去大阪的纺织工厂上班。到1918年他开始将制作和销售真空水瓶作为自己的副业。','T','7159c17a-bdb0-4696-9b8d-e595cfa83475.png','虎牌','Tiger'),(110,'miu miu（缪缪）是Prada唯一一个年轻副线的品牌，率性且充满实验风格，与Prada是同一设计理念的另一种表达方式。miu miu成立于1993年的意大利，其出色表现绝对合乎Miuccia Prada的家族名堂。而当时Prada的时装风格仍属保守派，Miu Miu 提供了另一个对立选择：感性及反叛的时髦服饰。miu miu注重优雅精致且不乏趣味，将女性气质发挥到极致。通过具备突破意义的广告大片及故事短片系列，使品牌呈现了现代女性的多面特质。','M','4a08c979-028c-4cc5-bb28-5db5989c159e.jpg','缪缪','MiuMiu'),(111,'象印株式会社于1918年在日本大阪创立，以电饭煲、热水瓶，以及不锈钢保温瓶为主打产品，是日本高品质的电器产品制造商和销售商。之所以采用象作为品牌标志，是因为象在亚洲被认为是神圣的、性情温厚的象征。另外一个取象作为品牌标识的原因是大阪府门真市的虎牌魔法瓶株式会社用虎来做商标标识，所以能够与之抗衡的也就只有象了。','Z','0cca57f3-ccd4-4392-b785-a5f77f6e01dc.png','象印','ZOJIRUSHI'),(112,'CAPTMONSTER是一家成立于美国，创造性的情趣用品生产公司。公司致力于打造年轻人群性健康的个性化时尚品牌，品牌形象定位于追求时尚，清新，崇尚自由，愉悦的性爱体验的活力人群。商标的小恶魔形象既有狂暴又带有萌动的形象，体现了CAPTMONSTER产品的设计理念。CAPTMONSTER产品不仅带来的是一款情趣产品，更代表了情趣用的新时尚。不断为客户带来新的愉悦体验是CAPTMONSTER永远的目标。','C','','怪兽船长','Capt.Monster'),(113,'理肤泉是欧莱雅集团的护肤品牌系列。在上世纪初，在浪漫法兰西维埃纳省的理肤泉小镇，理肤泉皮肤医学水疗中心诞生。其闻名天下的秘密“温泉水”水源自来自30-80米深富含硒元素的白垩土仑层，因疗效卓著而享有盛誉达三个多世纪。理肤泉品牌的名字源自一个地名，相传拿破仑的一队远征军在冰天雪地的俄国患了严重的冻疮，他们来到一个法国小镇的温泉，这里的温泉水竟然让他们奇迹般地恢复了健康，拿破仑因此在此建立了温泉治疗医院。从此这里成为法国第一个也是至今为止最为知名的温泉治疗中心，这个小镇就是理肤泉，理肤泉小镇位于法国中部，是一个典型的法国小镇，距离巴黎约300公里，属于法国“Poitou-Charentes”区。','L','148b1b4d-18bb-4e56-886b-29f22d818056.jpg','理肤泉','LA ROCHE-POSAY'),(114,'SNP是科研公司SD Biotechnologies Co研发的一個品牌，韩国本土第一药妆品牌，在韩国全网上突破98%的消费者满意度。皮肤专家医生独特研发，专为东方人而设的基础化妆品。','S','a7162de7-e5b6-43e7-9b6a-e94a99963b98.png','SNP','SNP'),(115,'Papa recipe是由一位韩国爸爸创建的化妆品品牌。爸爸作为家庭中最重要的角色之一，承担着对整个家庭的责任；为了孩子、妻子以及家中每一位成员的肌肤健康，这位爸爸以爱为名创建了“爱的化妆品”——Papa recipe。用爱家人的热忱，从研制到选料、制作全部严格把关，让所有使用Papa recipe的消费者都能通过产品感受到品牌创始人为给家人肌肤带来最好保护而倾注的心血。采用最为亲近肌肤的天然成分，摒除一切可能伤害肌肤的化学药剂制作而成的Papa recipe产品，使肌肤持久保持娇嫩健康。另外，该品牌的ROSE BRIDE系列，水、乳、面霜等中加入玫瑰原液，具有很好的美白、抗皱、保湿效果，受到了爱美女士们的欢迎。成分天然的化妆品牌Papa recipe可以在All mask story找到。','P','a82da06a-4b1d-4ba9-b7df-69849486ea0f.jpg','春雨','Papa recipe'),(116,'NELSON HONEY成立于1973年，是一个家族企业，100年前家族成员Philip在新西兰的NELSON地区，自家的果园中开始生产蜂巢蜂蜜。经过四代人的努力，现已成为新西兰的养蜂专家！NELSON HONE是活性麦芦卡蜂蜜协会的特许持牌会员；还是新西兰食品安全局辖下风险管理项目的注册成员；获得ISO9001:2000证书。','R','2f7a7b21-e9f1-4f74-be53-447f24f4aaa5.png','皇家花蜜','ROYAL NECTAR'),(117,'兰蔻1935年诞生于法国，是由Armand Petitjean（阿曼达·珀蒂让）创办的品牌。作为全球知名的高端化妆品品牌，兰蔻涉足护肤、彩妆、香水等多个产品领域，主要面向教育程度、收入水平较高，年龄在25～40岁的成熟女性。凭借着对香水的天才敏感嗅觉、执着不懈的冒险精神，以及他立志让法国品牌在当时已被美国品牌垄断的全球化妆品市场占有一席之地的抱负，兰蔻为世界化妆品历史写下美的一页。一支来自法国古堡的玫瑰，凭借着气质，在变幻莫测的女性心理间，在捉摸不定的时尚法则中，足足绽放了六十年。','L','d5641a94-84a4-4797-85c8-6944f9691c7c.gif','兰蔻','Lancome'),(118,'ReEn是韩国LG生活健康旗下主要生产洗护发产品的品牌，韩国知名洗护发品牌，为亚洲人实现“华丽和健康头发的世界梦想”。ReEn从词汇“东方”衍生，从皇宫韩医学的治疗发现头发繁茂的秘密配方，所有的产品都是韩方制成，以中草药熬制，不含硅等化学物质成分，使发质恢复到华丽和健康的原始状态。','R','4e077bc3-a96b-4e01-bd09-5b697b44332a.jpg','睿嫣','ReEn'),(120,'雅漾是法国的一个护肤品牌，雅漾源是位于法国西南地区塞文山脉中的一个古老温情的小镇。它海拔350米，坐落于欧伯山谷之中， L\'Espinouse 和 L\'Escandorgue两山中间，距地中海80公里处。1736年时，由一匹马发现了Avène活泉水的特性。','A','93e2d935-1012-47bc-ac06-b6dfcb9d37f2.jpg','雅漾','AVENE'),(121,'MEDIHEAL是韩国L&P(株)化妆品公司旗下护肤品牌。于2009年4月推出，随即其推出的针剂面膜销售十分火爆，持续多年在韩国非常畅销。MEDIHEAL美迪惠尔的面膜采用皮肤专家的特别配方，联合十多位韩国专业皮肤科专家企划研发，以美容和皮肤科医疗团队的临床理论为基础，获韩国SBS等三大电视台的力推。','M','382d0d48-b3ee-4de2-90a5-21d0c3391a8d.gif','美迪恵尔','Mediheal'),(122,'来自日本的皓乐齿（Ora2），是世界上第一款专为追求健康生活的女性们所创的口腔护理品牌。皓乐齿的品牌精神是让每位女性通过享受每天的口腔护理，最终能拥有自信完美的笑容。清新亮丽的每一天从皓乐齿的细心护理开始！','O','8da0df89-1339-401e-a8c1-c88db0ba7610.png','皓乐齿','Ora2'),(123,'日本第一大零食厂商卡乐比(Calbee) 1964年起，卡乐比推出以濑户内海小虾制成的卡乐比虾条，受到市场欢迎，令卡乐比的名字开始著名。1973年，卡乐比把总社由广岛迁移至东京。现在本社位于东京都千代田区。亦有赞助J League球队广岛三箭。其名称是由钙质与维他命B1的的日文片假名字母合并而成.','C','53efcafe-8b9f-482f-bd05-2fe32821200e.jpg','卡乐比','Calbee'),(124,'来自日本的天然保健品品牌，专注于酵素生产。日本新谷酵素的三大功效：抑制糖份吸收，燃烧过剩能量，调整易瘦体质。其主要产品睡眠瘦酵素专门针对总是在外面吃饭的外食族、夜宵族、甜食控推出的夜迟睡眠瘦身酵素，让你夜宵睡觉也能很好的做到消化，睡觉也能收。日本新谷酵素产品深受吃货朋友们的信赖。','N','b71bca92-470b-4b00-9b29-967c7137f500.jpg','新谷','NIGHT DIET'),(125,'在德国，欧特家博士品牌知名度达97%左右，消费者对于品牌的极度信任也源于此。多家调查机构发起的独立代表性调查显示，欧特家博士在德国食品行业占有领先地位，同时也是公信度最高的食品品牌。这一点与欧特家博士百年来所赢得的公共信任与其在全球化范围内的可持续发展的理念密不可分。','D','5e568461-988d-4d6c-8897-fe1d2f394fef.png','欧特家博士','Dr.Oetker'),(126,'GypsophilA生酵素系列，风靡日本，在乐天市场销量第一。选料天然安全，自然发酵而成的生酵素，帮助人们纤体美容，其主要产品GypsophilA生酵素222种天然植物水果谷物浓缩精华不同于以往的液体酵素，每一颗中都浓缩了高达222种来自蔬菜水果还有天然谷物的天然精华，帮助促进肠胃消化，也降低了胃的压力和负担，避免现代人不良饮食习惯对身体带来的伤害。','G','68ddaaf1-cf42-42fe-ad21-dd1a71336038.jpg','生酵素','GypsophilA'),(127,'Montosco是意大利La Collina Toscana S.r.l.公司旗下品牌，原料采用天然成分制造的香料佐料深受大众喜爱。','M','ab811b79-6bdd-4e25-8dab-deb4e3c51a06.jpg','蒙托斯科','Montosco'),(128,'李锦记创建于1888年，它凭借严格的品质管理和强大的市场拓展能力，在70年代起迅速建立起一个蜚声海内外的酱料王国，畅销产品达60余种，分销网络遍布世界五大洲100多个国家和地区，真正实现了“有华人的地方就有李锦记产品”。与同珍酱油、淘大和八珍并称香港四大酱园家族。 斐然的成绩，使李锦记殊荣备至，先后荣获香港出口市场推广大奖、海外拓展成就奖、亚洲第四大品牌称号及亚洲食品第一品牌等奖项，并当选为香港20大杰出商业机构，李文达主席也被评为香港100位最具影响力的人物之一。进入21世纪，李锦记被评为千禧年香港十大企业。','L','ac5ec58c-25ff-4ea6-a234-1d0b977f39d1.png','李锦记','Lee Kum Kee'),(129,'3M公司全称 Minnesota Mining and Manufacturing（明尼苏达矿务及制造业公司） ，创建于1902年，总部设在美国明尼苏达州的圣保罗市，是世界著名的产品多元化跨国企业。3M为全球近200多个国家的客户提供产品及服务，其产品已深入人们的生活，从家庭用品到医疗用品，从运输、建筑到商业、教育和电子、通信等各个领域，极大地改变了人们的生活和工作方式。','3','9ead3e52-3e51-4137-800e-ef3f3dd31c20.jpg','3M','3M'),(130,'Too Faced在美国是具有相当知名度的彩妆品牌，成立于1998年。Too Faced不仅仅是一个名字，也是时尚的代名词，在未来的发展趋势中它仍然继续占领时尚杂志的主导地位。Too Faced无疑已经牢牢地立足于时尚圈。由于Too Faced的产品色彩丰富、个性强烈、每款产品都有其不同的趣味性更是受到好莱坞的女明星们的青睐，从产品的名称上看更是可见一斑。','T','7f22231e-6cdf-437c-88b0-8b10563555a4.png','Too Faced','Too Faced'),(131,'SOAP&GLORY是英国BOOTS旗下的复古品牌。SOAP&GLORY的包装走的是60年代的Retro复古风,采用了许多那时期的美女图,有点类似于Benefit的感觉,色系全部采用以白和粉,产品则主要以身体护肤品为主。明星产品“坐着瘦纤臀瘦腿霜”独有的“坐着瘦身紧致系统”的有效成分中含有27-33%的caffeine，以lipolytic、firming和draining分解脂肪，收缩紧致肌肤和排水排油三大功能闻名于世，为众多纤体产品所使用。','S','05acbc04-4753-4347-989d-08a75d68a593.jpg','Soap&Glory','Soap&Glory'),(132,'KISS YOU负离子牙刷来自日本健康用品厂商“牙医生FUKUBA”，包装虽然不是很华丽，但是KISS YOU牙刷和一般牙刷不同之处在于，它内藏电池，工作时会产生微弱的电流，可以温柔的去除牙垢。经日本多所大学临床证实齿垢去除率增加23%，其效果已获得日本及美国的牙科大学的实验证明，可替换的刷头经济又实惠！且连续两年荣获日本COSME大赏口腔护理部门冠军！深受日本人的喜爱。','K','','Kiss You','Kiss You'),(133,'1856年创立的鲸鱼牌La Baleine是法国第一大食用盐品牌，采集艾哥-摩特城天然纯净的地中海海水，以18世纪流传至今的制盐方式─日晒蒸馏法─制造，在地中海岸的阳光曝晒下，形成白净无瑕的盐晶颗粒。','L','','鲸鱼牌','La Baleine'),(134,'bad Air Sponge空气清新剂、除味剂已有很长的使用历史。它已经被成功地用于污水处理设施，以减少气味。同时也作为空气清新剂应用于美国白宫、联邦政府办公楼、史密森尼博物馆、铁路交通系统等官方部门。1993年纽约世贸大楼爆炸后，Bad Air Sponge是当时唯一使用的灾后现场空气净化剂。从50多年前成立以来，Bad Air Sponge已经成为灾后恢复中使用的空气清新剂和除味剂的行业标准。','B','','Bad Air','Bad Air'),(135,'let\'s slim品牌2009年在韩国成立。该品牌的冰袖也被称为同类产品的鼻祖，是品质的保证。该品牌的防晒冰袖上市以后迅速火遍韩国，夏天几乎人手一个。近两年因“奔跑吧兄弟”在国内大卖。采用的高端纯净冰丝环保抗菌材料，抗UV防紫外线功能凉爽舒适。根据人体手臂造型，立体设计，均码，紧身，不紧绷。','L','','Let\'s Slim','Let\'s Slim'),(136,'荷兰SES公司从事创意玩具40年之久，是欧洲市场高质量创意玩具领导者，每年有来自80多个国家，超过1400万的孩子在使用SES产品。 SES公司以展现孩子的天赋、培养创造力为目标，开发了多系列的创意DIY产品，包括hobby套装、画笔、涂料、石膏铸造、黏土、道具等。','S','cf53f688-c1be-4640-b792-84713aa55016.jpg','喜思','SES'),(137,'香港合兴集团有70年悠久历史，以诚信经营、踏实稳健的作风在香港工业界享负盛名，旗下之“狮球唛”、“骆驼唛”、“厨宝”、“红桃”、“SS”、“麒麟”等品牌食用油备受香港消费者青睐。在竞争激烈的食用油市场，合兴旗下“骆驼唛”、“厨宝”稳占全国小包装食用油品牌的前列；在广东市场，合兴公司的“狮球唛”、“骆驼唛”“厨宝”品牌油榜上有名。','s','91cfdffd-9c9c-422d-999c-3ae87e0a5f51.png','狮球唛','shiqiumai'),(138,'性温味甘，含丰富矿物质、维他命、氨基酸。','B','','碧泉','Blue Fountain'),(139,'铁元是由德国莎露斯Salus公司出品的滋补品。 纯天然草本配方 有机液态活性铁质，吸收率高达98% 连续10年荣获alive金牌奖、多次荣获著名的VITY奖 超过50个国家最畅销的营养品有效成分。 有机液态铁+丰富维生素C 高效补充铁质，参与造成，增加血液含氧量，改善血液循环，有效缓解脸色苍白、易疲劳、手脚冰凉、头晕、头疼、情绪沮丧、脑力不足、免疫力下降等缺铁症状，从源头去除黑眼圈，令脸色红润光泽，精力旺盛。 维他命B1、B2、B6、B12 是大脑神经递质基础营养素，也是中国膳食最易缺乏的维生素群。铁元内丰富的维生素B族令思维更加敏捷、集中注意力，增强记忆；改善食欲，改善能量代谢，促进燃烧多余脂肪。','F','ca6f35a7-613b-454c-9c66-22c2f4f359a6.jpg','铁元','Floradix'),(140,'日本原装进口Silver Ash白银色发蜡','S','264d6a4f-9289-4b57-ae58-33e5bfed14fc.png','Silver Ash','Silver Ash'),(141,'1997年诞生于日本的彩妆品牌KATE凭借众多的畅销产品在日本彩妆市场上接连不断掀起热潮。自其诞生起已有11年，她的魅力丝毫没有褪色，在日本的开架自选彩妆市场占有率上牢牢稳坐头把交椅。 其眼线液的代言人是扮演NANA的中岛美嘉，相信很多女生会因为刀子而变成KATE的粉丝吧。这个品牌的彩妆是最价廉物美的，尤其是眼影盘，多次荣登日本时尚杂志“眼影盘评选”的榜首，因为它颜色丰富，搭配合理，而且容易上色。','k','f046b122-75f4-4edb-98d2-3199b04d27f9.png','凯朵','kate'),(142,'比利时品牌','A','f8ac6632-4de8-4cfb-ab57-03154972b96e.png','ARO','ARO'),(143,'韩国LG集团于1947年成立于韩国首尔，位于首尔市永登浦区汝矣岛洞20号。是领导世界产业发展的国际性企业集团。LG集团目前在171个国家与地区建立了300多家海外办事机构。事业领域覆盖化学能源、电子电器、通讯与服务等领域。','L','fabcf67d-6cf1-4739-8e3a-bf1bd71e7e5c.jpg','LG','LG'),(144,'O\'Keeffe\'s Company是美国的专业手足护理品制造商，其产品对于肌肤皲裂有很好的疗效，对于经常做家务的妈妈们来说，手的护理格外重要，秋冬天的干燥容易导致手部肌肤缺水演变龟裂现象出现。','O','','奥基夫','O\'Keeff\'s'),(145,'于1872年创立，总部位于东京，日本著名化妆品品牌，亚洲销量第一，是追求革新之美的全球性品牌，百年来一直引领日本化妆品技术与文化潮流。日本著名化妆品品牌，亚洲销量第一，是追求革新之美的全球性品牌，百年来一直引领日本化妆品技术与文化潮流。','A','75f6fe6b-d568-42b6-b611-ce168857e896.jpg','资生堂安热沙','Anessa'),(146,'这一切都来自一位奶奶的秘密配方。有一次，爷爷弄脏了自己的工作服，奶奶就拿出了她的秘密，一种神奇的药水。不久，小镇上都传出了这个消息，每个人都想获得奶奶的秘密。后来我在奶奶的阁楼的旧衣箱里发现了这个秘密，奶奶也非常乐意和大家一起分享这个秘密。','G','6a1db971-12b9-4ba1-b0d5-cb28368e9a03.jpg','老奶奶的秘密','Grandma\'s secret'),(147,'BANG＆OLUFSEN是世界顶级视听品牌。自1925 年在丹麦的斯特鲁尔（Struer）成立以来，BANG＆OLUFSEN就是完美声学艺术的代名词。迄今为止，员工仍坚持手动校准和调谐每个扬声器。BANG＆OLUFSEN一直以不断创造卓越科技和感性魅力完美结合的音频、视频产品享誉全球，充分体现了BANG＆OLUFSEN质疑常规、绵延惊喜的企业愿景。','B','2ef5c3e4-8b3d-4078-b13d-6d12b455544f.jpg','邦及欧路夫森','B&O'),(148,'2007年，创始人 James Park 希望能够鼓励人们实践健康乐活，创立 fitbit 品牌并设计出世界上第一件智能穿戴产品。作为智能穿戴缔造者，一段传奇从此展开。fitbit 是全球智能手环销量第一的产品，畅销全球 42 个国家，目前用户数量超过 1000 万人。在美国，每 100 个拥有智能穿戴的用户，有 67 人使用的是 fitbit 系列产品。fitbit 还与美国顶级医疗机构、保险公司实现数据互通，更好地保障用户健康安全。','F','c7398abf-4be8-47c1-a655-47810949f47b.png','Fitbit','Fitbit'),(149,'1927年创立于意大利的皮具品牌芙拉（Furla）以优质女装手袋及皮革闻名。温婉优雅的设计特质一直深受女士欢迎。其它精品包括钱包、手表、珠宝首饰等均是女士们每季热切搜罗的目标。 芙拉的独特个性表现在其丰富的颜色和款式上。其设计意念撷取自意大利的自然景色，如水清沙幼的海滩、碧波上的帆船、绿悠悠的橄榄园和四季花卉等，洋溢迷人的南欧风情。它没有夸张的商标，凭简洁线条和巧妙的色彩表现女士年轻活泼、俏丽和自信的气质。','F','1f4fc87e-b51a-4cff-aa73-fc21e498b519.jpg','芙拉','Furla'),(150,'30多年前，Marciano四兄弟怀揣美国梦，从法国南部迁往美国，并于1981年创立了GUESS品牌。受欧洲品味的影响，Marciano重新定义了牛仔布。3-zip Marilyn砂洗修身牛仔裤是GUESS推出的早期作品之一，它们在短短几个小时内就被销售一空。这番亮相正式开启了GUESS在时尚界纵横驰聘的风云史。 GUESS是年轻、性感和大胆的代言词。在过去几十年间，GUESS通过其具有永恒魅力的广告宣传，激励人们追逐梦想，活出自我，并帮助籍籍无名的模特新人跻身为世界名模。如今，GUESS的系列服饰产品正在全球80多个国家热销，并成为引导全球生活方式的品牌。','G','d805bccc-74b9-44ec-abab-e4f284f90dd6.jpg','盖尔斯','GUESS'),(151,'迈克达威（McDavid）作为专业的运动护具品牌，已经拥有超过40年的历史。运动医学博士Robert F. McDavid于1969年设计并开发出了第一件在橄榄球运动中得到广泛使用的膝盖侧面护具，由此揭开了运动防护的新篇章。同年，迈克达威产品正式面世。 从美国伊利诺伊州Bellwood的一间地下室，到Woodridge的生产设备及全球总部，迈克达威现在为全球的运动员及各年龄段的体育运动爱好者生产经营超过400种不同的创新产品。','M','dd86e02b-9e67-40f5-84cb-c768802a1a81.png','迈克达威','McDavid'),(152,'森海塞尔（Sennheiser）由Prof. Dr. Fritz Sennheiser于1945年创立，是世界公认领先的专业话筒和耳机制造商。森海塞尔不断引领着新的音频技术的潮流，研究开发中心在德国汉诺威。它也是业界公认的无线电、红外声传输技术、听诊式耳机、航空通话耳机、多媒体传播、呼叫中心耳机和头戴式耳机的先驱。','S','4ef09b24-72b0-4199-b323-c2567bd3ee71.jpg','森海塞尔','Sennheiser'),(153,'卡西欧（CASIO）于1946年4月由精通装配的工程师樫尾忠雄创立，公司的名字来自樫尾的日语读音Kashio。创业之始，卡西欧为计算机制造商，现已发展到拥有计算器、电子手表、电子乐器、液晶电视等产品，这些产品帮助世界各地的人们获取信息，在具有高品质的同时还具有操作简便、功能齐全、实用等特点。 其中，卡西欧手表所代表的活力、年轻、时尚、多功能的品牌形象已深入民心。卡西欧手表凭借创新的开发理念，不断在技术上寻求突破，将更多创新理念运用于腕表之中。研发出GPS+全球6局电波接收、太阳能驱动、强韧机芯和多马达驱动等掌握手表发展方向的先进技术，为消费者带来具有实用价值的六大系列腕表品牌，包括G-SHOCK、BABY-G、PROTREK、EDIFICE、SHEEN、OCEANUS。','C','ed775200-60cd-4843-aee1-e5d0c3bad625.jpg','卡西欧','CASIO'),(154,'Arc’teryx始建于加拿大的海岸山区，是一家生产高性能服装和装备的公司，Arc’teryx生产服装和装备的目的是为使用者能在极端环境中保持自信。 Arc’teryx的名字为ARCHAEOPTERYX LITHOGRAPHICA，是第一种进化具有羽毛能够飞行的爬行动物。图案形象则基于1880年前后于柏林发现的“HMN1880柏林标本”——迄今最完整的始祖鸟化石绘制而成。','A','470c0065-97a9-465d-8e4e-3917efbf85a5.jpg','始祖鸟','Arcteryx'),(155,'无印良品于1980年在日本创立，它与当时社会的消费习惯形成了鲜明对比。一方面，当时的经济呈现出前所未有的繁荣，海外的奢侈品牌逐渐博得消费者的喜爱；另一方面，价廉质糙的低端产品充斥市场。这两方面导致民众的消费方式呈现出两极分化的现象。作为对这种盛行局面的批判，无印良品诞生了。它致力于还原产品实用的形象，这一概念诞生于两个截然不同的立场的交汇点：“无印”即无品牌；“良品”即优质产品。','M','d15ef97b-4077-4dda-86bf-45cd23dcef17.jpg','无印良品','MUJI'),(156,'1999年，两位斯坦福毕业的年轻工程师共同创办了Aliph公司，也就是JAWBONE的前身。几年后，Aliph推出公司第一款无线耳机设备，并将其取名为JAWBONE。由于出色的工业设计和军用级降噪技术，JAWBONE的耳机在业界的各类大小评选中几乎全部获奖，包括连续两年在CES上拿到产品创新大奖。时尚的外形加上出色的性能，JAWBONE在蓝牙耳机市场的地位就此确立。此后，Aliph公司开始了全球拓展，公司的名字也正式改为JAWBONE。 2001年，在英国爱丁堡举行的TED 2011全球大会上，JAWBONE推出了智能健康手环UP。UP完全突破了旧有的思维，做成了腕带造型，UP不仅仅是极客的玩物，它的造型更像是一款时尚配饰。JAWBONE UP获得了巨大成功。','J','65bbc7f4-eb0f-4a96-a1e1-47cb2774dfd7.jpg','卓棒','Jawbone'),(157,'arau是日本Saraya公司旗下的品牌，专门制造清洁用品，其产品不添加任何可能成为过敏原的物质。从创业至今，坚持“制作对自然温和的商品”的理念。品牌畅销10多个国家，受到众多父母的喜爱。','A','b0ccc2a9-d608-40fd-a385-92eb06456f17.jpg','亲皙','Arau'),(158,'Aveeno（艾维诺）是美国婴儿护肤品牌，于1945年由Musher兄弟和 Mayo 诊所联手创立。艾维诺已经被皮肤科专家以及小儿科医生推荐长过60年之久，最受推荐的是治疗湿疹和止痒的护肤品。艾维诺采用最多的天然燕麦和大豆成分，质地温而不腻，多次获得美容时尚杂志的称赞。适合中性偏干、敏感型肌肤，并适用于婴儿，抗敏修护极佳。','A','4c9aa59d-64cb-4def-be24-9d6a856743f3.jpg','艾维诺','Aveeno'),(159,'BANANAGRAMS是美国家庭、教室和宿舍里最流行的拼字游戏品牌，赢过5个游戏大奖，摘得玩具行业协会的最高奖项，每年销售以百万计的香蕉袋。喜欢文字游戏的人，哪怕是一点点的喜欢，肯定会享受BANANAGRAMS的拼字游戏！大人小孩都适合玩，不仅能从玩乐中体验学习的乐趣，还能培养孩子的收纳能力。','B','','Bananagrams','Bananagrams'),(160,'芭比BARBIE，1959年诞生于美国，世界上著名的玩具制造商美泰公司旗下，风靡全球的玩具品牌，全球畅销/深受小女孩欢迎的一种玩偶。','B','418e5cce-5511-4ebc-a38e-eee21b4c60a8.jpg','芭比','Barbie'),(161,'BÉABA来自法国，创立于1989年，旗下有料理系列等6大系列产品，是“安全、健康、美观、高品位”的明星产品专家。产品线从帮助父母为宝宝提供优质，安全，营养的第一餐开始，逐渐延伸到宝宝出生到成长的全程护理。推出的“萌芽阶段美食家”概念，流行全球。','B','682c88f9-3c61-4700-8af7-1b44f89b5933.jpg','贝儿宝','BEABA'),(162,'Bio-Oil于1987年研发，在南非成功上市。经医学MCC批准，生物提取，获得专利，一度被称为“万能油”，成为海外药房的销售冠军，得到国际医学和美容专家的一致认可。2002年开始向全球推广，目前已经在20个国家中成为畅销的疤痕护理和预防萎缩纹类化妆品。','B','4a4b64a3-ac6d-4d53-8d0f-b57546c62be5.jpg','百洛油','Bio-Oil'),(163,'美国缅因州起家的BURT\'S BEES，精选有效天然植物精华，天然纯度95%以上，产品都与蜜蜂有关，质地软滑甜润。价格亲民，给肌肤带来最自然、安心的呵护。BURT\'S BEES是个绿色环保、老少皆宜的护肤品牌，天然安全，为你而生。','B','fcccba91-b4c7-4148-b712-70c902cc7be8.jpg','小蜜蜂','Burt\'s Bees'),(164,'诞生于意大利的Chicco(智高[1]  )，以其十足专业性、高度的安全性及便利性，致力于开发贴心、安全、舒适、方便和可靠的婴幼商品。','C','165f7806-f64c-47b1-bb6e-c0ab65552d89.jpg','智高','Chicco'),(165,'comotomo的创始人Mr.kim是一位韩裔美国人，曾为诺基亚，苹果，三星等顶级跨国企业设计过许多经典产品。他通过生活中的经验发现了当时市面上所用的奶瓶的缺陷，而决心设计出更好的奶瓶。经过数年的艰辛努力，功夫不负有心人，经过不断的修改和优化，2008年Mr.kim终于完成了comotomo奶瓶的设计工作。2010年comotomo奶瓶还获得了有着设计界奥斯卡之称的德国IF的年度设计大奖。','C','e0edb8ca-06af-4985-86bf-082c97913daf.jpg','可么多么','Comotomo'),(166,'绘儿乐（Crayola）画笔创建于1903年，由美国Binney&Smith公司生产，迄今已有百年历史。凭着精益求精，不断创新的专业精神，绘儿乐已成为颜色、欢乐、品质、安全及创意的代名词，备受全球美术老师及家长推崇。','C','20edf571-fbb2-4120-ae19-cb13fd6a44c0.png','绘儿乐','Crayola'),(167,'1996年，由美国医学博士Craig Brown（科蕾吉·布朗）设计出第一个功能性奶瓶，1997年获得国际专利。Dr.Brown\'S 奶瓶是第一个具有导气系统的奶瓶，它仿效母乳喂养的原理，彻底解决传统奶瓶所不能克服的“真空、气泡、负压”等喂养中存在的问题。2000年荣获美国医学设计金奖，这种“正压、自然流畅”的喂养方式，实际上与母乳喂养的体验相似。','D','0995123a-e200-4ef0-8568-9d8f7ae670ca.jpg','布朗博士','Dr.Brown\'s'),(168,'jELLYCAT 玩具品牌于1999年英国伦敦创立，专注于玩具制造开发。品牌一直使用优质面料，可爱以及创新的设计使得其在行业中脱颖而出，迅速成为世界上豪华玩具的代表，并获得了世界上超柔软的玩具品牌殊荣。选择和收集jELLYCAT 毛绒玩具已经成为一种时尚。','J','388c49ef-83da-4fb7-8f25-9e26cb84aef9.jpg','Jellycat','Jellycat'),(169,'法国每个宝贝一定有这么件Kaloo的产品，旗下商品甚至包含了宝宝香水。从宝宝出生起一定会放在宝贝的身边，是宝贝的第一个伙伴。宝宝刚出生时 睡觉是那么的不安 一直想紧紧的抓住什么来缓解初来世界的陌生感。等宝贝长大点了可以安抚宝贝一个人睡觉的孤单。等宝宝能看清东西了 第一眼就可以看到属于他自己的伙伴。无论是宝宝开心了或者难过了，都让宝宝感觉他不是一个人，一直有个朋友守护者他。','K','ac95d84d-a31f-41b8-9d01-f87e0c5dc02e.jpg','卡鲁','Kaloo'),(170,'Kuretake吴竹有限公司成立于1902年，位于日本奈良，至今已有百多年历史，并坚持日本制造。吴竹是第一家生产Bokuteki液体墨水、科学毛笔的厂家。通过结合自己的技术发展，取得了作为一个高品质的文具产品制造商的认可。进入八十年代后，吴竹注册ZIG，包含书法、水彩、美工、漫画等系列产品。现在吴竹根据“ZIG”品牌的实用性和高品质在日本，北美，南美，欧洲，非洲，大洋洲，中东和亚洲国家受到广大用户的青睐。','K','6180d73b-1a9b-4ea8-9800-adf732a575b7.gif','吴竹','Kuretake'),(171,'Melissa & Doug是美国家喻户晓的婴幼儿玩具品牌，创办人Melissa和Doug同样也是孩子们的家长，对待客人就像家人，从聆听每个父母的需求中，以高标准的安全性、耐玩性为基础，针对0~8岁儿童成长必须培养的各项能力来设计不同类型的玩具和游戏。','M','df3e34dc-b413-4d48-bd96-7a12ba4ef6c4.jpg','Melissa&Doug','Melissa&Doug'),(172,'德国MAPA公司生产的世界高质量的婴儿用品的著名商标，在世界婴儿用品市场上享有很高的声誉。该品牌目前已在全世界70多个国家和地区销售，旗下约有三百种婴儿产品，包括奶瓶、奶嘴、护理用品、安全用品、实用产品及卫生用品等。','N','500c10d1-e860-424b-b3cd-b6fe982bde67.jpg','NUK','NUK'),(173,'PALMER\'S 帕玛氏是美国国宝级护肤品牌，170年来获得无数妈妈信任，至今已经为上亿女性解决了肌肤困扰，成为众多明星大力推荐的孕期用品品牌。所有的商品上市前必须经过长时间的研发,并通过权威的安全性及有效性的验证后，才可销售。尤其是独特的可可脂配方更是独步全球，在全球80多个国家销量排名第一。','P','333df2f1-ce6d-4886-994e-dc76bf387fa4.jpg','帕玛氏','Palmer\'s'),(174,'美国婴儿喂养和护理领域极具知名度和市场占有率的领导品牌。1932年在纽约成立，致力于成为一家最优秀的高端个人护理产品公司，坚持创新设计，提供高品质的母婴用品，全心呵护宝宝成长每一步，为妈妈带来前所未有的育儿新体验。','P','f89c0118-6d75-4ffd-b2b3-ccd3cac43f54.png','倍儿乐','Playtex'),(175,'SKIP HOP是来自美国纽约的时尚奢华婴童用品品牌，成立于2003年。同年推出了世界上首款婴儿推车包。致力于以精致的做工、新颖的设计赢得口碑，曾荣获多项国际大奖。其招牌产品——Zoo pace动物园系列书包推出后在全球市场大受欢迎，曾荣获美国“鲍德里奇国家质量奖”。采用可爱的小动物外形，色彩鲜艳，展现“功能”与“童趣”的完美组合，对小朋友很有吸引力，是美国众多明星宝宝实用的首选。','S','837f027d-5b8f-4198-ac0b-7de4f9ccb147.jpg','Skip Hop','Skip Hop'),(176,'The Honest Company是一家由好莱坞著名女星 Jessica Alba 创建的婴儿用品公司，专门为新生儿家庭提供无毒、天然的婴幼儿及家庭用品。','T','61296b55-7c0f-4750-a487-f0d06201e86e.png','The Honest Company','The Honest Company'),(177,'来自纽约的顶级衣物有机护理品牌The Laundress于2004年创立。两名创办人Lindsey Wieber和Gwen Whiting浸润于时装行业多年，希望能够开发一款不含人工添加物，不损害衣物和人体健康，对环境没有污染的洗涤用品。结合专业知识和零售业的经验，经过三年的研发与创新，The laundress推出了一系列结合时尚和环保的产品。','T','d34a616b-d90d-4970-8109-36f6e62d99e1.jpg','The Laundress','The Laundress'),(178,'1895年12月，法国糕点师Louis Dufour苦于寻找圣诞节巧克力糖果的设计灵感，忽然萌发了一种美味的“甘纳许巧克力球”的创意，在浸入融化的巧克力上沾满可口的可可粉—— 松露巧克力从此诞生！如今，我们开发出这种颇具法国格调且享誉盛名的糖果，命名为“法国德菲丝”：精制的配方、美妙的口感、出色的配料，带来纵享美味的时刻。巧克魔公司是一家1948年在法国图尔昆建立的家族企业，最初名为“巧克力和现代糖果厂”。德东市的兄弟凭借其对巧克力的热情不断开展业务，不久便扩展到了区外。随着业务向其他国家的扩展，自80年代以来，公司美誉蜚声国际。','C','61a567c8-deb7-40dd-b31e-01269dcc23c2.gif','乔慕','Chocmod'),(179,'COGIT蔻吉特是一个日本“创意类生活用品”品牌。1970年，作为“创意类生活用品”制造商，株式会社COGIT（蔻吉特公司）成立于日本大阪。在公司成立的40年里，一直致力于创造更多令人愉悦的商品，以达到让客户的生活更加快乐、舒适。','C','34ad996d-2a55-46ef-8131-f14df1e82006.jpg','蔻吉特','COGIT'),(180,'1900年，在澳大利亚的维多利亚省有超过100家的乳制品合作社。1950年，一小部分奶农联合起来形成了今天澳大利亚最大的乳制品合作社。 “Devondale 合作社”— 60年来最重要的联盟，澳大利亚三分之一的牛奶供应源自这里，拥有值得骄傲的牧场文化遗产，股东是2500名充满激情的奶农。大多数奶农都是来自代代经营乳制品的家族，通常全家都会参与牛奶的生产。','D','5ab02334-72fc-484d-b0b6-4a46fce15192.png','德运','Devondale'),(181,'上世纪90年代，加纳政府开放可可豆自由贸易市场，一家名为Kuapa Kokoo的可可农合作社(简称“合作社”)宣告成立。22个村子的超过2000名可可农自发联合起来，他们绕过政府，建立民主机制，进行自由交易。1998年在英国注册了一家公司，它就是著名的非凡巧克力公司(Divine Chocolate，简称“非凡公司”)。','D','e1fcdde3-1ae9-43dd-95bd-87249f6864e9.jpg','非凡','Divine'),(182,'FANCL是日本最大及最有规模的“无添加”护肤及健康食品品牌，现为东京证券交易主版的上市公司。成立于1980年的FANCL，拥有世界尖端的科研和生产技术，研制出有别于一般护肤品并首创不含防腐剂、化学添加剂的美容及健康食品，杜绝了一般含防腐剂的护肤品所引起的肌肤问题，稳占世界的“无添加”领导地位。现除日本外，于美国、香港、台湾、新加坡、泰国等地设立过百分店。在世界各地，FANCL“无添加”已成为优质护肤化妆的标准。','F','522660be-3cd3-4aa6-aa7f-75098e98f65f.jpg','芳珂','Fancl'),(183,'Ghirardelli牌巧克力在美国已有160多年的历史，它凭借着其多年调制开发出的独特口味吸引并征服着成千上万个品尝者和络绎不绝的游客；尤其在美国旧金山市周边地区的名气更是到了家喻户晓的地步。它有着较悠久的历史文化特色、品牌背后的传奇故事以及产品独特的制作工艺。','G','6384080c-2504-4203-8180-cef73b9d597a.jpg','吉诺丹利','Ghirardelli'),(184,'1920年，汉斯·瑞格在德国波恩建立HARIBO（哈瑞宝）公司，如今在英国等欧洲10个国家设有15个生产基地。汉斯·瑞格创造了“跳舞的小熊”，这是一种小熊形状的水果橡皮糖，也就是后来享誉全球的“哈瑞宝金熊”。2003年起，哈瑞宝连续多次在年度最大型消费者调查“欧洲信誉品牌”中被评选为最值得信赖的糖果品牌，“果汁金熊”获得了“2009年最成功的产品创新、最畅销商品”等多项大奖。','H','f16d949c-158f-4f31-8ab7-000270a7bd34.png','哈瑞宝','Haribo'),(185,'北美地区最大的巧克力及巧克力类糖果制造商[1-2]  ；好时公司位于宾夕法尼亚州，是家具有108年历史的老字号公司、好时巧克力的创始人密尔顿·史内夫里·赫尔希先生（Milton Hershey）1903年在这里初创巧克力制造业时，这里还是一片少有人烟的牧场。赫尔希先生以他的智慧和长远眼光设计了这里的一切。在20世纪上半叶，好时镇就是好时公司，镇上的居民几乎全是好时公司的员工。好时公司铺筑了道路，修建了医院，建筑了体育馆、剧场、游乐场、巧克力温泉等几乎镇上的一切公共设施，并带头把好时镇建成美国小城镇绿化建设中的模范。','H','384f90a7-16e5-4327-8e0b-649ce7c03ec5.png','好时','Hershey\'s'),(186,'日本著名健康食品生产厂家，实力雄厚，产品在日本本土销售火爆，5000多家实体药妆店有售，日本著名艺人熊田曜子代言。日本果蔬植物发酵精华，配合日本工艺，促进体内新陈代谢循环，双功效的同时自内而外换发青春活力。','I','733ee8fc-9f74-4404-989e-e2ce041b1a18.png','医食同源','ISDG'),(187,'Jules Destrooper 原为一名烘焙师。由他烘焙出美味的杏仁薄饼(Almond Thins)，成功创造了畅销的业绩。1886年，伟大的先驱者—Jules Destrooper，以自己的名字创造了“茱莉斯”。Jules Destrooper茱莉斯饼干礼盒是比利时皇室御用饼干，深受比利时皇族的喜爱。茱莉斯不仅口味纯正，而且营养健康。让你在品味美味的同时，也给身体带来新的能量。品尝茱莉斯饼干，享受生活每一天！','J','2f86b902-b8b0-488b-97e6-6c6dad0ec790.jpg','茱莉斯','Jules Destrooper'),(188,'Kirkland Signature是全美销量第一的健康品牌。多年来Kirkland Signature的产品以其可靠的产品质量和良好的信誉，在北美众多的保健品品牌中备受关注，拥有极佳的口碑。Kirkland Signature旗下众多产品均通过了美国USP（美国药典/国家处方集）认证。','K','6f186959-6d69-409a-a81a-032d4b8546b1.jpg','柯克兰','Kirkland Signature'),(189,'肌美精为日本Kracie公司旗下品牌。Kracie公司成立于2007年，专营原Kanebo集团旗下的日化用品、药品、营养食品等内容。肌美精的明星产品主要是面膜、美容液等。肌美精致力于为每一位顾客解决肌肤困扰，使用安心原料造就优质妆品。尤其适合工作忙碌，很少有空闲时间保养自己的白领一族女性。','K','55b8e55e-dd10-4d70-bd4f-fa2653abd401.jpg','肌美精','Kracie'),(190,'Mauna Loa是美国夏威夷群岛上的一个大岛，岛上环境优美洁净，火山爆发后遗留的火山灰给植被提供了丰富的养料，岛上植被丰富，整年绿树成荫，空气湿润，非常适合夏威夷果的生长。因此，夏威夷果也是该岛的特产尤其以Mauna Loa这个品牌很受欢迎，凡是去夏威夷岛旅游度假，都会选择Mauna Loa作为旅游纪念特产带回，馈赠亲友。','M','d5c11669-1971-4c34-8a5a-bd70af473d7c.png','莫纳罗','Mauna Loa'),(191,'MIGRASTICK产品内包含100%精油、薄荷和薰衣草，能够有效缓解头痛症状、使整个人会神清气爽、并持久性强，不像一般的风油精很快就散去，最重要的是可以让紧蹦神经得到舒缓，恢复一整天的活力。','M','e6361cdc-c49e-4537-837c-2ab8dd72941d.png','Migrastick','Migrastick'),(192,'Nutra-life(纽乐)是新西兰营养保健品市场的顶级品牌之一，是历经四十多年创造的享誉全球的国际天然保健品牌。VITACO高素质的技术和研发人员将最新的国际科学研究成果和被证明及测试通过的天然成分融合在一起，保证了Nutra-life(纽乐)产品的卓越 品质和功效。Nutra-life(纽乐)系列产品，在新西兰药房和高档保健品店、澳大利亚的保健品店都有售。新西兰和澳大利亚的几代人都信赖这个高品质、高可靠性和高性能的品牌。','N','fc2aaa96-d792-454e-9fe2-da1417f64167.jpg','纽乐','Nutra Life'),(193,'Nutrakey提倡以“健康 生态 纯净”为品牌愿景，面向运动员、素食者、重视健康的消费者，为健康运 动员提供医药级核心产品，同时以有机植物为产品基础，为休闲健康爱好者提供全线产品，让用户身体 跟健康、有活力，生活更幸福。Nutrakey品牌发展以来，一直以用户口碑为良好的宣传，团队人员身体 力行作为品牌代言，吸引了全球众多加盟商的加入，深受健身爱好者的欢迎。','N','7dd78b16-3faf-4386-84e7-b1fbecc7675b.png','纽持健','Nutrakey'),(194,'在超过30年的时间里，NutriCology一直因为提供最高质量、最低过敏性，并提供最尖端的营养补充剂而被人们所熟知。依靠世界各地的医生和营养师对NutriCology的研发支持，加上起源于斯蒂芬莱文博士的突破性的抗氧化研究工作，NutriCology率先推出真正的抗衰老产品。自1979年以来，NutriCology一直使用最纯净的原料，并且实施严格的质量控制在生产的每一个阶段的程序，包括原材料，制造，包装和储存。','N','','Nutricology','Nutricology'),(195,'Ocean Spray 优鲜沛作为有着75年悠久历史的美国果汁饮料与食品产业巨头，是美国较大的罐装和瓶装果酱生产商，在整个北美地区拥有超过众多大型种植园。优鲜沛坚持创新和质量领先战略，研发不同口味及富含多种营养的果汁，果酱，干果等水果加工食品，在全球范围内都有具有较高的知名度和市场占有率。','O','bdb73b22-aed6-4005-8e71-281d890523d6.jpg','优鲜沛','Ocean Spray'),(196,'创立于1933年的OMRON（欧姆龙）集团，是全球知名的自动化控制及电子设备制造厂商。产品涉及工业自动化控制系统、电子元器件、汽车电子、社会系统、健康医疗设备等广泛领域。欧姆龙以其特有的“传感与控制”技术，利用多年的经验，以及对生产现场的深刻理解，不断满足客户对产品多样化和高品质的追求。不仅如此，欧姆龙更在环境保护、生产安全方面为全球客户出谋划策。','O','bb88f3a5-595a-4333-b8df-11ed344da2df.jpg','欧姆龙','OMRON'),(197,'PLANTERS 绅士牌于1906年由意大利移民在美国创立。风靡全球的绅士牌坚果系列，坚持优质的原材料，口味纯正，一直是全球多数消费者的首选坚果类食品。PLANTERS 绅士牌努力经营30多年来，一跃成为全世界最大的坚果品牌。','P','43dcfb69-91e7-4b84-b627-e4ffffea4de1.png','绅士','Planters'),(198,'1877年，QUAKER（桂格）品牌在美国雷本那小镇诞生，如今已超过130年。我们的创始人克劳威尔先生也有着传奇的一生。他青年时靠自己的坚强信念战胜了重病。当他恢复健康回到家乡后，开始专心经营桂格，推广“纯正”的燕麦作为营养又便捷的早餐，成为千万家庭的健康选择。他用一生的心血，成就了桂格品牌的健康事业。QUAKER坚持创始人精神，只选用一等燕麦原料，严格控制水分、色泽、气味、纯粮率等各项质量标准，力求品质始终如一。','Q','c0a25773-a385-49d1-99fb-aec6834c39df.png','桂格','Quaker'),(199,'新西兰本土第一大营养健康品牌，在当地知名度很高，1923年创立，拥有超过90年的天然保健品行业经验，在新西兰和澳大利亚家喻户晓，享有极高的声誉，是一个受人尊敬并值得信赖的品牌，拥有忠实的食品、健康和医药市场消费者。','R','b5f6abbf-0af7-4e7c-a59e-7a5ec75b57c4.jpg','红印','Red Seal'),(200,'Russell Stover（罗塞尔）是美国北部最大的盒装巧克力生产商。始于1996年的美国老牌，坚持手工制作，不含反式脂肪，适合追求健康及担心发胖人士食用。其品种、款式多元化，深受美国和世界各地巧克力爱好者的喜爱，是自用及送礼的最佳选择。','R','56e3ad27-4f8f-46fa-a269-28b54ed49b50.jpg','罗塞尔','Russell Stover'),(201,'ABOUT ME是根植于韩国老牌食品原料加工企业“三养集团”旗下“三养健能仕(Samyang Genex)”推出的新兴品牌，主要产品包括基础化妆品和补充胶原蛋白等体内美容保健产品。不含酒精、人工色素、人工香料，敏感肌肤及孕妇都可以用。获2014年大韩民国消费者信赖代表品牌大奖。2012年起在首尔的时代广场和弘大地区设立卖场后，2014年登陆明洞。','A','6148f755-cf39-4f9b-97c6-6938a91b44a1.jpg','ABOUT ME','ABOUT ME'),(202,'Arnest（爱纳斯特）是日本最著名的可爱寿司DIY工具领导品牌。在日本年销售可达2800万美元。Arnest的产品在大多数日本百货公司都有销售，产品无不是充满惊喜、让生活增添乐趣的好创意，在美国、欧洲和中国都很受欢迎。','A','013e4082-ec8d-4a3e-90cd-533094f800da.png','爱纳斯特','Arnest'),(203,'Astonish,英国是英国的著名品牌，始于1969年，逾今已有45年历史，无害，赢得中国众多消费者青睐；获得ISO9001、ISO14001国际认证的高品质环保产品；行销世界50多个国家，在美国QVC畅销十年之余；锐意进取，不断创新，用高端的科学技术带给消费者满意的一次体验。','A','4326158d-5230-44c3-bf76-cc7de94628e1.png','艾斯托尼斯','Astonish'),(204,'雅诗兰黛集团旗下的环保奢华护发品牌AVEDA，是美容界最有信誉的十大“绿色品牌”之一，主打无化学物质无添加的有机植物护发，梳子和洗发护发产品都很好用！AVEDA雅达全木柄高级气囊按摩梳，经常上杂志和美容电视节目，口碑是有的，不仅能按摩头皮，还能充当按摩器，敲打身体酸痛的部位缓解不适。','A','0983831d-c31a-41c0-9f78-613ce49c0237.jpg','艾凡达','Aveda'),(205,'1944年，Peter Boudum 也就是现在 BODUM 公司的老板 Jorgen Bodum 的父亲，在丹麦的哥本哈根创立了 BODUM 公司。一开始他专门售卖东欧的玻璃制品。随着 BODUM 越来越多的直属专卖店的成立，BODUM 继续拓宽收集漂亮的日常用品的产品设计。从厨房用品到家用品。到今天，BODUM 公司提供给客户从最早的咖啡器具和茶具到餐桌用品和贮存罐、纺织品、浴室用品和小办公用品等。','B','700fa995-8bf5-4997-93e1-d76b6df06e5d.jpg','波顿','Bodum'),(206,'牛牌（COW），日本品牌，世界知名香皂品牌。由牛乳石硷共进社株式会社创建的日本美妆品牌。企业在1909年诞生，同期诞生的品牌为COW（牛牌）。 牛乳石硷悠久的历史及卓越的企业理念，使牛乳石硷及COW（牛牌）在日本成为家喻户晓的品牌。','C','38d3e677-2bc3-4e97-912f-68bc08711789.png','牛牌','COW'),(207,'戴森公司是一家英国的工程技术创新公司，核心技术拥有超过1900个专利的保护，产品行销全球65个国家。1978年，詹姆斯·戴森在使用吸尘器清洁工作室时，对不断减弱的吸力感到十分困扰。他将吸尘器拆开后，发现机身内部的集尘袋会被灰尘阻塞，导致吸力减弱，开始了自己的研发工作。经过5127个实验模型后，他终于成功发明了世界上第一款无尘袋吸尘器。如今戴森已经成长为由全球1000多名工程师组成的技术创新公司。','D','9b25e915-ca44-45bf-9430-06d7c28c5099.jpg','戴森','Dyson'),(208,'GROW GORGEOUS创建于2013年，是英国一家保健美发类品牌，主营HAIR GROWTH SERUM（增发膏）。','G','9b8b809a-fa8d-4831-8114-fc6259b5f104.png','Grow Gorgeous','Grow Gorgeous'),(209,'ideaco&associates成立于1989年日本大阪，本是一家协助商品开发的设计顾问公司，1998年以ideaco 为名推出了经典的CUBE伞架，7年累计销量达40万个，至今人气不减。自此以后ideaco陆续推出许多设计 家饰商品，作品广见于an an、eyeco等女性杂志，在日本竞争激烈的生活杂货界成功占有一席之地。没 有多余的设计才是最美的，这是ideaco一贯的理念。','I','','Ideaco','Ideaco'),(210,'RIS OHYAMA（爱丽思欧雅玛株式会社）成立于1971年，总部位于日本宫城县仙台市，在日本设有8家工厂。成立初期从事家庭和园艺用产品制造，后从园艺用照明产品需求发展LED照明事业。到2013年时，已成为日本前五大LED照明厂之一。并在大阪设立研发中心，2015年与Philips（飞利浦）合作，建立足与其它照明大厂相提并论的LED照明事业。现在商品种类现已超过2万种，在日本，爱丽思的宠物、园艺、塑料收纳产品，位居同类产品市场的第一位。','I','f6e295be-8997-42b5-8dee-52c36426a53b.jpg','爱丽思欧雅玛','Iris Ohyama'),(211,'2002 年 9 月，Antony Joseph 和 Richard Joseph 双胞胎兄弟一同创立了Joseph Joseph，这个以厨房与餐具用品为主的设计品牌。Joseph Joseph的产品多次在国际设计比赛中获奖，精致的做工、实用的理念加上创新的设计为其在世界各地赢得了众多追随者，以至于新品上市的时候供不应求.这个年轻的品牌目前已经成功的销售到全世界20多个国家，并持续的稳定成长中。','J','6f7bfd17-cc59-447d-8058-293afc295ebe.jpg','约瑟夫约瑟夫','Joseph Joseph'),(212,'Kaico是日本工业设计大师小泉诚所设计的一系列珐琅壶作品名称。机能性高，又富设计感的锅壶，让 Kaico在上市之初就被认定是厨房的梦幻品，并获得年度“日本最佳设计奖”殊荣。Kaico系列产品的设 计线条均细腻有型，搭配质感高雅的枫木盖更显优雅，打破了传统美式珐琅器具“地下室器具”的粗犷 形象，Kaico让锅具从单纯烹煮功能跃进成餐具食器，让烹调用具变成雅致的居家精品，却不减其高技能 本色。','K','','Kaico','Kaico'),(213,'Kalita创立于1958年，其命名取自于德语Kaffee Filter之意，是日本最具知名度的专业咖啡器具领导 品牌，至今已推出过无数经典作品，专门制造针对饮料所需要的机器或器具及相关陶具产品。','K','98357be4-7ea9-4ee7-957b-cfd66620c8ba.jpg','Kalita','Kalita'),(214,'Kent Brushes由William Kent（威廉 肯特）于1777年英国乔治三世成立，是英国历史最悠久最古老的的公司之一。 KENT BRUSHES的历史即是英国梳具的历史，跨越4个世纪的肯特以精湛的工艺虏获皇室挑剔的品位， 并为英国皇室9代提供御用美发梳，写下无与伦比的辉煌皇室认证记录，是英国唯一连续获得九届“皇家御用徽章”（ROYAL WARRANT）的品牌。','K','22915fc8-3f8d-4298-b328-18800bb1cd33.png','肯特','KENT'),(215,'来自法国的知名厨具品牌——Le Creuset自1925年来，便以生产色彩丰富的铸铁珐琅锅具而闻名世界，它在欧美家喻户晓，在日本也大受欢迎，因而有“厨房中的LV”的美誉。Le Creuset 锅具都是法国原装进口，来自法国北部小镇FRESNOY-LE-GRAND。Le Creuset锅具由100%生铁打磨而成，而且有防锈珐琅层，这使其拥有持久的保温、良好的密封性能，从来带来回味无穷的烹饪享受。','L','9eef264b-4c63-4b15-99bd-2a605d2e9c1d.jpg','Le Creuset','Le Creuset'),(216,'日本LEC株式会社成立于1957年，是日本最大的家用品制造商之一，在日本家用品业界向来享有极高品质 的企业美誉。LEC依靠家用品制造的专业经验，致力于家用生活的品质与便利。','L','2bddcc37-eb9f-4eb8-b4b7-65cfce4dd7b5.png','LEC','LEC'),(217,'日本Lemnos，以\"把时钟做为生活重心的生活方式\"做为设计主轴来从事时钟等产品设计，生产，贩售的日本制造厂。1974年成立于日本富山县高冈市，66年起和现在的精工株式会社合作进行表框的制作工作。80年代起开始各式各样的组装工作，至今已推出许多以时钟为主轴的家饰作品。也曾获重要的设计殊荣，和成为许多国际美术馆的永久馆藏，在国际上拥有极佳的评价。','L','','Lemnos','Lemnos'),(218,'上世纪20年代末期一群有共同理念的人组成创意团队成立LUSH，以传统手工艺的方式制造产品。产品的原料均用自然的材料，安全环保新鲜。LUSH是英国非常有名的天然美妆品牌，品牌定位为“天然特色”，成立至今二十多年来，足迹已经遍布全球，深受世界各地美女的青睐。','L','15e43227-5446-4982-a00b-08c0430c82a4.png','岚舒','LUSH'),(219,'在MOROCCANOIL诞生前，品牌的共同创始人Carmen在某次去以色列的旅行中，经友人介绍去当地沙龙体验优油护发。她试用后对自己宛如新生的秀发大感惊喜。这种难以置信的效果令Carmen 感到非常兴奋，当即决定和全世界的女性朋友一起分享这个珍贵的发现。 因为当时的人们并不习惯优油这个产品，Carmen和她的先生一起携手不断提升优油的配方，最终带来了MOROCCANOIL的诞生。','M','b27b9c2f-44d0-4e21-82eb-400ad72f7183.jpg','摩洛哥','Moroccanoil'),(220,'MOR承袭了意大利巴洛克的高贵优良血统，以纯正奢华的品质复兴于於21世纪。MOR选用澳洲当地的花、水果、坚果、草本植物等各种珍贵天然素材，从中萃取精华，凝造独特的天然花草植物性护肤产品，给予身体最细腻的呵护与健康保养，散发芬香宜人的天然植物气味。','M','ebbcf402-a8f4-4b12-be12-a93a8dece1a0.jpg','MOR','MOR'),(221,'ORIGINS雅诗兰黛集团高端植物护肤品牌，以“天然为本，科学为证”护肤理念享誉全球。1990年诞生于美国纽约，它由傲居全球化妆品行业领先地位的雅诗兰黛集团创始人雅诗兰黛夫人之孙——威廉·兰黛（William Lauder）先生创立，是面向男性和女性提供产品线的高效能、纯天然的高档护肤及化妆品牌。采取了天然的萃取、不做动物实验以及最大可能的环保，让商品的纯净以最自然的方式再度呈现在消费者的面前。','O','c4439bfd-490b-4bd8-a3f9-194d7b0ea42b.jpg','悦木之源','Origins'),(222,'OXO（奥秀），来自美国的精致设计品牌，创立于1990年，最早的产品为十几种厨房工具，后延伸至家居生活的各个领域。在美国口碑相当好，设计独特，颜色靓丽而且易于使用，经久耐用。OXO获无数国际设计大奖，包括全球最知名的德国红点大奖。OXO开发通用型设计产品的历史已逾20多年，OXO正扩大用户群，将孩子们也纳入其中。tot是OXO的子品牌，OXO tot儿童产品顺应孩子的成长过程，适合不同年龄和发育阶段使用，备受明星家庭亲睐','O','24e65526-7c94-4a6d-b2ec-acd4cb229ea7.jpg','奥秀','OXO'),(223,'宝洁世界最大的日用消费品公司之一，其产品每天与全球160多个国家和地区的消费者发生亲密接触，息息相关。宝洁所经营的300多个品牌产品畅销140多个国家和地区。通过坚持用细微但有意义的方式美化消费者每一天的生活----宝洁公司得以176年保持持续的增长。','P','c16184ee-b7e4-40fc-baba-6a104c0d7907.jpg','宝洁','P&G'),(224,'Panasonic（松下电器产业株式会社），著名的日本电子产品制造商。自1918年松下幸之助创业，发展品牌产品涉及家电、数码视听电子、办公产品、航空等诸多领域而享誉全球。2006年度《世界品牌500强》第89名，2007年度美国杂志《财富》全球最大五百家公司排名荣获59名。','P','f54ceb01-4841-4ab7-a44c-9a881d9d97c7.png','松下','Panasonic'),(225,'来自意大利的专业化妆品名牌宝柏已经创立了近40年，旗舰店遍及世界各大都会，包括欧洲、非洲、美国及东南亚地区，近年更进军香港化妆界。宝柏化妆品的特色是以色彩传递意念，美学概念源于“无限色彩、无限创意及活力”。宝柏不断积极研制新色彩及新产品，务求引领爱美的女士，进入色彩斑斓的世界，随着心情，不同季节及节日而调配出色的妆容。','P','4679853d-b227-44d7-8820-83e38951ba36.jpg','宝柏','PUPA'),(226,'QUALY，一个来自新亚洲设计中心的新锐设计品牌，所有的产品皆在泰国设计、制造，丰富的创意与高品质的产品已经在欧、美、日本等地大受好评。 “Living with Style！”活出你的生活风格！是QUALY品牌经营的宗旨；将贴近我们日常生活的用品，变成更具巧思的设计，以提升生活的品质。丰富的颜色也是QUALY的特色之一，无论是什么样的空间环境都能搭配得宜，加上多种款式的设计，希望每个人都可以在QUALY找到自己的生活风格！ QUALY每年都致力于推出新的设计，也细心延伸到产品的包装以及品牌经营上，在许多设计展中获得好评！','Q','fcffe5dd-d650-4ce5-9ea6-f0da804e4a20.jpg','Qualy','Qualy'),(227,'achael Ray是美国电视烹饪女王，在美国相当的号召力，家庭主妇都是他节目的忠实粉丝，其同名的厨具品牌Rachael Ray，在设计上有着自己独特的美学，在美国很受欢迎，是美国美亚锅具集团旗下的一个品牌。','R','bcd0ecfe-c5d1-49c2-996d-397cd8a2a978.png','Rachael Ray','Rachael Ray'),(228,'Sagaform致力于为厨房和餐桌、居家和户外提供充满情趣的，有创意的礼品。您将非常自豪地将我们的产品作为礼品送出，但是同时，您的心中必然在犹豫是否应为自己挑选一份同样的礼品。SAGAFORM一直致力于成为人们日常礼品的首选，无论是作为礼品赠送给您参加的周末家宴的主人，或者恭贺您新邻居的乔迁之喜，或者买来装饰您自己的居所。SAGAFORM意味着欢乐，意味着收到您礼物的人满意的微笑。','S','6c3e97a0-5289-45bb-a97b-88285514715a.png','Sagaform','Sagaform'),(229,'SKATER是来自日本的专业日用品制造商，于60年前成立于奈良，其专注领域包括厨房用品、水具等等，特点在于与SANRIO、Pokemon、小学馆集英社、Takara Tommy 等动漫品牌合作，生产授权版本卡通形象的水具等周边产品，在日本国内口碑很好，其在中国内地、香港、台湾、韩国等均设立有分公司。','S','b05bab0f-2c6e-4517-9b2c-3ea4e4c1df8e.png','SKATER','SKATER'),(230,'Tangle ANGEL是凯特王妃的御用美发师Richard Ward所创品牌，旗下有Tangle ANGEL、 Tangle CHERUB多个系列产品。Richard Ward是几百位明星和政要的御用发型师。其所创的Tangle ANGEL是专注于打理头发的新一代产品，“防毛躁、梳柔顺、无疼痛感”都是美发梳的代言词，抗菌是美发梳特有的专利配方，在全世界独一无二。在英国是众多时尚达人的新宠。','T','1fbd7601-1ddb-44f7-a4ad-de57890fe1ba.jpg','Tangle Angel','Tangle Angel'),(231,'TANGLE TEEZER，英国殿堂级专业美发梳，由英国顶级发型师研制，是专为解决纠结打结的新一代专业护发产品，风靡全球的时尚圣品！ 就连凯特王妃也是TT美发梳忠实使用者。TANGLE TEEZER受很多国际超模及影星热捧，Emma Watson曾给它评价是“因为梳理湿发的时候不会断发，而且能让我吹干的时候造型特别好。”','T','56baeb5b-009d-40c8-80d8-ff7b76d99192.png','Tangle Teezer','Tangle Teezer'),(232,'WET BRUSH是美国JDBEAUTY集团旗下的品牌之一，创建于70年代的美国纽约，在全球有多个国家的专业沙龙、百货商场及专卖精品店。','T','c2589606-ceb1-4f44-a881-61507b407a41.png','The Wet Brush','The Wet Brush'),(233,'1837年Charles Tiffany在美国纽约创办了TIFFANY&CO.（蒂梵尼）。自创立以来，TIFFANY一直将设计富有惊世之美的原创作品视为宗旨，崇尚经典，从来不跟风、不媚俗，完全凌驾于潮流之上，因此每一件作品都有着永恒的魅力，简约鲜明的线条诉说着冷静超然的明晰和令人心动神移的优雅。提起TIFFANY，人们自然而然地想到奥黛丽·赫本，她美丽的微笑与TIFFANY品牌一起，成为了人们心目中美丽与经典的象征。束以白色缎带的蓝色包装盒，已然成为其著名的标志。','T','5217f6a7-692c-4d7e-82f3-a68797959487.jpg','蒂芙尼','Tiffany&CO'),(234,'UYEKI公司以人与地球为着眼点，以原材料为立足点，为你的生活带来安心与关爱。关注当下、关注未来， 是UYEKI的出发点。为了实现这个理念，我们一直致力于令生活更加便利舒适的商品开发，近20年以来 深受消费者厚爱。以洗衣剂、清洁剂为主的家庭日用品制造、销售。','U','9c9e6644-7935-456f-9dc7-ad321c904332.jpg','威奇','Uyeki'),(235,'Venus Lab品牌的理念是支援追求美丽的女性的身体护理系列。帮助每一位女性达到自己理想中的完美状态。Venus Lab相信，女性除了要保持身体的完美以外，还应该追求内心世界的丰富，所以Venus Lab励志成为所有女性身边不可或缺的护理产品。','V','f4ca941d-2dbe-4057-ba02-fe07650ed15f.png','Venus Lab','Venus Lab'),(236,'德国ZWILLING双立人品牌诞生于1731年，通过对外收购及技术改进，已成为全球刀具、锅具最高标准的象征。拥有超过2000种不锈钢刀剪餐具、厨房炊具及护理用品，获多项科学专利，开创了摩登厨房理念，让烹饪成为一种享受。','Z','7cdd479f-94ef-4a49-b747-893fe9c3af1b.jpeg','双立人','Zwilling'),(237,'1920年，一位叫Francois Debat的皮肤科医生在法国成立了Innoxa。他相信Innoxa的产品对每个人都是温和的。从一开始Innoxa就确定了不伤害皮肤的理念。借由近世纪的美容实际知识，Innoxa被全世界承认，能有效的在护肤方面提供降低过敏原的成份，而不伤害皮肤。','I','9f037484-174c-4208-a9a4-e94d1fc7e3e5.jpg','爱若莎','Innoxa'),(238,'碧浪是全球日化龙头宝洁公司旗下著名洗涤品牌，深受消费者喜爱。碧浪洗衣粉于1967年在德国推出，是世界上第一款加酶洗衣粉。如今，碧浪洗衣粉已被引入160多个国家和地区，成为世界上最畅销的国际性洗衣粉之一。在2009年BrandZ品牌排行榜中，碧浪的品牌价值跻身Top 100，超越奢侈品牌Gucci及瑞典家居品牌宜家，品牌影响力深入人心。','A','0e31c5aa-0bc8-41b2-8b06-fb4bace9f1fd.png','碧浪','Ariel'),(239,'Febreze（芬亦飘）是日本宝洁旗下品牌，产品很广泛，包括除菌消臭喷雾，消臭凝胶，空气清新剂，车载清新剂，芳香座，助眠芳香剂等产品。','F','077285d3-19d0-4a8e-bdf7-37e13bda963b.jpg','芬亦飘','Febreze'),(240,'海飞丝是宝洁公司的一款洗发精产品。1963年，全球第一支含有活性去屑成分，可有效去除头屑的洗发露诞生，自此，有效去除头屑成为海飞丝深受全球消费者喜爱的最出色的功效。海飞丝品牌1986年进入台湾，1991年进入中国大陆，其系列产品包括：洗发露、护发素、头皮头发按摩膏、头皮修护精华乳。','H','0d0239b6-8cfc-48bb-a4b9-af2d83091db7.jpg','海飞丝','Head&Shoulders'),(241,'瑰柏翠（Crabtree&Evelyn）英国化妆品品牌。瑰柏翠的英文名字Crabtree&Evelyn灵感来自十七世纪极负盛名的作家与园艺学家“John Evelyn”（约翰·爱芙蓉）。30年前，瑰柏翠只是一个专门制造香皂的家庭企业，现在她已经是象征英国优雅贵族气息的品牌，产品包含了日用保养品、精油香水、含精油的天然食品、居家装饰甚至纯棉的家居服装，许多好莱坞影片里都可以看见Crabtree&Evelyn的影子，国内十分受欢迎的《欲望城市》影集里凯莉就总是穿着瑰柏翠的睡衣。','C','0d8c2abd-fa6e-425a-920a-3dfa45fc9062.png','瑰柏翠','Crabtree&Evelyn'),(242,'Calphalon是美国顶级的锅具品牌，总公司位于美国亚特兰大市，工厂位于俄亥俄州Toledo市，其每年卖出超过七百五十万个锅具！ 在美国市场占有率高迖49%! Calphalon产品在高级锅具类别、耐热烘焙类别及厨房纺织品类别均排名第一！','C','4cdf57c7-071f-4ceb-a129-04a81e61ad07.jpg','卡福莱','Calphalon'),(243,'70年代，美国工程师Carl Sontheimer的一次法国之旅，让他爱上了法国的风情和美食。回国后，他决定为专业厨师设计烹饪工具，因而创立了厨具品牌CUISINART。当时，CUISINART以领先科技制造了“多功能食物处理器”系列，旋即风靡全国，成为每个家庭不可或缺的厨房好帮手，并被媒体争相报道。 1989年，Conair集团收购了Cuisinart，并确立了品牌的核心价值：高贵牢靠的材质，独一无二的技术，新颖超前的理念，简洁紧凑的设计，简单实用的功能。以此保证质量。 时至今日， Cuisinart 在美国牢牢占据了厨房小家电和炊具的领导地位，年销售额超过4亿美元。','C','9dfe366e-5435-435b-98bc-3f1c3d5f9fdb.png','美膳雅','Cuisinart'),(244,'三丽鸥公司成立于1960年，是全球著名的造型人物品牌发行商。本着礼物传递真情的经营理念，三丽鸥致力于丰富人际交流的伟大事业。  三丽鸥英文的翻译是Sanrio，旗下有五百多个卡通明星。本着礼物传递真情的经营理念，三丽鸥致力于丰富人际交流的伟大事业，赋予礼品全新的意义 - 礼物不仅是用来表达对他人的尊重，信任，友爱，也可以成为与自己内心世界沟通的桥梁。在帮助人们追求幸福，互求相互理解，彼此建立良好友谊的同时，三丽鸥也为人们提供精神上的休闲与满足。','S','2040b51a-658a-4be5-8495-45c94887a348.jpg','三丽鸥','Sanrio'),(245,'日本著名制药企业。 自成立以来，一直以“为消费者提供健康舒适的生活”为企业目标，运用快速的开发体制，不断挑战新的市场，致力于开发生产消费者所需生活必备品，创造专业品牌，满足消费者各方面需求。','K','60b40390-9fbb-4c1d-a2be-4c7b8f4d96f7.jpg','小林制药','KOBAYASHI'),(246,'Hourglass是美妆达人Carisa Janes在2004在纽约创建的奢侈美妆品牌。旗下的产品将艺术与高端科技完美结合，包装简单精美，高端大气上档次。上市后在美妆界引起轩然大波，没多久就畅销海外了。','H','aa77728e-aa03-4387-b53e-ef0d70fcfdf1.png','Hourglass','Hourglass'),(247,'Kiehl\'s 科颜氏1851年创立于纽约，最初是曼哈顿梨树角的一间药房，160多年的沉淀与革新让其成为全球饱受推崇的药妆品牌，中国粉丝亲切地称其为“724“。最初用世界各地的草本天然原料研发独特配方，2005年含有明星成分角鲨烷的高保湿霜风靡全球。艺术家安迪·沃霍尔最爱科颜氏的蓝色草本净肤水；古巨基、方大同、苏打绿等气质独特的明星也都与科颜氏合作过。','K','1e66ad6e-9969-404a-9ac5-8bf819a0a3e3.jpg','科颜氏','Kiehl\'s'),(248,'KISS ME（奇士美）为日本伊势半(ISEHAN)株式会社旗下的一个著名化妆品品牌，创立于1825年。180多年来，KISS ME已火速成为日本大热的药房化妆品牌之一。KISS ME的品牌设计理念，是不管什么时候，都能让你保持如同漫画女主角般的完美妆容，同时，这也是美丽王国的“姬子”公主为每一位爱美女性所特别准备的神秘礼物哦！','K','fcd51981-8dcf-4615-9020-a34a9443611b.jpg','奇士美','Kiss Me'),(249,'LA MER（海蓝之谜）是雅诗兰黛集团旗下品牌，被誉为化妆品界的奇迹、“面霜之王”。曾在美国太空总署工作的前太空物理学家麦克斯·贺伯博士(Max Huber)在遭受了严重的灼伤之后苦于无药可医，便亲身投入了研究开发，历时12年、6000次实验之后，终于在1965年发明了海蓝之谜，神奇的面霜让贺伯博士的皮肤重新变得细滑、健康。如今，海蓝之谜拥有无数追捧者。','L','19c25095-aeda-4486-8fc5-4a417771af15.jpg','海蓝之谜','LA MER'),(250,'城野医生是日本著名药妆品牌。秉承着坚持做到最好的理念，所有产品不含有害肌肤的成分，而使用具有自然治愈力的天然成分，为肌肤带来适当的滋润，提高肌肤原有的治疗能力，维护一年后，五年后，十年后的美丽肌肤！此产品对皮肤的负担很少，却具有非常明显的保湿、美白等效果，受到很高的评价，2011年，公司主打的多合一护肤产品水凝胶原啫喱的全球销售量突破了两千万。','L','a5a7fbdc-7218-47cf-9d2c-f7158df00fd4.jpg','城野医生','Labo Labo'),(251,'罗拉玛斯亚，是由彩妆大师罗拉玛斯亚 (Laura Mercier) 于1996年创立的化妆品牌，旗下有彩妆、护肤品、身体及沐浴系列和香水等用品。至今，创立品牌至现在的 16 年历程中，Laura 的无瑕娇颜概念，已成为全球主流方向。','L','204f1831-1915-4441-af25-42f76fc6f0a5.jpg','罗拉玛斯亚','Laura Mercier'),(252,'1984年，Dany Sanz女士创立了MAKE UP FOR EVER专业彩妆品牌。Dany女士的初衷是为了满足专业人士各种化妆风格的需求，化出从传统古典到奢侈华贵等各种彩妆效果。时至今日，Dany女士也一直担任着MAKE UP FOR EVER品牌的艺术创意总监职务。 1999年MAKE UP FOR EVER加入LVMH集团，更提出“艺术生活化”的概念，令MAKE UP FOR EVER即卓然不凡又简捷实用，拥有MAKE UP FOR EVER，即拥有了魔力，让你有能力成为自己的专业化妆师。','M','962711ec-56c2-4188-bfa1-8c876be97a33.jpg','玫珂菲','Make Up For Ever'),(253,'Mandom Beauty是来自日本的护肤品牌，于1927年成立的Mandom ，多年来不断为消费者提供优质及领导潮流的产品，成为日本家传户晓的美容及护发品牌。 于1978年，Mandom 创立了其旗舰品牌Gatsby，二十多年来产品深受年青消费者欢迎。除了切合用家需求的产品外，Gatsby起用潮流红星如木村拓哉及本木雅宏为产品代言人，再加上极富玩味的宣传手法，令品牌的形象更深入民心。2008年5月22日，日本漫丹株式会社注资5000万人民币，在上海成立了漫丹（中国）化妆品销售有限公司，并在北京、广州等城市设立了分公司。 公司拥有五大系列主营产品：发蜡、啫喱膏、啫喱水、焗油膏、整发营养水、染发剂等美发护发造型系列；洁面乳、洁面啫喱等洁面系列；男士古龙香水、香体露、走珠香体露、香体喷雾等止汗香体系列；润唇膏、润唇啫喱、剃须啫喱、剃须泡、润手霜、爽肤水、润肤霜等美容修饰系列。','M','aefaf8ce-71e8-48a3-ac16-24926ba27b7e.jpg','曼丹','Mandom'),(254,'第一三共health care 是第一三共集团的医药品制造商。主要涉及一般药品（OTC药品）以及保健品。近年通过不断创造出具有革新性的医药品，提供适应医疗的多样性需求的医药品。为全世界人的健康与丰富生活做出贡献。旗下MINON氨基酸保湿敏感肌面膜为cosme大赏产品，主要针对敏感肌肤，补水保湿。','M','0cbbeaaa-d14e-4b5d-85ca-1fbecbdcba39.jpg','MINON','MINON'),(255,'ORBIS隶属于日本POLA集团，迄今已有80多年历史。ORBIS株式会社致力于无油类化妆品的研发、生产及销售。在日本，奥蜜思（ORBIS）被认为是护肤理念的代名词，仅在日本使用者已达900万人，是消费者深深信赖并喜爱的品牌，目前已位列女性最爱通信贩卖品牌的前三名。','O','c4fab75a-3233-4096-9d7d-419cac03067c.jpg','奥蜜思','ORBIS'),(256,'日本新生代美容品牌RMK，由国际知名的日籍化妆师宏濑留美子（Rumiko）创立，崇尚自然，在彩妆中寻求自我，在make up中找到快乐是她的理念。1997年RMK诞生，同时也推出RMK王牌粉底液，掀起了崭新的“经过精密计算的自然妆容”潮流，成为日本杂志推荐的粉底液，在日本人气超高，是众日本美容品牌的冠军！','R','49d71243-df6b-463a-9196-d0daec1cfa7c.jpg','RMK','RMK'),(257,'ROSETTE 是日本洁面膏产品的鼻祖，洁面的代名词，拥有81年悠久历史，一直深受日本女性关爱的洁面膏产品。作为日本第一支洁面膏产品的生产厂家，ROSETTE销量可观，为畅销洁面膏名家产品之一，一直以生产受女性关爱产品为出发点，不断引进、开创新技术，提高产品质量。秉着满足女性对素肌美的追求，ROSETTE不断研发纯天然、温和配方的自然性护肤产品，适用于包括中学生在内的高中生及成年女性等人群。','R','df393623-fd4c-4deb-bc98-4c7cb69499c5.gif','Rosette','Rosette'),(258,'shu uemura （植村秀）以其创始人名字命名。植村秀先生是全球“风尚主题妆容”的先驱，因其创作的概念前卫和用色大胆而被公认为彩妆艺术界大师级人物。植村秀品牌不断要求自己追求“自然、科学、艺术”的完美融合，倾力创造集简约与高雅为一体的全线美容产品——科技创新的护肤系列、引领风尚的彩妆系列和品质卓越的化妆用具。','s','c820af98-cbb7-469f-b2c9-1dce91ea29a8.jpg','植村秀','shu uemura'),(259,'SK-II诞生于日本，是日本皮肤专家将尖端科技运用到护肤品开发中的完美结晶。自1980年在香港和台湾推出第一款护肤用品至今，SK-II已经成为将尖端科技同纯天然精华结合到护肤品中的先驱，推出了诸多具突破性的产品，如护肤面膜、护肤精华露、多元修护精华霜等。SK-II推出的净白修护面膜、晶致活肤乳液等产品更在日本、台湾、香港和内地多次获得年度最佳护肤品的殊荣。','S','78468e34-811d-478a-a79a-b09c75885628.jpg','SK-II','SK-II'),(260,'诗狄娜（Stila；又译：丝荻拉）是美国高档化妆品牌，位于洛杉矶，1999年，成为化妆品巨头雅诗兰黛集团旗下一员，以生产时髦、自然的化妆品以及采用环保包装而闻名全球。2009年，芭比娃娃（Barbie）与Stila合作推出了彩妆限量系列。','S','09d8c08e-e672-48d3-98aa-06ca2cc53cd6.png','诗狄娜','Stila'),(261,'雪花秀(Sulwhasoo)为韩国著名化妆品品牌，是韩国最大的化妆品公司之一的韩国爱茉莉(太平洋)株式会社旗下三大顶级品牌之一（爱茉莉太平洋、雪花秀、赫拉）。爱茉莉太平洋集团化妆品研究院通过20多年的不断努力，以人参为主、20多种韩方中药材科学搭配制造出的一款抗皱、抗老化非常明显的化妆品之一，是名副其实的韩国名媛化妆品品牌。','S','bef236b5-d48f-4a08-8776-86aa06108960.png','雪花秀','Sulwhasoo'),(262,'源自美国，主打纯净自然的护肤理念，代表产品：玻尿酸精华液等。Timeless Skin Care的护肤产品通过简单纯净而强有力的配方帮助更多消费者减少皱纹、对抗衰老，经受得住时间的考验。无任何化学品添加，努力为地球上的所有生命带来永恒的美丽。','T','','Timeless','Timeless'),(263,'韩国新晋知名化妆品品牌，公司成立于2000年，经过多年的潜心研究和开发，目前已于全球拥有众多销售网点。too cool for school将school定义为“a group of school”,意为拥有独特品味，想要展现自我风格的族群。为了打造不同于传统彩妆的品牌形象，邀请伦敦知名插画家Anke Weckmann，设计角色Sienna、Emma、Joey以及人性化的猫咪Max，大大提升品牌趣味性及认同感。其产品包装既可爱又不失个性，抓住了韩国及亚洲女性的心。','T','923f3a00-20bc-4f5c-803d-554a4e387714.jpg','Too cool for school','Too cool for school'),(264,'第一三共是日本制药品牌，中国也设有它的分厂。TRANSINO是他旗下的美容品牌。基本上全都是美白或祛斑的产品，无论是内服还是外用都非常的好，动不动就登上COSME大赏。第一三共药用美白精华面膜就曾获得COSME大赏第一的称号。','T','d4f35562-5395-4903-adea-da7f91ec18bf.jpg','Transino','Transino'),(265,'日本佑天兰utena成立于1927年，是日本历史悠久的化妆保养品公司，多数保养品更为日本人气商品，品质与效果，81年来一直深受日本女性的喜爱及肯定。佑天兰utena成立以来，致力耕耘日本化妆保养品市场，以追求人类的自然美为宗旨，取材天然，无色素、无香料，优良品质与绝佳效果，赢得大部分日本女性一致肯定。','U','d359308e-d1ee-446b-b497-3eab37ddd1f6.jpg','佑天兰','Utena'),(266,'Wendy Rowe和韩国LG携手打造的重磅级彩妆品牌，展现了国际化流行彩妆的新鲜感、丰富感和自然彩妆感。VDL是韩国专业的自然美妆化妆品品牌，是为实现女性梦想的独一无二的化妆品品牌，拥有口红、睫毛膏、指甲油、粉底和其他多种彩妆产品。VDL不单是韩国人气新宠，更是销量惊人的网络热卖专业彩妆。','V','af35ac9f-080f-4164-bf03-c6bdf25512d9.jpg','VDL','VDL'),(267,'阿玛尼（ Armani） 是世界知名奢侈品牌，1975年由时尚设计大师乔治·阿玛尼（Giorgio Armani）创立于意大利米兰，乔治·阿玛尼是在美国销量最大的欧洲设计师品牌，他以使用新型面料及优良制作而闻名。','A','e1485855-1a0c-4d33-846a-a9e668496d0e.png','阿玛尼','Armani'),(268,'HERMÈS爱马仕世界著名奢侈品品牌，1837年创立于法国巴黎，早年以制造高级马具起家，深受欧洲贵族们的喜爱，一直以精美手工和贵族式的设计风格立足于经典服饰品牌的颠峰。它奢侈、保守、尊贵，整个品牌由整体到细节，再到它的专卖店，都弥漫着浓郁的以罗马文化为中心的深厚底蕴。爱马仕是一家忠于传统手工艺，不断求新的国际化企业，已拥有箱包、丝巾领带、男女装和生活艺术品等17类系列，分店遍布世界各地。','H','c3ff745f-76a3-42df-9aaf-582e431d8763.png','爱马仕','Hermes'),(269,'Egyptian Magic 埃及魔法膏是神奇的万能膏。采用纯天然植物萃取精华，不添加任何工业成分。好莱坞女星的美颜法宝。天后王菲也在用的平民护肤品。坚持使用，有改善痘印、祛疤、改善肤色、淡化黑眼圈、淡化眼部细纹、保湿、抗敏感等功效。','E','7bc47cad-fe85-41bf-8e96-5b7346c64493.png','埃及魔法','Egyptian Magic'),(270,'Curel是日本花王旗下专为敏感肌设计的品牌。希望向每一位受困于干燥性敏感肌肤困扰的人传达最明快的心情。怀着这样的愿望，Curél珂润诞生了。Curel创始于1999年，专门针对干燥性敏感肌肤。它是包括脸部护理、身体护理、头皮&头发护理的全身肌肤护理系列，令你365天，每天都不为肌肤问题而烦忧。','C','94c762e1-35ae-4995-b208-354561682c3a.jpg','珂润','Curel'),(271,'纪梵希Givenchy来自法国的时尚品牌，纪梵希最初以香水为其主要产品，后开始涉足护肤及彩妆事业，希骥能让所有的女人更漂亮。Givenchy除致力于男士绅士服装及成熟典雅的女装精品设计外，更从未停止过为女士增添美丽丰姿而进行的香水、护肤及彩妆用品的研发 。纪梵希曾获金顶针奖、得军团骑士荣誉、奥斯卡优雅大奖等奖项，凭借其独树一帜的优雅格调，在时尚界享有盛名，半个世纪以来持续不辍。','G','2eda9948-9814-46ea-908d-0a18c51e957f.jpg','纪梵希','Givenchy'),(272,'LAB SERIES来自于雅诗兰黛集团，世界首个专业男士保养领导品牌。 自1987年创立以来，致力于各种男性保养需求提供最好的对策，以高端科技、追求效果、经实验证明的品牌概念，深入研究男性皮肤生理学和分辨男性特定保养需求后，让我们创造适用简约、极具成效专门为男士精心设计一套完整系列，从清洁-剃须-修护-头发/身体产品（Clean-Shave-Treat-Hair/Body）。适合各种生活风格的男性使用的先进产品。高科技的产品诉求，让男士更能绽放光彩和魅力！','L','dfd89d58-4bec-4228-a554-35c3518d27de.png','朗仕','LAB SERIES'),(273,'来自英国的百年香水品牌，Penhaligon’s起源于1870年，其创始人是来自康沃尔(Cornish)的一位名叫Penhaligon的香氛调香师及理容师，1870年在St. James’s开了一家理发店，不远处有一家土耳奇浴室叫Hammam。许多客人在这家浴室洗完澡就常到他这里刮胡子。于是他以此为灵感，在1872年创造了一瓶叫“Hammam Bouquet”的香水。这瓶香水包含茉莉，玫瑰和檀香。今日依旧是爱丁堡公爵的最爱，并与威尔仕王子一起指定其成为皇室的御用香水和卫浴用品商。','P','ed567305-3695-48ff-b1b2-7eac49d386f9.jpg','潘海利根','Penhaligon’s'),(274,'CLINIQUE倩碧于1968年创立于美国纽约，现隶属于美国雅诗兰黛集团，是由全球顶尖皮肤医生创建的高端专业护肤、彩妆品牌，更有高端男士护肤系列。致力于挑战皮肤学专业领域的极致产品功效。每款产品通过7200次过敏性测试，不含香料，有效并对肌肤极致温柔。其推广的基础护肤三步骤世界闻名。','C','b9a58978-b6b6-439e-98b6-10d9f8b11957.jpg','倩碧','Clinique'),(275,'雅诗兰黛(ESTĒE LAUDER)， 全球最大的护肤、化妆品和香水公司，与其创始人同名。美国顶级奢侈护肤品牌，以抗衰修护护肤品闻名。1946年雅诗兰黛公司成立于美国纽约，拥有护肤品品牌Clinique（倩碧）、La Mer（海蓝之谜）、LAB SERIES（朗仕）、Prescriptives、Origins（悦木之源），以及化妆品品牌Bobbi Brown、M·A·C，和男性香水品牌Aramis等等。','E','b97bb2db-85c6-4676-93e2-4a02364a3bae.jpg','雅诗兰黛','ESTEE LAUDER'),(277,'全美国最大的扬声器厂家之一，总部坐落在美国麻省，单是从事研究开发的工程师就有几百人，是一家全资独立公司。公司始终以“尽探索之力，享音乐之极”为经营理念，将企业100%的收益都毫无保留地全部投资于企业发展和产品研发。','B','e1d62008-5188-43bb-9821-869ed014bfb1.jpg','Bose','Bose'),(278,'COACH（蔻驰），1941年成立于纽约，是美国高端生活方式时尚品牌。COACH的美式休闲，一向以简洁、耐用的风格特色畅销全球。以其代表的纽约时尚及精湛的手工艺传承而著称，如今已成为经典的美国精致奢华手袋、配饰的代表者。主营男女手袋、服饰、手表等，每一款COACH产品，都是设计与功能的完美平衡。','C','850a6b56-6fa0-4585-b35e-808a9433fa64.png','蔲驰','Coach'),(279,'1898年在英国利物浦，Frank Hornby 用螺丝、螺帽、铁件为基础，为他的孩子亲手制作玩具，MECCANO 手作玩具就此诞生。1901年，Hornby 以「Meccano」之名取得专利权，与後来在美国商品化的「Erector」建构玩具齐名。诺贝尔化学奖得主 Harry Kroto 爵士盛赞这套玩具是「真正的工程组件」，金属的螺帽丶滑轮及构件物，比起现在的类似产品，拥有独一无二的真实触感。孩童们用来自由建构东西的螺帽丶卡拴丶轮轴以及多变的金属孔条，不知启发了多少萌芽时期的心灵，立下了成为科学家或工程师的梦想。MECCANO 的品质及创新始终在『建构组合』这个领域独占鳌头！在经历一世纪之後，至今仍为法国建构玩具领导前驱及国际知名领导品牌。','M','d62393f1-77a1-4097-9c2f-4d332fd9bdb1.png','Meccano','Meccano'),(280,'MICHAEL KORS是一个时装设计师本人创建的同名奢侈品品牌。公司于1981年正式成立，总部设在美国纽约市。它将奢侈品行业带入了一个新阶段并且成功塑造了崇尚自我表达和与众不同的生活化概念，并将品牌和过去的经典美国奢侈品品牌区分开来。MICHAEL KORS已成为美式奢侈生活风格的代表。','M','7c9d25bf-1845-4c38-8101-b025a7853fd6.png','迈克·科尔','Michael Kors'),(281,'Ray-Ban（雷朋）是高端眼镜行业的领跑者，传奇演绎76年。Ray·Ban墨镜是美军的标志之一，战后作为时尚产品迅速风靡全球。雷朋太阳镜除了有良好的防护功能，外形款式更凸显粗犷英武的军人气质，是世界上最畅销的太阳镜品牌。','R','13ed3ffa-ebb0-4297-a686-61756fbe7b6e.png','雷朋','Ray-Ban'),(282,'司马航模属于广东司马航模实业有限公司。主要产品遥控飞机处于市场领先地位，畅销国内外。产品中有适宜初学者使用的双桨系列微型三通道直升机，具有外观精致、飞行平稳、性能稳定、容易操控等优点，深得消费者的喜爱！入驻天猫、京东等大型电商平台。年产值8亿母公司倾力投资，生产供应链完善，库存深度足，产品品质优，高性价比与服务体验！','S','ea1ef273-7877-46d0-b2b2-61cd7d37dcfb.png','司马','Syma'),(283,'TOMMY HILFIGER作为全球性的高端生活方式品牌之一，为全世界的消费者提供一流的款式、品质及价值。品牌体现了经典美式风格，并对学院派进行了全新的演绎。自1985年创建以来，TOMMY HILFIGER集团已成为一家销售额达到46亿美元的服饰零售公司，为消费者带来各类设计精美，品质卓越的男女装、童装、运动装、牛仔以及一系列许可证产品，如配饰、香水和家居用品。','T','6d61686f-0874-42da-80b6-d87107c3fe98.jpg','汤米·希尔费格','Tommy Hilfiger'),(284,'TOM FORD（汤姆·福特）是同名设计师TOM FORD于2005年4月创立的品牌。被誉为时尚金童的TOM FORD因扭转Gucci时装品牌的颓势而获得了国际声誉，他曾在1994年至2004年担任创意总监，使Gucci跻身世界奢侈大牌之一。他于2005年4月宣布创立TOM FORD品牌。由于他给时尚界带来的重大影响，《女装日报》 (Women\'s Wear Daily) 形容他“谱写了时尚界最大胆创新、最不受拘束的成功故事”。','T','481c307c-33bd-434c-b83c-4a1f96b266f8.jpg','汤姆·福特','Tom Ford'),(285,'BWT(best water technology)倍世集团于1990年由欧洲多家水处理企业重组创立。并随即于1992年成功上市。BWT集团自创立以来便开始采用最先进的水处理技术开阔国际市场，至今在世界各地已拥有70多个下属公司，并在德国、法国、瑞士、奥地利等国拥有规模庞大的生产基地。','B','30d8c9a7-b371-437d-8c37-b6ab6f1eb23e.jpg','倍世','BWT'),(286,'cosmos一直是韩国休闲食品的领军品牌，作为韩国最畅销的膨化食品，公司一直卓越的品质和独特的生产技术为基础，让消费者持有满足感。各种口味各种风格包装引领时尚潮流。','C','d0e42dd3-a617-47db-8266-7c5d27ea4e00.png','Cosmos','Cosmos'),(287,'Julies茱蒂丝饼干自1981年开始扎根于马来西亚，一直都秉承着一个简单的经营理念：食品工业是一项良心事业，我们要生产更好的产品来呈献给我们的客户，经过这数十年积极的市场开拓并建立起广泛的分销渠道。今天茱蒂丝饼干在马来西亚已是个家喻户晓的品牌。茱蒂丝除了“色”“香”“味”俱全，更是加入了“爱”的元素。以爱心诚意之作，因此称之为“爱心饼干”。','J','2f300de6-6f38-4fcb-b175-74061c7746e7.png','茱蒂丝','Julies'),(288,'Cabrioni是意大利一个历史悠久的品牌，卡布莱尼公司创立以来把产品应该取自于大自然这一理念作为 生产指导，卡布莱尼所有的曲奇饼干、威化饼干都是向大自然学习，经过时间的累计，慢慢地形成了自 己独具特色地形状味道和香气。公司对产品的品质极其看重，一直以先进的技术严格的质量管控，产品 独特的形状，口感而感到骄傲。','C','e45bf7ba-8cd1-497f-932c-1ebd09ec6f16.jpg','卡布莱尼','Cabrioni'),(289,'gullon（谷优）于1892年成立于Aguilar de campoo镇。谷优---一个家庭小作坊开始了饼干的生产和制作。到了50年代，谷优终于从一个作坊发展成了一家初具规模的饼干工厂，拥有了自己的生产线。1997年，成为西班牙首家获AENOR（西班牙标准化生产认证协会）的质量体系认证。拥有丰富的产品线，包括玛丽亚、金黄脆、热带奶油、曲奇、夹心饼干、儿童饼干、消化饼干、低糖饼干等多种系列，是西班牙健康饼干市场最大的市场份额拥有者。','G','836a6df5-74d1-4e18-bfbc-48839de9200e.jpg','谷优','Gullon'),(290,'Dalla Costa黛乐是意大利排名首位的“花式”意面生产商，致力于意大利面的生产和创新，是一家具有高速生产流水线、丰富产品种类、颇具规模化的公司。 德乐不断的创新，使得其产品涵盖20余种风味和40多种造型，深受儿童、家庭主妇、情侣和派对人士的欢迎。','D','8dbba6f4-df3c-46ca-ab47-2cca2e3cee4d.jpg','黛乐','Dalla Costa'),(291,'早在1948年，一家传统咖啡店的东主创办了如今全马其中一家最古老的咖啡店“联通茶室”，以独特的烘焙方法，创制出味道香浓的白咖啡。历经六十多年的光景，在不断的改进并为迎合现代人的健康需求，而在“传统中寻新意、现代中渗古味”的理念下，配制了三合一速溶白咖啡，即现今的“故乡浓”白咖啡。','H','f96b9e0b-3c10-4ce2-b858-d4a04485e806.png','故乡浓','HomesCafe'),(292,'韩国食品棒棒糖品牌','M','','帕克大叔','Mr.Park\'s'),(293,'Colcafe哥氏咖啡是世界上著名咖啡品牌，优选上乘咖啡品种,100%哥伦比亚阿拉比卡咖啡，具有浓烈而值得怀念的味道。哥伦比亚咖啡香味怡人，中度酸，苦味轻，溶解性好。','C','7f2bad3d-d6a9-419e-913a-36ed3418f6f9.jpg','哥氏','Colcafe'),(294,'猫头鹰咖啡，来自美丽的狮城——新加坡。自1956年成立以来，拥有近60年的烘焙及咖啡调制经验。历经时间考验的配方，使每一杯醇香浓郁的咖啡都能带给您最完美的感官享受。同时也是新加坡以及马来西亚很是受当地华人的喜爱咖啡也是最适合华人口味的咖啡。','O','d62a6909-46e4-4d66-9d2d-3b61206e25cd.png','猫头鹰','OWL'),(295,'DNZ蜂蜜是新西兰的百年蜂蜜品牌，至今还延续着手工制作蜂蜜的传统，在新西兰拥有数以千计的人工养殖蜂箱。其中最引人注目的是麦卢卡系列蜂蜜，具有特殊的抗菌抗氧化功能。DNZ蜂产品的生产线都是在严格监控下进行采集、检验，遵循品质至上、崇尚自然原则，绝对不含生物激素，更不含人工添加激素，以确保DNZ蜂蜜天然纯净的品质。','D','71d1cd24-db57-4630-b6e9-12c8b38cf430.png','DNZ','DNZ'),(296,'1','A','','朝日','Ashahi'),(297,'菲仕乐是世界著名锅具及厨具制造厂商之一。德国菲仕乐所有产品均通过欧洲认证标准。产品卓越的品质和简洁雅致的设计，让菲仕乐在全球拥有众多的爱用者及收藏者。这个享誉世界的厨具品牌进入并且在中国生根发芽，继续它的传奇之旅。德国菲仕乐是世界上现存的，最古老的锅具品牌之一。菲仕乐的历史，就是世界厨具发展的编年史，几乎关于厨具点点滴滴的历史进步，都离不开菲仕乐的发明与技术革新。','F','89ce5e34-2c99-45bb-870d-71eb2538573b.png','菲仕乐','Fissler'),(298,'PHILIPS 荷兰皇家飞利浦于1891年成立，是世界上最大的电子公司之一，在欧洲名列榜首。主要生产照明、家庭电器、医疗系统方面的产品，在电动牙刷、电动剃须刀、照明、医疗诊断影像和病人监护仪、彩色电视以及单芯片电视等产品领域世界领先。现已发展成为一家大型跨国公司，在全球28个国家有生产基地，在150个国家设有销售机构，拥有8万项专利，实力超群。','P','4fc6e4e9-7f90-4420-ab8a-18d5ded4fa49.jpg','飞利浦','Philips'),(299,'福腾宝（Württembergische Metallwarenfabrik AG，WMF），是一个以餐具、锅具、刀具等厨房用品闻名的品牌。它创立于1853年，来自德国南部Geislingen an der Steige。在德国本土WMF福腾宝已有60%的市场占有率，150多家专卖店遍布德国主要城市的繁华商业街区。WMF福腾宝已成为不锈钢厨房餐桌用品的代名词。','W','dad71ba3-2d72-48e6-b138-6233128d737e.jpg','福腾宝','WMF'),(300,'井田（CANMAKE）是日本井田制药株式会社旗下最受欢迎的化妆品品牌，以亲民的价格、便捷的使用和卓越的功效著称，在大众日系化妆品市场占据了一席之地，深受学生族和白领们的喜爱。其代言人为日本著名女星松田圣子和藤井丽娜。','C','008fc006-4ab1-4cac-ac82-7457c1cfdbce.jpg','井田','Canmake'),(301,'创始人Coco Chanel于1910年在法国巴黎创立香奈儿（CHANEL），至今已有百年历史，创始人香奈儿以其本身为典范，创造了一个“时尚帝国”。以“高雅、简约、精美”为设计理念，把时尚带给每一个人！周迅和Anna Mouglalis等都是香奈儿的代言人。','C','69becf18-79a7-463a-9e89-e1aa40e70ccf.jpg','香奈儿','Chanel'),(302,'Dior（迪奥），由法国时装设计师克里斯汀•迪奥（Christian Dior）于1946年创于巴黎，是世界著名的时尚品牌，亦为全球高级时尚品牌控股公司——LVMH路易威登集团的子公司。“Dior”在法文中是“上帝”（Dieu）和“金子”（or）的组合，金色后来也成了Dior品牌最常见的代表色。自1946年创始以来，Dior一直是华丽与高雅的代名词，克里斯汀•迪奥在时尚殿堂一直雄踞顶端。','D','3f2c237c-8618-417f-be91-a88c78a6e09f.jpg','迪奥','Dior'),(303,'HERA科学诞生的地方是美智um。出自世界著名建筑师阿尔巴罗•西萨(alvaro-siza)之手的爱茉莉太平洋技术研究所美智um是在珍惜文化与艺术价值的爱茉莉太平洋企业的指引下造就的最佳作品。在能为研究员们注入灵感，满足文化感知的美智um，诞生出了HERA的美之科学。','H','dc69e4a9-9c88-46f4-8031-af8ebe8c6e8d.JPG','赫拉','HERA'),(304,'innisfree（悦诗风吟）是来自韩国的No.1自然主义品牌，韩国知名化妆品公司爱茉莉太平洋集团旗下的主力品牌。innisfree的英文含义为：纯净自然与健康之美得以和谐共生的纯净小岛。源于爱尔兰诗人叶芝名作“The lake isle of Innisfree”。产品选取来自纯净岛屿——济州岛的精萃原料，特别专注于济州岛上植物的研究，将健康之美赋予每一位消费者。','i','13510adf-6635-4054-805f-f458c54c60aa.jpg','悦诗风吟','innisfree'),(305,'1996年诞生高浓缩植物提取物为主的韩国化妆品牌IOPE（亦博），通过多种基于过硬的尖端技术的融合，呈现皮肤护理的新标准，并通过皮肤显示生物技术的未来。IOPE通过生物活性最大化的机制，在缓解老化功效方面，提出了一种根本的解决办法。','I','b9ce9b7c-f9fb-4f4a-91a3-81d1ebebdb33.jpg','亦博','IOPE'),(306,'Miss Hana花娜小姐为提升轻熟小资女的丰采自信 秉持贴近女人心 致力于生产持久不脱妆、显色不晕染、上妆好方便的平价彩妆精品 以专业高质量审视每一项彩妆品 为每一位消费者。确实把关，售后服务贴心不打烊。','M','96b02ea0-cf45-49fa-9c17-b8e6f4ad24f3.jpg','花娜小姐','Miss Hana'),(307,'Pure Smile自创立以来一直是药妆店的宠儿。凭借其物美价廉及其良好的口碑，在各品牌竞争激烈的药妆店稳占一席之地。Pure Smile最主打的是面膜。此系列的面膜就有18种之多，草莓、维他命、珍珠等等。并且除了脸部，还开发了身体各部分用的面膜，如手、足、膝盖等部位的面膜。是日本很人气、口碑很好的平价面膜品牌。','P','ef6ed918-5591-4411-aaf1-0a1ea56f1781.png','Pure Smile','Pure Smile'),(308,'SU:M37°是LG力推的韩方品牌，在韩国绝对属于高端系列的，提倡的是天然发酵的概念，非常的安全天然，绝对不会因为化妆品里含有的化学成分而打乱整个皮肤的状态，是一款孕妇都可以放心使用的安全性护肤品。不含人工香料、人工色素、合成防腐剂，最大限度地减少因皮肤刺激而引起的副作用，对皮肤温和、安全，可以有效护理问题性或敏感性皮肤。不油腻，不厚重，纯净润泽，给皮肤自然呼吸的舒适感。','S','b00c41e0-414a-4d15-8c6f-4378103516ca.jpg!730x0','苏秘37°','Su:m37°'),(309,'全名为The history of 后（皇后的秘诀），来自韩国LG旗下的韩国宫廷护肤名品。2003年上市，源自宫廷的独秘配方，让广大韩国女性为之疯狂与倾心。后是对高品位、高格调之美的追求。经过数千年传承，拱辰丹的效果经历了岁月的验证，并经现代科学的辅佐，而成为今世“Whoo 后”品牌的核心成分。','w','5ee9e277-8bed-4864-a2f0-af41812a3926.gif','后','whoo'),(310,'【2013年YSL品牌更名SLP，从Yves Saint Laurent更改为Saint Laurent Paris 】中文名为圣罗兰，是法国著名的奢侈品牌，世界著名的时尚前卫品牌，1962年由伊夫·圣·洛朗（Yves Saint Laurent）创建于巴黎。圣罗兰的旗舰产品是昂贵的高级时装、香水、饰品等，圣罗兰主要的香水有：左岸（RiveGauche1971)、鸦片（Opium1977）、巴黎（Paris1983）、香槟（Champagne1993）男性香水有：圣罗兰、Kouros、爵士（Jazz1988）、鸦片男性香水','S','bcf2f0b6-fd11-4ba3-bba9-d0ff7ed0cee2.jpg','圣罗兰','Saint Laurent'),(311,'百匡——阿尔卑斯山的白朗峰这个美丽的山麓孕育出一个欧洲多国皇室最信赖的美容保养品牌,BIOCROWN。结合专业医师、药师、美容师额生化科技博士的专业研发团队，成立BIOCROWN皮肤护理医疗研发中心，并创立了代表生化科技之冠的品牌 - BIOCROWN百匡美妆。强调以天然植物萃取，高渗透度的奈米分子和低敏配方，针对各种不同肤质，研发出完整的肌肤保养调理系列。','B','4ec153f1-4eb5-4382-ba75-02509aafee25.png','百匡','BIOCROWN'),(312,'1','S','','丝淼','SEAMIL'),(313,'ALBION 奥尔滨，日本高级护肤美妆品牌。无论从品质、包装都堪称“世界一流”。单品年年入选日本各种年度化妆品大赏，是日本四大护肤品牌之一。独创美颜护理4部曲（洁肤-软肤-爽肤-活肤），缔造具有透明感和柔韧性的肌肤，有效调整肌肤内部水分、油分、天然保湿因子NMF的平衡，已经颠覆了日本、台湾女性对美肤保养的传统态度和观念。','A','a85bfa22-2a91-4df6-95b4-90e181c5c32f.png','奥尔滨','ALBION'),(314,'COSME DECORTE（黛珂）是日本Kose（高丝）集团旗下的顶级护肤及彩妆，以专柜形式发售。黛珂先进的抗老保养研究发现了实现梦想中美肌的关键——“弹力蛋白”。严选四种草本植物净化能：鼠尾草萃取液、紫苏叶萃取液、野生百里香以及迷迭香水，一次提升肌肤抗氧化力、消炎力、代谢力、循环力，有效改善因季节及环境所引起的肌肤状况紊乱问题，是一款能将肌肤调理为健康稳定肌质的前导型高机能化妆水。','C','c5d67fc8-bc99-4639-bdf5-ad6b581abf0d.jpg','黛珂','COSME DECORTE'),(315,'CPB（全名Clé de Peau Beauté，意为开启美丽肌肤的钥匙），是日本资生堂集团旗下最顶级的品牌，诞生于1982年。迄今为止，CPB已遍及全世界23个国家和地区，并获得了这些国家所有顾客的赞誉和支持。精准维持ldquo酶rdquo的活性平衡，实现真正健康美肌是CPB的产品开发理念。','C','86f74b11-7522-42e0-8106-799759c3812b.jpg','肌肤之钥','CPB'),(316,'IPSA(茵芙莎)是享誉全球的资生堂旗下顶级品牌。IPSA诞生于1987年，IPSA的名字源自拉丁文,相当于英文的self, 代表之意, 是一个重视透过与顾客恳谈后为顾客打造美容私房笺的品牌。IPSA(茵芙莎)的深信肌肤与生俱来拥有自我重生的力量。','I','ce03b653-66ab-4f95-a70a-daec4fd17e6d.jpg','茵芙莎','IPSA'),(317,'Eaoron是Australian United Pharmaceutical 公司旗下品牌。该公司旗下还有其他知名品牌例如DR.slim。Eaoron涂抹式水光针包含透明质酸，辅酶Q10和钛等重要护肤精华成分，能迅速渗透到真皮层的玻尿酸、胶原蛋白微分子团，只需轻轻涂抹于皮肤表面，便能迅速渗透，有效帮助保湿肌肤和软化细纹，使肌肤看上去更年轻和健康。','E','32f785ed-4061-4890-a9e8-5c084890ced3.png','Eaoron','Eaoron'),(318,'britax（宝得适）是英国著名汽车儿童安全座椅品牌，在英国、德国等国家设有多个生产基地。其产品均经过严格设计和检测，在英国BSI注册，权威机构Euro NCAP碰撞测试，被誉为欧洲家庭出行必备品牌。现在宝得适推出完美出行系统，将汽车儿童安全座椅与婴儿推车完美结合，成为欧洲潮流时尚出行方式。','B','4a7911ed-a47c-49aa-b73a-86a35c203129.jpg','宝得适','Britax'),(319,'COSATTO品牌诞生于英国，拥有40多年的品牌历史。COSATTO追求设计上的与众不同，将亮丽的色彩、可爱的图案设计融合到产品中，并协同一组优秀的设计师在不断开发新的产品以便更好的满足宝宝和妈妈的需求，严格的质量检测以及良好的售后服务，使得其在欧美拥有很高知名度，在欧美有近2000家专柜。','C','5ed04520-b32f-4ff5-90cf-685bab3597f3.png','卡萨图','Cosatto'),(320,' Eichsfelder Technik eitech GmbH 是享誉德国的一家集高新技术与产业规模为一体的现代化工具和玩具制作企业。该公司是生产注塑件起家的。经过40多年的发展，该公司不仅将注塑件供应给整个德国玩具行业，而且集注塑膜具和注塑件的生产为一体。除了玩具行业以外，该公司还为德国的汽车行业加工生产，该公司与BMW也有合作，宝马车上的很多配件都是该公司生产的。','E','7c3c0c65-217f-4b07-b9f9-2517b97ca9f0.jpg','爱泰','Eitech'),(321,'在众多的名牌世家中，BALLY可称是独树一帜的一家。无论是时装、鞋类还是手袋，BALLY始终全心全意去实现一种“整体造型”的设计概念，使其作品散发出魅力十足的气质。如BALLY的鞋和手袋，都具有相近的设计特色，相同的皮革制造，缝制方式相同，甚至连标识的手法都相同，这一切均基于一种理念，那就是BALLY要创造一个丰富而多元化但仍是一个完美整体的时装世界。','B','74a12009-5743-4db5-9265-d9e519314d73.jpg','巴利','Bally'),(322,'BOTTEGA VENETA始创于1966年，有着“意大利爱马仕”之称，旗下产品由最初的皮包扩展至服装、高级珠宝、眼镜、香水、家具及家居用品等不同领域。BOTTEGA VENETA坚持其“卓越的材质、精湛的工艺、时尚的功能，以及隽永的设计”的品牌理念，在70年代声名鹊起，成为知名的世界品牌。','B','ae0737be-67f7-4b29-a2e8-f9c986b2dacf.jpg','葆蝶家','Bottega Veneta'),(323,'BURBERRY（博柏利），创办于1856年的标志性英国奢侈品牌，极具英国传统风格，是英国皇室御用品牌。过去的几十年，Burberry主要以生产雨衣、伞具及丝巾为主，而今博柏利强调英国传统高贵的设计，赢取无数人的欢心，成为一个永恒的品牌。其多层次的产品系列满足了不同年龄和性别消费者需求，公司采用零售、批发和授权许可等方式使其知名度享誉全球。','B','c4a5dc5a-8795-4d69-bd31-20cdfa6d20e1.jpg','博柏利','Burberry'),(324,'总部位于意大利米兰的杜嘉班纳公司已成为在奢侈品领域中最主要的国际集团之一。Dolce & Gabbana 一个以独特的服装设计和高水平的剪裁而著称的豪华品牌。外高雅，内舒适，真正做到内外兼修。','D','238da957-eaf7-44cf-8998-49616dc3d02c.png','杜嘉班纳','Dolce&Gabbana'),(325,'FENDI（芬迪），意大利著名的奢侈品品牌，最早作为皮革世家，最出名的莫过于It Bag——FENDI Baguette手袋，由芬迪家族的Silvia Venturini FENDI设计。1925年芬迪品牌正式创立于罗马，专门生产高品质毛皮制品｡1955年首次举行芬迪时装发布会｡1965年开始逐渐增加了高级女装、男装、鞋靴、香水。其后还开发了泳装、珠宝、男用香水等。发展至今，FENDI以其奢华皮草和经典手袋在世界高级时装界享有盛誉。','F','93476054-696f-4de8-9f4d-1c2581609a52.jpg','芬迪','Fendi'),(326,'1921 年，Guccio Gucci在佛罗伦萨创办了GUCCI（古驰），他深受英国贵族优雅审美情趣的影响，品牌以大胆创新与意大利传奇工艺品质的独特结合而闻名。GUCCI是全球顶级精品品牌之一，以高档、奢华、性感而闻名于世，浮夸大胆中透露奢华贵气。被称为时尚豪门的GUCCI，代表着“身份与财富的象征”，成为上流社会的消费宠儿。','G','34bd2f78-fdad-4636-afa9-582ac8ddeece.jpg','古驰','Gucci'),(327,'kate spade（凯特·丝蓓）是以手提包、鞋子窜红的美国品牌。kate spade是纽约时装周的常客，以简洁灵动的造型，鲜亮大胆的颜色以及活泼有趣的生活态度风靡纽约。品牌创立之初，当时担任《Mademoiselle》杂志时尚编辑的Katherine Noel Brosnahan 由于遍寻不着心目中时尚经典的手袋，便决定亲力亲为的设计一款实用手包，Kate的决定就此引起生活配饰领域的一场全新变革。','K','a0019b68-3bcd-415c-9b2d-62d08b31bb0d.png','凯特·丝蓓','Kate Spade'),(328,'路易威登于1854年成立于法国巴黎，从皇室御用到顶级工艺作坊，路易威登的种种经典设计顺应了旅行历史的重要发展。代代相传至今的路易威登，以卓越品质、杰出创意和精湛工艺成为时尚旅行艺术的象征。产品包括手提包，旅行用品，小型皮具，配饰，鞋履，成衣，腕表，高级珠宝及个性化订制服务等。','L','da7abdd9-dadd-4ca9-a1cf-dc6f2d47615b.jpg','路易威登','Louis Vuitton'),(329,'意大利奢侈品牌PRADA（普拉达）于1913年在米兰创建。以制造高级皮革制品起家的PRADA，在上世纪二三十年代便深受到欧洲王公贵族们的喜爱。1978年，这个历史悠久的著名品牌被赋予了新的发展元素与活力。创始人的孙女Miuccia Prada担任PRADA的总设计师，她不仅能够预测时尚趋势，更能够引领时尚潮流，与当时具有丰富奢华产品生产经验的Patrizio Bertelli默契合作，经过20多年的努力奋斗，使PRADA发展成为世界顶级的奢华品牌。','P','a2f3e2de-6114-4898-9d62-d528d23664fd.jpg','普拉达','Prada'),(330,'该品牌创立于1978年，品牌标志是神话中的蛇妖美杜莎（Medusa），代表着致命的吸引力。香水很早就是詹尼·范思哲的重要业务之一。他的第一款香水是女用的，就叫“詹尼·范思哲”，1981年问世，是一款花香柏香型的香水，香水瓶被设计成引人注目的钻石形，棱形的底座，有56个切面的瓶身。','V','654920a0-d4a9-4937-b4b5-f7919b15b5d3.png','范思哲','Versace'),(331,'兰芝起源于20世纪40年代，二战结束，韩国女性对美的向往，却并没有因为战争和贫穷而消失。眼光锐利的徐大根先生，从战场上归来，对韩国女性这种积极向上、向往美好的热情所感动，悉心钻研，经过不断的探索和努力，终于开发出韩国的第一瓶雪花霜。爱茉莉太平洋集团将清新快乐的美丽文化融入到了兰芝这个灵感源于韩国东海岸的品牌中。“水”和“光”所构成的是兰芝快乐的内涵。','L','6eed2aca-4c2d-4075-baae-68b6fb1168ea.png','兰芝','Laneige'),(332,'2005年由Randi Shinder女士创办的Fusion Beauty，掀起了美容界的“涂抹式填充液”风潮，主要用于丰唇、紧肤、提升、除皱范围。 芙秀FUSION BEAUTY嘟嘟丰润唇蜜 芙秀FUSION BEAUTY嘟嘟丰润唇蜜 Randi Shinder曾以肥皂清香为灵感创办Clean香水品牌，令女人重拾处女的清香，男人为之倾倒，从而名声大噪，该香水甚至成为Sex and the City完结季的开篇镜头。她的Fusion Beauty则高呼“从此，隐瞒年龄轻而易举”。','F','99297b9d-7202-4cbd-aab1-17ce8b3d1698.png','芙秀','Fusion Beauty'),(333,'波兰女士赫莲娜在18岁时远赴澳大利亚，从事药物配方工作。因此擅长将药物配方科技用在她的护肤品的配方中。1902年，她在澳大利亚墨尔本开设第一家美容院，如今，HR已经遍及51个国家，成为真正的美容王国。品牌致力于服务那些期望获益于先进科技成果、体验明日美容领域惊人成就的女性。在国际颇具实力的美容科技研究实验室的支持下，赫莲娜融汇了先进医学、整形外科科技，并体现“个性化护肤方案”风靡全球。','H','95ede02c-e3ba-4113-8f72-f2b38f953456.jpg','赫莲娜','HR'),(334,'1','F','bacb3dd5-8b15-4283-aad5-bfe86ad1750d.png','Feridies','Feridies'),(335,'1993年，Bill Vaughan博士发明了GU能量胶。20年过去了，GU已经成为了能量胶和运动营养方面的品牌。','G','','能量胶','GU'),(336,'1','H','','健康本铺','HERB'),(337,'1','W','6abdf218-c03f-46f4-81d1-d53e98036aa2.png','太妃糖','Werther\'s Original'),(338,'1','B','','黑金传奇','Blackgold Legacy'),(339,'1','C','','雪沃','Chef Works'),(340,'1','P','babba3da-282d-490c-8c00-43d1486eee42.jpg','Proctosedyl','Proctosedyl'),(341,'1','K','','弘懋','Komo'),(342,'1','C','','Cole&Mason','Cole&Mason'),(343,'1','P','','Prodyne','Prodyne'),(344,'日本香堂继承了天正年间日本皇室的宫廷调香专职「香十」，特别是高井十右卫门代代祖传的秘传技术，以及明治时代被誉为制香天才的鬼头勇治郎的卓越的调香技术。日本香堂把这16世纪以来经过430多年成长发展的独一无二的传统制香技术融入每一支香。','N','20aba4a9-a210-4b8e-91b5-f48d93b6384f.png','香堂','Nippon Kodo'),(345,'NANNYcare品牌始于1992年，长期以来一直作为英国高端羊奶领导品牌。NANNYcare羊奶粉是英国公司专为本土高端羊奶消费者定制，专供英国，完全符合以严苛著称的欧盟标准！英国唯一营养完整、安全的婴儿 配方山羊奶粉。是宝宝健康成长、 发育的极好选择！在宝宝对“牛 奶不适”时，是最佳的替换奶粉。','N','3bfee545-f199-499e-8738-5b20866b62c8.jpg','纳尼凯尔','Nannycare'),(346,'嘉娜宝 (Kanebo) 是来自日本东京的著名化妆品品牌。嘉娜宝 (Kanebo) 品牌创立至今已有百余年之久，涉足化妆品也有60多年，在世界化妆品行业内始终处于重要地位，享有盛誉。','K','49c97f42-f3ef-4707-8596-1522372d145b.jpg','嘉娜宝','Kanebo'),(348,'1','E','','高桑金属','Elfin'),(349,'1','J','','庄臣','Johnson'),(350,'KAWAI无腥味日本肝油丸已有90年历史，全日本销量冠军，100%日本原装进口。咀嚼后有香甜果汁味的KAWAI日本肝油丸可口健康，含丰富维他命，绝无鱼肝油腥味，深受家长及小朋友欢迎，更是日本全国幼儿园指定的营养保健品。','k','091bbd11-7352-4786-9e11-2001126443de.png','卡哇伊','kawai'),(351,'费列罗（FERRERO ROCHER）是意大利费列罗集团旗下的产品，其集团是全球第四大巧克力制造商，并拥有一系列优质创新的产品， 费列罗巧克力（FERRERO ROCHER）更是享誉全球的著名品牌。公司成立于1946年，由Pietro Ferrero先生始创于意大利北部，全力家族式经营，至今第三代，已发展到享誉盛名的跨国集团，并拥有一系列自创的名牌优质产品。','F','df1cf934-3459-45b0-b0cc-00c71300a1c9.png','费列罗','FERRERO ROCHER'),(352,'追求沙龙的理想清洁而生的日本开架化妆品品牌Nursery，主打清爽护肤，就连敏感肌肤也不怕。旗下柚子味卸妆啫喱一举拿下日本COSME大赏卸妆部门第一的美名。Nursery 意味着植物的生长和生命的孕育。Nursery研发高档精油多年，直供大型沙龙，经消费者客户宣传而闻名，品质值得信赖。致力于研发高质量的产品，专业呵护肌肤健康。','N','0f8ebdb2-4981-47ea-b8be-628c092ec0fe.jpg','Nursery','Nursery'),(353,'A2有限公司 (简称“A2C”)是一家迅速成长的乳制品公司， 旗下a2牛奶及相关产品建立在独一无二的知识产权研发及专利技术上， 目前足迹遍及新西兰、澳大利亚、英国及中国。a2品牌牛奶背後的科研主张独树一帜，在全球消费者日益关注健康的趋势下， 带给消费者感受得到的健康益処； 除了得到广大消费者有力的佐证外， 也由公司独一无二的及强大的专利技术在背后支持。','a','32d29eee-e31e-483a-a5db-620ec44c0ff5.png','a2','a2'),(354,'Calvin Klein 是当之无愧为全美最具知名度的时装设计师。其产品范围除了高档次、高品位的经典之作外，克莱恩同时还是那些以青年人为消费对象的时髦的无性别香水和牛仔服装的倡导者。Calvin Klein曾经连续四度获得知名的服装奖项；旗下的相关产品更是层出不穷，声势惊人。','C','','卡文克莱','CalvinKlein'),(355,'RIMOWA高级旅行箱品牌是德国为数不多的旅行箱生产商之一，也是行业内仅有的承袭百年传统的生产商之一。产品采用了以坚固、耐用、轻巧著称的铝镁合金及高科技聚碳酸酯两种材料制作而成，集优质素材、卓越科技、独特设计及超凡手艺于一身，成为“德国制造”的又一传奇。','R','e502010b-85f0-4bd7-bf79-ceef737c44c3.jpg','日默瓦','RIMOWA'),(356,'DHC是一家日本的拥有多个事业部的庞大企业集团。包括翻译事业部、教育事业部、出版事业部、医药食品事业部、食品事业部、酒店事业部、美容院及水疗事业部、内衣事业部等。日本DHC的化妆业务始于1983年，所有产品均以通信贩卖的形式进行销售。从基本肌肤护理至化妆品、美体产品、护发用品、男士护肤品、婴儿护肤品以及健康食品。DHC作为日本通信销售化妆品知名品牌，30年来致力于打造天然、温和、高效护肤、彩妆及健康食品。','D','d9fc89e0-5070-421b-8b76-a665aa2ba386.jpg','DHC','DHC'),(357,'Moony是日本尤妮佳集团旗下的高端婴儿护理产品，采用原装进口的形式，直接呈现给中国的消费者，为了给予宝宝最温柔的呵护，Moony品牌致力于新技术的开发，不断推陈出新，在日本受到了妈妈们的推崇。','M','282f03aa-5f64-402f-ab80-caa40ba82b84.jpg','Moony','Moony'),(358,'自1895年以来，施华洛世奇一直遵循创始人丹尼尔‧施华洛世奇（Daniel Swa-rovski）的宗旨，在仿水晶切割工艺上精益求精。他追求创新设计的热忱，使施华洛世奇赢得国际知名首饰及配饰品牌的美誉。时至今日，施华洛世奇家族仍然秉承这项传统，为世界各地的女生缔造独一无二的时尚风格。','S','','施华洛世奇','Swarovski'),(359,'Wyeth 惠氏是第一罐奶粉发明者，专注早期生命科学，在婴幼儿营养品领域有着近百年研发历史，成立于1926年，总部位于美国新泽西州，属世界500强企业。一百多年前，Gerstenberger 博士在时代责任感的驱使下，成功研发了“适宜的配方奶粉” 。这一划时代的发明创新，揭开了现代婴幼儿配方奶历史的序幕。惠氏奶粉在新西兰、爱尔兰均设有生产基地，新西兰奶源和爱尔兰奶源，均为安全可靠无污染奶源。','W','3debeec4-31af-424f-824c-809335fa2068.png','惠氏','Wyeth'),(360,'BELLAMY\'S（贝拉米）公司由多里·克莱顿创立于1993年，是全球公认的三大有机奶粉品牌之一，同时也是澳洲第一的有机婴儿食品品牌，以最安全、最干净的奶粉著称。目前包括澳大利亚及新西兰只有贝拉米奶粉拿到有机奶粉证书！BELLAMY\'S有机农场位于澳大利亚大陆南部的塔斯曼尼亚岛上，占地30,000亩，是世界上环境最为纯净的牧场之一，由澳大利亚有机认证机构NASAA监控。','B','56f6a6a7-2128-40b0-9ee7-f6ea70b3dc86.png','贝拉米','Bellamy\'s'),(361,'\"Silit喜力特是德国高档厨具制造家，已有百年历史，Silit喜力特凭借出色的产品品质，实用的产品特性以及精巧的产品设计成为卓越的高端厨具产品领导品牌。独有的抗菌抑菌功能的无镍健康新型厨具材料Silargan以及e30等，持续引领享受健康生活美味的烹饪生活理念。 Silit喜力特以激情和专业精神致力于为客户提供更健康更环保，使用更方便的的厨房产品。天然健康是喜力特产品最大的特点。Pure cooking Enjoyment！享受食物的天然美味！喜力特不仅致力于为消费者提供最健康最纯净的烹饪产品以品位食物的天然美味，更倡导一种遵从，享受自然的纯粹的生活态度和方式，纯粹的潜心于烹饪享受中，为自己，为家人，为生活。\"','S','b2eecbb9-462d-4583-b789-332da8787bff.jpg','喜力特','Silit'),(362,'博世是德国的企业工业之一，博世已成为欧洲家电市场占有率第一的领导品牌。100多年来，博世孜孜不倦追求着一个重要目标，用完美的技术和可感知的质量，不断改善大众消费者的生活品质。','B','596ee015-6e6b-4933-96d1-500f14021621.jpg','博世','Bosch'),(363,'STAUB珐琅铸铁锅被誉为“法国国宝”，由欧洲最大的锅具生产公司——法国STAUB公司生产。凭借其独特创新的设计和绚丽的色彩，STAUB在欧洲市场上取得巨大成功。2008年，德国双立人将STAUB收入门下，开启德国双立人的“现代厨房”计划：自由、现代、色彩及高品质。','S','a5c7288f-8615-4704-ae7f-b385c4496443.jpg','STAUB','STAUB'),(364,'德国三叉刀具是一家专业从事设计和制作精密锻造刀具的公司，成立于1814年，近两百年辉煌历史。家族七代相传，真正的德国血统。','W','','三叉','Wusthof'),(365,'澳洲水果','N','','Neova','Neova'),(366,'澳洲水果','F','','Freshee ','Freshee '),(367,'中盐是中国盐业的领袖品牌，2006年9月，中国盐业总公司正式推出了“中盐”品牌，并逐步把旗下分属三十余家盐制品企业的30多个品牌统一到“中盐”品牌名下。 随着中国盐业总公司打造强势品牌战略的实施，“中盐”品牌正在成为中国名牌、国际盐行业的知名品牌。','z','','中盐','zhongyan'),(368,'中外合资的佛山高明鸿鹰食品有限公司，创立于2001年7月2日，累积多年丰富的国际贸易及生产经验，我们拥有胜人一筹的专业眼光，对果仁的产地及生长状况掌控透彻，加上遍布世界的强大采购网络，使我们能从最佳产地采购到顶级的第一手原料。','h','','鸿鹰','hongying'),(369,'中顺洁柔纸业股份有限公司成立于1999年，2008年12月整体改制为股份有限公司，是全国最大的专业生产生活用纸系列产品的企业之一。','C','','洁柔','C&S'),(370,'中粮食品营销有限公司成立于2007年1月，其前身是上海福临门食品有限公司。中粮食品营销有限公司是中国粮油食品（集团）有限公司旗下的全资子公司，全面负责投资方在国内生产的“福临门”，“四海”，“滋彩”等系列厨房食品的营销推广和品牌运作等事务。中粮食品营销有限公司总投资额为5，000万人民币，目前，其旗下品牌“福临门”系列食用油产品的销量位居行业前茅，该品牌已经成为国内食用油行业的顶尖品牌之一','f','','福临门','fulinmen'),(371,'浙江香飘飘食品有限公司，坐落于浙江北部美丽的太湖南岸--湖州市，距上海150公里，杭州90公里;104国道、318国道、杭宁高速、沪宣高速从本市通过;地理位置优越，交通便利。公司总投资额为2.5亿，职工人数2000多人，是当地一家颇具规模的食品生产企业。','x','','香飘飘','xiangpiaopiao'),(372,'浙江苏泊尔股份有限公司，成立于1994年，压力锅行业标准起草单位，大型炊具研发制造商，安全压力锅/球釜IH饭煲/无涂层不锈技术享誉市场浙江苏泊尔股份有限公司是中国最大、全球第二的炊具研发制造商和中国小家电领先品牌。控股股东为拥有150余年历史，在小型家用电器具和厨具行业占据全球领导地位的GroupeSEB集团。第二股东为苏泊尔集团。','S','','苏泊尔','SUPOR'),(373,'拥有138年历史的雀巢公司起源于瑞士。它最初是以生产婴儿食品起家的。今天，雀巢公司已是世界上最大的食品制造商，在全球80多个国家拥有500多家工厂，有近25万名员工。','N','e1dbfb94-2a18-42fe-ad38-9a69b195fa66.png','雀巢','Nestle'),(374,'\"迎驾贡酒，属浓香型白酒，是中华老字号、中国驰名商标，产自安徽省霍山县。迎驾贡酒具有悠久历史文化底蕴。 据霍山县志记载:公元前106年，汉武帝南巡，渡过淮河，沿淠河逆流而上，进入衡山国(今安徽省霍山县)，衡山王选用当地好酒敬献汉武帝，汉武帝饮后连声赞叹，迎驾贡酒因此得名\"','y','','迎驾','yingjia'),(375,'欧丽薇兰Olivoila，食用橄榄油十大品牌，采自意大利优质橄榄品种，产品极天然新鲜，富含橄榄黄金营养，世界著名的食用橄榄油生产商和供应商欧丽薇兰特级初榨橄榄油，来自神秘的橄榄油之乡——意大利。它100%采自意大利优质橄榄品种，经多道人工精心筛选，24小时内人工即时冷榨，萃取第一道压榨出的橄榄油，极天然新鲜，滴滴富含橄榄黄金营养，为您带来意大利原汁原味的鲜活享受，让您领略顶级的意大利枫情。','O','badc6ba0-3b3c-4333-864c-a3a3775194c1.jpg','欧丽薇兰','Olivoila'),(376,'益海嘉里集团是新加坡丰益国际有限公司在华投资的以粮油加工、油脂化工、仓储物流、内外贸易为主的多元化企业集团，也是国内最大的粮油加工集团，总部位于上海市陆家嘴金融贸易中心。益海嘉里集团自20世纪90年代以来，先后在深圳、青岛、天津、秦皇岛、连云港、营口、广州、上海、泉州、防城港、张家港等主要港口及武汉、岳阳、西安、成都、佳木斯、新疆昌吉等主要城市投资设立了40多家工厂和20多家贸易公司，成为国际知名的粮油加工、贸易商，并成功的塑造出“金龙鱼”、“口福”、“胡姬花”等国内著名品牌。','h','','胡姬花','hujihua'),(377,'益达是1984年箭牌公司在美国推出的第一款无糖口香糖，并在短短五年之内跃居全球无糖口香糖的第一品牌。在中国，箭牌公司从1996年开始在广东率先推出\"益达\"无糖口香糖。现在，\"益达\"无糖口香糖的销售网络已经覆盖了国内逾300座城市，深受中国消费者的青睐。','E','f96eba7c-782d-45a6-ad97-613c810f016b.png','益达','Extra'),(378,'洋河，中国江苏洋河酒厂股份有限公司商标。洋河酒历史悠久，起源于两汉而兴于唐宋。洋河酒属于浓香型大曲酒，以小麦、大麦、豌豆为原料精制而成;洋河酒曾多次荣获\"国际名酒\"和入选中国八大名酒行列。','y','','洋河','yanghe'),(379,'\"燕庄出品的芝麻油被很多人称为安全健康的食用油，这种认可不是靠广告打出来的，而是消费者口口相传的“口碑效应”，这也是市场对一个品牌的最好肯定和赞誉。获得此种殊荣是靠产品多年来过硬的质量和对品质的精益求精。 据悉，燕庄芝麻油无论是传统芝麻香油还是专利产品——可以炒菜的冷榨芝麻油，从原料的挑选就开始严格把关：非转基因，零污染，原生态，纯天然是燕庄对原料的基本要求，所有油脂都严格按照国家芝麻油的标准来生产，纯物理压榨，没有任何添加剂和其他油脂加入，100%纯正芝麻油，而且只取头道原汁油，味道香浓纯正。这也只是很多消费者吃过燕庄芝麻油后不再去考虑其他芝麻油的根本原因。\"','y','','燕庄','yanzhuang'),(380,'心相印，又叫心心相印，恒安集团旗下主力品牌，面巾纸一线品牌，始于1985年，湖南省着名商标，中国生活用纸行业领先品牌，其茶语系列/冬己系列广受消费者欢迎“心相印”是恒安集团旗下主力品牌，产品包括干巾、湿巾、保鲜膜等。作为生活用纸行业第一品牌，“心相印”系列产品多样，通过值得信赖的高品质产品诉求，及温馨浪漫的情感关怀，呵护广大消费者的健康快乐生活。心相印在生产规模、新品研发以及市场占有率等方面在国内生活用纸行业独占鳌头，为驰名保护产品，享有中国纸巾十大品牌、湿纸巾十大品牌、国家保护商标、湖南省著名商标、中国生活用纸行业领先品牌等荣誉。“心相印”以温馨、浪漫、关爱的主题调性，不断创新，竭诚提高服务质量，用心关爱身边的每一个人，通过领先技术成就卓越品质，为广大消费者提供卫生、优质的生活用纸。自2000年起，“心相印”纸巾连续13年全国市场占有率第一名，其产品线覆盖手帕纸、卫生纸、面巾纸、餐巾纸、擦拭纸，值得信赖的高品质产品体验及温馨浪漫的情感关怀，为您带来随时相伴的至纯关爱，守护您的健康快乐生活。','m','','心相印','mind act upon mind'),(381,'\"谢裕大是安徽著名黄山毛峰品牌，谢裕大品牌标注黄山毛峰的品质和象征。 2006年，有着深深历史责任感的谢氏第五代玄孙谢一平，为了将百年的茶文化发扬光大，在原来徽州漕溪茶厂的基础上，成立谢裕大茶叶股份有限公司，以\"\"千锤百炼，追求卓越\"\"为质量方针，以致力于打造\"\"中国优质历史名茶制造商\"\"为愿景，以\"\"国礼茶\"\"的品质要求为定位，以\"\"传播中华茶文化\"\"为己任，构建老字号新战略的现代化企业发展之路，光复百年字号。2012年7月谢裕大荣获国家工商总局无行政区划企业冠名权。\"','x','','谢裕大','xieyuda'),(382,'香兴食品有限责任公司是一家生产，销售于一体的时代企业。是大米锅巴，地方小吃，皖南特产，锅巴粉丝的专业生产厂家；作为皖南知名食品企业，为广大的消费者提供可口，可靠的放心食品！。公司成立于2002年，位于素有“鱼米之乡”美称的皖南地区，这里有着得天独厚的天然环境，出产着丰硕的优质大米；随着社会经济的发展,人们的生活方式发生了很大的变化,由原来的柴灶煮饭变成了现在的微波炉、高压锅、电饭煲煮饭,这种转变让很多人吃不上那种香喷喷、黄灿灿的“锅巴”了；结合以上因素,香兴食品有限责任公司采用独特的生产工艺开发了“香兴”系列食品。','x','','香兴','xiangxing'),(383,'香港康富来集团是一家国际性集团公司，在香港、东南亚及加拿大等地均有投资及贸易发展，受到各地政界及商界的重视。在中国国内主要从事新型食品、保健品、药品的专业研究、开发、生产、销售以及房地产、工业城等地产业相关项目的开发。','k','','康富来','kangfulai'),(384,'\"味事达酱油精选非转基因脱脂黄豆与优质小麦，以其独特的精酿工法，充分释放出豆麦天然鲜味和醇香。每瓶/罐味事达酱油产品从选料到出厂都历经130多道工序的严格检测，确保产品更加安全、可靠。 2009年-2011年味事达酱油连续三年由“中国国际调味品及食品配料博览会”、搜狐网“吃喝频道”等机构一致评定为“消费者最喜爱、最放心调味品”  \"','M','','味事达','Master'),(385,'\"维维集团拥有六个大型原材料供应基地，30多个生产基地，100多个现代化食品生产线，是全国最大的豆奶生产企业，\"\"中国500家最佳经济效益工业企业\"\"、\"\"中国10家最大食品制造企业\"\"，荣获国际\"\"科学与和平\"\"贡献奖。 维维集团发扬\"\"追求卓越\"\"的企业精神，把产品质量视作企业的生命，全力打造维维精品。维维在同行业中率先通过了ISO9001质量管理体系认证，\"\"维维\"\"商标被国家工商局商标局认定为\"\"中国驰名商标\"\"。主产品\"\"维维\"\"牌豆奶粉成为中国最畅销商品之一，国内市场占有率85%以上。维维集团被国家审定为\"\"中国学生饮用奶定点生产企业\"\"，维维豆奶粉获国家绿委颁发的\"\"绿色食品\"\"证书。\"','w','','维维','weiwei'),(386,'维达纸业集团是一家集研究、开发 、生产、销售为一体的现代化生活用纸大型企业，是中国生活用纸委员会副主任委员单位，是中国卫生用纸行业产品最多、销售量最大的企业之一。在生产规模、产品质量、市场占有率、经济效益等方面一直处于国内生活用纸行业的领先地位。','V','','维达','Vinda'),(387,'威猛先生是美国庄臣公司旗下的品牌。庄臣公司创建于1886年的美国威斯康辛州的瑞辛市，主要经营家庭清洁用品、个人护理用品和杀虫产品的世界领先的制造商之一。旗下知名品牌有:雷达杀虫类产品、碧丽珠家具/皮革光亮剂、威猛先生清洁类产品、佳丽空气清香产品等。1987年，美国庄臣公司在上海浦东新区设立了中国区总部。','M','5e1d6d25-a9f8-41b0-9115-fa41fa9b4f78.jpg','威猛先生','Mr.Muscle'),(388,'旺旺公司开始业务追溯至1962年5月在台湾设立之宜兰食品工业股份有限公司。当时主要是生产农产品罐头食品并以出口外销为主要业务。公司在1983年与日本三大米果制造商之一的岩冢签署了技术合作合约，共同开发台湾米果市场，并迅速取得市场领导品牌的地位。1987年旺旺商标在大陆申请注明，为台商在大陆申请商标注册的首例。面对有限的资源及台湾市场，并及时掌握大陆开放经济之良机，公司在1992年，正式拓展中国市场，旺旺产品广告在大陆电视台首播。第一家工厂于1994年在湖南开始生产并为旺旺进入大陆庞大消费市场奠下坚固的基础。','W','','旺旺','Want Want'),(389,'统一企业于1967年7月1日成立于中国台湾台南，涉足食品、金融、外贸、商业、娱乐、广告、电子等业，以形成横跨制造、服务二大产业的格局。企业从传统食品出发，逐步走向高科技食品。','U','','统一','UNI-PRESIDENT'),(390,'\"天喔食品（集团）有限公司是由天喔国际控股有限公司（香港主板01219.HK）全资控股的业务主体，成立于1999年，为外商独资企业，注册资本9.9亿港币，总部位于上海市松江区，是一家以\"\"天喔\"\"、\"\"天喔茶庄\"\"、\"\"早早麦\"\"、\"\"川湘\"\"等休闲食品（饮品）品牌为龙头，集园区生产、品牌发展、品牌代理和物流配送为一体的食品（饮品）类快速消费品专业生产和营销集团。旗下拥有多个中华老字号、地方著名商标，产品线主要包括蜜饯、炒货、休闲肉(鱼)制品、饮料、南北货、燕麦谷物、调料、营养黄酒、葡萄酒9大系列产品，先后在上海、福建、湖北、四川设立了大型生产园区，覆盖了华东、华南、华中、西南地区。 \"','T','','天喔','TEN WOW'),(391,'天堂伞是由杭州天堂伞业集团生产的国内名牌伞。包括雨伞，太阳伞等多个品种。天堂伞素以轻、新、牢、美而著称，产品质量和技术工艺在全国制伞行业中处于领先地位，在国内外市场享有很高的声誉。包括雨伞，太阳伞，直杆伞，二折伞，三折伞，四折伞，广告伞，庭院伞，遮阳伞，沙滩伞，工艺伞等多个品种。“天堂”商标是中国驰名商标，公司主导产品天堂牌晴雨伞是中国名牌产品，素以轻、新、美、牢著称，产品质量和技术工艺代表了当今世界先进水平，在国内外市场享有很高的声誉和广泛的影响。','t','','天堂','tiantang'),(392,'提起“王致和”，北京人都知道，说起来真有点像美国人都以“可口可乐”为“国饮”一样自豪。“王致和”与“同仁堂”同龄，始创清康熙八年（公元1669年），至今已有300多年历史。时至今日，“王致和”作为地道的“中华老字号”，以其产品的细、腻、松、软、香五大特点倍受广大华人消费者的钟爱。','W','','王致和','WANGZHIHE'),(393,'淘大是浙江永康市淘大工贸有限公司下属的品牌，地处著名的中国五金之都、中国门都-浙江省永康市，交通便捷、环境优美，是淘大人共同打造\"淘大\"品牌努力奋斗的理想基地。淘大工贸有限公司成立于2009年10月，是家居用品、小家电、健身器材、蒸汽拖把、好神拖、红旋风、足疗机等产品专业生产加工，公司地处五金科技工业园，公司成立至今，三年磨一剑，产品不断创新，注册商标已达30个。淘大人精神理念:服务大众，创造名品，回报社会。公司一直注重科技投入，科学管理，把好质量关，提高产品档次，不断开发新产品，适应新市场。公司通过多年的共同努力，产品不断多样化。','T','','淘大','TAODA'),(394,'陶华碧老干妈牌油制辣椒是贵州地区传统风味食品之一。几十年来，一直沿用传统工艺精心酿造，具有优雅细腻，香辣突出，回味悠长等特点。是居家必备，馈赠亲友之良品。','L','','老干妈','Lao GanMa'),(395,'\"世界五大碱性电池生产商之一的南孚公司，系中国520家之一的重点企业、国家级高新技术企业、商务部重点扶持的出口企业、中国电池行业龙头企业、福建省重点企业。现有资产总额18多亿元，园林化的厂区面积18万平方米。南孚公司是中国电池行业中拥有现代化装备最多、科技力量最雄厚的企业:在中国市场，南孚牌电池连续18年创\"\"质量、经济效益、劳动生产率\"\"同行业第一、亚洲第二;厂房、生产线及配套装备均居国际名牌电池企业先进水平，其中600只/分等无汞碱锰电池生产线达国际一流，产品质量与国际名牌同步发展;有职工1800多人，其中高、中级等各类专业技术人员450多人，是国家引进国外智力示范单位;拥有国家级技术中心和博士后科研工作站，并与全国多所重点大学、中科院的研究所合作成立多个新型能源研究中心，形成了厂学研技术创新机制;有10项技术成果填补国内空白、达国际先进水平，其中一项获国家科技进步二等奖，一项全国职工技术创新成果二等奖。  \"','N','','南孚','NANFU'),(396,'\"史努比（SNOOPY）诞生于美国作者CharlesM.Schulz（查尔斯-舒尔兹）从1950年开始创作的作品《花生漫画/PEANUTS》中，是美商联合国片企业有限公司旗下的一个全世界家喻户晓的漫画卡通人物。史努比（SNOOPY）从诞生便因可爱的卡通形象而风靡全球。 作为全球领袖级卡通品牌，史努比（SNOOPY）的系列产品更遍布全球75个国家，从日用品、服装、包袋、鞋到玩具、文具、童装等，都是风格活力、时尚、休闲，深受崇尚休闲、富有活力、热爱生活、追求时尚的年轻一族喜爱。 现在世界各地都有史努比（SNOOPY）系列主题的专卖商品，数以万计的带有品牌形象的商品进入全球上亿户家庭。 史努比（SNOOPY）以影响了几代人的卡通图案作为产品标识，使史努比（SNOOPY）的产品在诞生之初就具备了文化优势。2013年，利丰亚洲开始负责史努比（SNOOPY）在中国的形象授权业务。\"','S','','史努比','SNOOPY'),(397,'山东鲁花集团有限公司位于山东莱阳市，是一家大型的民营企业、农业产业化国家重点龙头企业。现拥有员工近两万人，下设26个生产基地，横跨食用油、调味品、蔬菜加工等多个行业。食用油年生产能力100万吨，调味品年生产能力20万吨','L','','鲁花','LUHUA'),(398,'沙宣是宝洁公司洗发水品牌中的后起之秀，他们请来国际著名美发专家维达•沙宣做自己的品牌形象大使，并用维达•沙宣本人的名字作为品牌，从而树立起专业洗发、护发的形象，而“我的光彩来自你的风采”则有画龙点睛之感。作为国际美发先锋，沙宣的灵感来自四面八方。从怀旧的摇滚到摩登的T台时装秀；从经典的建筑到耐人探索的星际，每一款都张扬着沙宣的创新精神。','V','6bd6421d-92ef-45cd-9a4f-b72f20874631.jpg','沙宣','VS'),(399,'三辉麦风品牌是中国法式奶香包开创者、蛋黄派开创者！2005年推出“法式奶香面包”一经上市，产品立即风靡，赢得了广大顾客的信任和青睐，也使得公司健康快速发展，公司本着“以人为本，以质取胜”决策充分领悟新时代发展硬道理，为广大消费者提供*优质的产品和*贴心服务','S','','三辉','SANHUI'),(400,'全球知名化妆品牌，主要生产染发护发、彩妆及护肤产品倍受全球爱美女性的青睐。拥有骄人的产品研发背景，一流的药学试验室及皮肤学中心，遍布全球的研究测试中心，使其不断推出适应全球消费者不同需要的优质科研产品。','L','45e814f5-eb7e-47de-80cd-cda5100eef1e.png','欧莱雅','LOREAL'),(401,'清风品牌隶属于金红叶纸业集团有限公司，该企业为亚洲最大的生活用纸产销公司之一。早在2004年，清风就被评为年度中国生活用纸质量信得过产品，依据第三方市调公司尼尔森的数据显示，清风为全国生活用纸品类领导品牌之一，更于2014年荣登中国top50快销品牌之一。','Q','','清风','QINGFENG'),(402,'青蛙王子(中国)日化有限公司，福建省著名商标，国内儿童护理行业领先品牌，中国儿童护理有限公司旗下，集研发/制造/销售为一体的综合型护理用品企业青蛙王子（中国）日化有限公司，是一家集研发、生产和营销为一体的综合型企业。作为中国儿童日化行业首家海外上市企业（股份代码：HK01259），青蛙王子始终秉承“专心致意，儿童护理”的经营理念，产品主要涵盖儿童护肤、儿童洗沐、儿童口腔护理等系列。','Q','','青蛙','QINGWA'),(403,'青岛啤酒产自青岛啤酒股份有限公司，公司的前身是国营青岛啤酒厂，1903年由英、德两国商人合资开办。青岛啤酒选用优质大麦、大米、上等啤酒花和软硬适度、洁净甘美的崂山矿泉水为原料酿制而成。原麦汁浓度为十二度，酒精含量3.5-4%。酒液清澈透明、呈淡黄色，泡沫清白、细腻而持久。','T','','青岛','TSINGTAO'),(404,'潜山县传文瓜子有限公司成立于二000年，是一家集瓜子开发、种植、销售于一体的私营企业。公司总部座落于国家AAAA级风景名胜区天柱山脚下，东莞高速、沿江高速、京广铁路交汇于此，105国道穿越全境，交通十分便捷。天柱山四季分明、风景如画，是名人游客的理想之地。这里有大乔小乔的爱情佳话，有孔雀东南飞的悲壮史诗,有牛郎织女的美丽传说。而被人们誉为“瓜子之王”的当地一大特产----瓜蒌籽,就野生于此。据史书记载,瓜蒌籽早在明、清时期就被列为贡品。而关于其功效在《本草纲目》中也有明确记载:瓜蒌籽可滋补美容、健胃润肺、润肠通便、舒筋宽胸、安心养神、益寿延年等。经现代医学进一步论证，瓜蒌籽含有钙、镁、锌、铜、蛋白质、维生素等对人体有益的成分，具有降压、降血糖、降血脂等综合','C','','传文','CHUANWEN'),(405,'洽洽香瓜子是洽洽食品股份有限公司生产的水煮葵花籽。它开创了香瓜子的煮制工艺，实现了香瓜子规模化、机械化的生产流程。洽洽是一个香瓜子品牌，但就我所看到的其在终端上的突出表现并不是一般休闲食品所能做到的。在家乐福、华联超市以及好又多等各类大卖场都发现了与易初莲花货架同样的洽洽产品展示效果。城市各个角落的小型连锁超市和便利店，杂货店乃至高速公路旁边加油站里的便利超市，洽洽也无一不是那么彰显的齐整陈列。中国有这么一家仅仅靠卖香瓜子就能在几年内卖出一个年销售额达到10个亿的休闲食品品牌来的优秀企业!后来关注了一下炒货行业，才知道，洽洽通过几年时间的默默耕耘，目前已经成为炒货行业的第一品牌。','Q','','洽洽','QIAQIA'),(406,'七度空间是老牌生活用纸企业恒安集团推出的面向年轻女孩的少女系列卫生巾品牌，主要有245mm、275mm、338mm三种不同长度，又分纯棉表层和绢爽网面两种类型。而少女空间。天使飞翔少女系列卫生巾，透气，专为少女一族设计。','S','','七度空间','SPACE7'),(407,'飘柔(Rejoice)，宝洁公司著名的洗发露品牌。自1989年10月进入中国以来，一直是洗发水市场第一品牌，其知名度、消费者使用率、分销率等各项市场指标多年来均遥遥领先。飘柔不仅为消费者带来了美丽的秀发和美好的生活，更以其推崇的自信优雅的生活态度成为消费者心目中厚爱有加的品牌。在第三届中国商标大赛中，飘柔被全国25万消费者和专家一致评选为“最受中国消费者喜爱的外国商标”。之后亦多次在全国性评奖中夺魁，成为消费者最喜爱的品牌之一。2006年4月，飘柔将迎来上市以来的最大规模的升级。你所熟悉的飘柔，将以更美丽更时尚的新面孔出现。','R','c42fecd7-10b2-4836-9138-3f4715999904.png','飘柔','Rejoice'),(408,'\"盼盼食品集团始创于1996年，是以农产品精深加工为主的国家级农业产业化重点龙头企业，员工12000人。除食品外，还涉足饮料、生物科技、房地产、金融、矿产等行业的经营和管理，截至目前，集团旗下已拥有福建晋江、辽宁新民、四川成都、河南漯河、山东临沂、湖北汉川、广西南宁、甘肃白银、福建长汀、安徽滁州、吉林松原等19家全资分公司，市场营销网络分布全国各省市县和重点乡镇。 公司主要生产“盼盼”牌麦香系列膨化食品，法式小面包、软面包、蓉香包、丝润面包、小卷包、铜锣烧、瑞士卷、欧咔蛋糕、梅尼耶干蛋糕、软华夫、肉松饼等烘焙食品，以及重磅打造的子品牌“艾比利”膨化系列食品等。2013年，公司进军饮料行业，生产植物蛋白类和水等健康饮品，强力打造集团旗下的食品、饮料双支柱产业，吹响了向百亿企业集团冲刺的号角。\"','P','','盼盼','PANPAN'),(409,'\"农夫山泉股份有限公司是一家中国大陆的饮用水生产企业，其前身浙江千岛湖养生堂饮用水有限公司于1996年9月在浙江省建德市千岛湖畔成立。2000被授予“中国奥委会合作伙伴”荣誉称号和“北京2008年奥运会申办委员会热心赞助商”荣誉称号。2003年9月农夫山泉天然水被国家质检总局评为“中国名牌”产品。2002年农夫山泉天然水的总产量达61万吨，居全国饮料企业产量第四位。农夫山泉的产值不断递增，每年上一个台阶。2003年公司推出农夫果园混合果汁饮料，2004年推出尖叫系列功能饮料，2005年又推出新概念茶饮料农夫汽茶。 农夫山泉坚持纯天然理念，从不使用一滴城市自来水。农夫山泉目前拥有四个主要水源基地：浙江千岛湖，南水北调基地湖北丹江口，广东万绿湖，以及吉林省靖宇县的长白山，前三者均为地表水库水水源，第四个为天然矿泉水水源。企业在市场开拓过程中，开发与对手有明显差异的产品是非常重要的，但与此同时，广泛宣传这种差异，进而让消费者认同这种差异更为重要。农夫山泉的崛起，可以说是肇始于“农夫山泉有点甜”的广告，“农夫山泉有点甜”的声音飞越千山万水，传遍大江南北，品牌知名度迅速打响。\"','N','','农夫山泉','NONGFU SPRING'),(410,'农夫山泉公司针对混合果汁的特点，将果汁系列命名为\"农夫果园\"，这一品牌给人的联想是和谐纯朴的果园风情，宁静悠远的天然环境增加了果汁来源的真实性;这一名称也注意结合农夫山泉，延续\"农夫\"的品牌优势。这一与众不同的命名，还具有很好的延伸性，以后出台新的果汁饮料可以统一在\"农夫果园\"的旗下，品牌的推广可以为以后的新品积累影响力。','N','','农夫果园','NONGFUGUOYUAN'),(411,'牛肉类食品，源于国外配方，采用新鲜牛肉生烤而成。产品简介母亲牛肉棒采用国外传统配方，选料考究，精选整头牛中10%的上等牛肉，加入调味料、精盐等烘烤而成，色泽自然，肉质密实而鲜美。产品标准企业通过食品安全体系（HACCP）、食品企业良好作业规范（GMP）认证。','M','','母亲','MUQIN'),(412,'南方黑芝麻糊以大米、黑芝麻等为主要原料精制而成，并添加了人体所必须的维生素A、维生素D和钙，具有芝麻浓郁的香味，香滑可口。本品即冲即食，是家居、旅游择之佳品。该产品是由南方黑芝麻集团股份有限公司荣誉出品。','N','','南方','NANFANG'),(413,'纳爱斯集团拥有纳爱斯、雕牌两大名牌四大系列四百多个品种产品。其中“纳爱斯”、“雕”牌为驰名商标,雕牌洗衣粉、雕牌液体洗涤剂同为中国名牌产品和国家免检产品。...','D','','雕牌','DIAOPAI'),(414,'内蒙古伊利实业集团股份有限公司，1993年06月04日成立，经营范围包括许可经营项目：乳制品（含婴幼儿配方乳粉）制造等。','Y','','伊利','YILI'),(415,'妙洁系列家用品。本着为中国现代化家庭提供健康、方便、轻松生活的理念，妙洁不断地推出最新最好的产品满足消费者更高的生活需求，如今已形成PE保鲜膜、保鲜袋、绒里手套、抹布、百洁布、拖把、一次性用品、垃圾袋八大类50余种品种的产品系列。让我们的消费者能够轻松家务，真正做到\"家务好轻松。脱普（中国）企业集团是台湾脱普企业集团在中国大陆投资的独资企业。1991年，TOP首次来到中国大陆，在沈阳创办了第一家独资企业--沈阳东联日用品有限公司，专门生产妇幼产品。次年，在无锡成立了第二家独资企业--脱普日用化学品（中国）有限公司，生产日化、妇幼、家用产品。后又在全国100多个主要城市开设了销售窗口，并于94年在上海成立了脱普（中国）企业集团总部。至目前为止，脱普已在全国主要省份开设了分公司，规模不断扩展。TOP本着创新与独特，以市场为导向的经营理念。多年来，我们致力于将世界科研新成果融入到产品开发中，陆续推出了日化、妇幼、家用三大品类众多产品。目前，脱普公司的家用类产品，如保鲜膜等在上海销量领先，而日化、妇幼品类产品也居业界主要地位。','M','','妙洁','MIAOJIE'),(416,'面向广大的家庭消费群，代表着温馨和谐快乐的生活氛围，产品线覆盖各种品类的生活用纸，能够充分满足日常使用需求，多年稳居上海同类市场畅销品牌之首，受到顾客的普遍欢迎','H','','洁云','Hygienix'),(417,'蒙牛是一家总部位于中华人民共和国内蒙古的乳制品生产企业，蒙牛是中国大陆生产牛奶、酸奶和乳制品的领头企业之一，1999年成立，至2005年时已成为中国奶制品营业额第二大的公司，其中液态奶和冰淇淋的产量都居全中国第一。控股公司的中国蒙牛乳业有限公司(港交所:2319)是一家在香港交易所上市的工业公司。蒙牛主要业务是制造液体奶、冰激凌和其他乳制品。蒙牛公司在开曼群岛注册，主席为宁高宁。','M','','蒙牛','MENGNIU'),(418,'美汁源是第一家进入浓缩果汁市场的公司。由可口可乐公司所拥有，为世界最大的果汁饮料销售商。2005年，美汁源在中国市场推出“果粒橙”，目前已成为中国即饮果汁类饮料排名第一的品牌，也推动中国成为“美汁源”全球最大市场','M','','美汁源','Minute Maid'),(419,'美和居，始创于清顺治年间，建国后，美和居联合21家制醋坊，诞生了老陈醋新品牌“东湖”。“东湖”牌老陈醋，作为山西老陈醋的嫡系传人，以其精湛酿造技艺和色、香、味俱佳的优良口质，驰名中外，是山西老陈醋居中国名醋之首','D','','东湖','DONGHU'),(420,'美国箭牌糖果有限公司（Wm.WrigleyJr.Company）是国际糖果业界的领导者之一和全球最大的口香糖生产及销售商。箭牌糖果（中国）有限公司为其在中国设立的独资企业。目前在广州经济技术开发区、广州市番禺区和上海市松江工业区分别设有三家工厂。箭牌公司在中国的品牌组合包括“绿箭”（Doublemint）、“黄箭”(JuicyFruit)、“白箭”(Wrigley\'sSpearmint)、“箭牌咖啡口香糖”(Wrigley\'scoffeegum)、“益达”(Extra)无糖口香糖、“劲浪”(CoolAir)超凉口香糖、“大大”（TaTa）泡泡糖、“真知棒”(PimPom)棒棒糖、“瑞士糖”（Sugus）软糖和“彩虹”（Skittles）果汁糖等。旗下绿箭无糖薄荷糖由世界羽毛球冠军林丹作为形象代言，另有“林丹限量版”薄荷糖在中国大陆部分城市市区内有少量销售','D','','绿箭','Doublemint'),(421,'溜溜果园集团是一家致力于果品加工、销售、科研于一体的现代化企业集团，是安徽省农业产业化龙头企业，是中国青梅食品行业引领者，是中国特色果品加工产业的领军企业！集团总部位于安徽芜湖','L','','溜溜','LIULIU'),(422,'乐事（Lay’s，英国和爱尔兰叫Walkers，埃及叫Chipsy，越南叫Poca，以色列叫Tapuchips）是美国的薯片品牌，也是创立于1932年的一家公司的名字，自1965年起成为百事旗下产品。','L','','乐事','Lay’s'),(423,'蓝月亮洗衣液是中国洗衣液市场的领导品牌，蝉联四届洗衣液冠军，2010年市场份额高达44%。蓝月亮以其优异的品质成为中国洗衣“液”趋势的引领者，深入中国的千家万户。2008年推出的深层洁净洗衣液采用深层洁净技术和中性温和配方，引爆了中国洗衣液市场；2010年针对衣物色彩的护理推出亮白增艳洗衣液，蓝月亮提出让白衣更白，彩衣更鲜艳的“护色、调色”洗衣新理念；2011年蓝月亮又有新创举，在中国抢先推出首款手洗专用洗衣液，掀起了衣物手洗新风尚。','L','','蓝月亮','LANYUELIANG'),(424,'口子窖酒系安徽口子酒业主导产品。口感“香气馥郁，窖香优雅，富含陈香、醇甜及窖底香”，为中国兼香型白酒的典型代表。其独特的风格和卓越的品质得到了社会各界的高度赞同，被评定为中国十八大名优酒标准样品，荣获\"中国白酒典型风格金杯奖“并被国家批准实施原产地域产品保护；评定为全国首届三绿工程畅销白酒品牌、中国白酒工业十大影响力品牌并通过了纯粮固态发酵白酒标志认定','K','','口子窖','KOUZIJIAO'),(425,'卡夫食品有限公司（简称卡夫）（英语：KraftFoods）是全球第二大的食品公司，在全球145个国家开展业务，是菲利普·莫里斯公司旗下的子公司之一。在全球聘用约六万多名员工。卡夫公司的四大核心产品系列为咖啡、糖果、乳制品及饮料。卡夫在超过70个国家开展业务，其产品全球150个国家有售。卡夫北美及卡夫国际两个单位分别管理美国及加拿大市场，以及欧洲及发展中国家市场','K','','卡夫','Kraft'),(426,'金健米业开发、生产、销售定型包装粮油及制品、食品包装材料；经营商品和技术的进出口业务。公司是我国粮食系统的第一家上市公司，是首批农业产业化国家重点龙头企业，公司生产的金健牌系列精米在国内具有很高的品牌优势和市场占有率。','G','','金健','GAEA GEM'),(427,'洁丽雅集团组建于2003年，其前身是成立于1986年的“诸暨县毛巾厂”。历经20多年的建设和发展，集团现已成为中国毛巾行业的龙头企业，中国家用纺织品行业协会副会长企业。集团下辖八大职能中心，现有直属独立法人企业9家，外协合作企业23家，员工6200多名。集团总资产逾20亿元，总占地面积80多万平方米，拥有浙江、湖北两大生产研发基地，是一家集纺纱、织造、染整、营销、物流及其他产业于一体的大型综合性集团公司。','G','','洁丽雅','GRACE'),(428,'\"江苏洽康食品有限公司，小康，知名辣椒酱品牌，始于1995年，江苏省著名商标，江苏省名牌产品，专业从事酱制品/调味品研究/制造的企业 江苏洽康食品有限公司是洽洽食品股份有限公司（002557）控股子公司，是江苏省最大的酱制品制造企业及全国牛肉酱品类的行业龙头。主打以“小康”为品牌的调味酱系列产品，\"\"小康\"\"商标是江苏省著名商标，产品系列包括牛肉酱系列、剁辣椒系列、私房菜系列、油辣椒系列、西施豆制品系列等五大系列六十多个品种。\"','X','','小康','XIAOKANG'),(429,'江苏恒顺集团有限公司（原镇江恒顺酱醋厂）始建于1840年清道光年间，是镇江香醋的创始者，中华老字号企业。经过一百多年的传承和发展，恒顺集团从原先的传统作坊式酱醋生产企业，成长为一家跨行业、跨地区的涉足房地产、生物保健、光电子、商贸流通等领域的现代企业集团。','H','','恒顺','HENG SHUN'),(430,'健达缤纷乐是一种由意大利费列罗公司生产的牛奶榛果威化巧克力。健达缤纷乐内部充填了牛奶和榛果，威化外部由巧克力脆皮覆盖。','K','','健达','Kinder'),(431,'加多宝集团出品的凉茶依据传统配方，采用上等本草材料配制，秉承传统的蒸煮工艺，经由现代科技提取本草精华、调配而成；其内含菊花、甘草、仙草、金银花等具有预防上火作用的本草植物','J','','加多宝','JDB'),(432,'集团于1992年开始生产方便面，并自1996年起扩大业务至糕饼及饮品；集团的三大品项产品，皆已在中国食品市场占有显著的市场地位。据ACNielsen2011年12月零售市场研究报告的调查结果显示，在2011年1－12月本集团于方便面、即饮茶及包装水销售额的市场占有率分别为56.7%、50.1%和19.6%，稳居市场领导地位；稀释果汁以18.4%、夹心饼干以22.1%同居于市场第二位。「康师傅」作为中国家喻户晓的品牌，经过多年的耕耘与积累，深受中国消费者喜爱和支持。[5] ','K','','康师傅','KANG SHI FU'),(433,'华味亨，中国蜜饯行业品牌。其全名为：杭州华味亨食品有限公司，原名杭州味亨蜜饯厂。创办于1992年，是一家传统加工型企业。以产品开发，生产，销售为一体化、品牌化的生产企业','H','','华味亨','HUA WEI HENG'),(434,'胡玉美蚕豆酱是安庆名产，在国内外享有很高声誉。追溯其源，那还是在二十世纪之初，胡玉美酱园鉴于苏皖人畏于川酱之辣，在仿制川酱的基础上加以改进，摸索出具有自己特色的完整的制酱方法，酿出辣味不重、味道鲜美、更适合长江中下游地区人们口味的蚕豆酱。它用优质蚕豆、辣椒和44℃封缸酒为主要原料精心酿制，绛紫泛红，辛香细腻，微辣带甜，咸中有香，具有色香味俱全、营养丰富、食用方便等特点。既可作家常佐餐、宴席素菜，又便于旅途携用，因而广受好评，畅销四海，历久不衰。','H','','胡玉美','HU YU MEI'),(435,'红星始建于1949年，是中华老字号企业和非物质文化遗产保护单位，拥有蓝瓶、苏扁、青花瓷等系列产品','H','','红星','HONG XING'),(436,'亨氏公司是在1869年由H.J.Heinz在美国宾夕法尼亚州夏普斯堡创立的，经过一百多年卓有成效的发展，由当时的小农场成为世界最大的营养食品生产商之一。亨氏的产品有5700多种，除了人们熟知的婴幼儿食品，如婴儿米粉、面条、佐餐泥、果汁、果汁泥零、婴幼儿配方奶粉，还有番茄酱、调味品、沙司和冷冻食品等。该公司的分支机构遍及全球200多个国家和地区。2012年2月，股神巴菲特及巴西资本投资公司3G看中亨氏集团的优异业绩表现，以总价280亿美元收购亨氏集团，创下同类企业的收购最高纪录','H','','亨氏','HEINZ'),(437,'河北金沙河面业集团有限责任公司创建于1996年，是一家从事面粉和挂面生产的农产品加工企业，总部位于河北省邢台市','J','','金沙河','JINSHAHE'),(438,'合家福自有品牌','W','','皖秀','WANXIU'),(439,'合家福自有品牌','H','','合家福','HEJIAFU'),(440,'合肥市金玉超食品有限责任公司以生产、加工、销售，“金玉超”牌麻油、白糖、干货、调味食品、休闲食品等产品为主。上述五大系列产品有80多个品种已通过国家绿色食品认证，创国内同行业之最。率先通过了ISO9001国际质量体系认证、ISO14001环境管理体系认证、HACCT食品安全管理体系认证以及QS市场准入证，并被合肥市人民政府授予合肥市农业产业化重点企业。','J','','金玉超','JINYUCHAO'),(441,'好吃点系列饼干由福建达利集体团生产销售。著名艺人赵薇代言了该商品，她在广告中那句“好吃点，好吃你就多吃点”的广告语被消费者耳熟能详，也让福建达利集团这个大平台成为家喻户晓的公司。达利集团的“达利园”、“可比克”、“好吃点”品牌，均以其优异的产品品质、亲和的品牌形象走进了千家万户。','O','','好丽友','Orion'),(442,'杭州娃哈哈集团有限公司，1993年02月03日成立，经营范围包括许可经营项目：娃哈哈系列产品的生产、销售。一般经营项目：按经贸部批准的目录，以原杭州娃哈哈集团公司名义经营集团公司及成员企业自产产品、相关技术出口业务和生产所需原辅材料、机械设备、仪器仪表、零配件等商品及相关技术的进口业务，开展“三来一补”业务。商业、饮食业、服务业的投资开发等。','W','','娃哈哈','WAHAHA'),(443,'杭州三禾食品有限公司，三佳牌，以精制纯藕粉为主料，致力于速溶藕莼、霉干菜、杭白菊等系列休闲食品的开发、生产、加工、销售的企业。三佳牌速溶西湖藕粉，以精制纯藕粉为主料，经现代科学工艺加工，保持其纯天然特色，增加桂花、莲子多种营养成份，制成速溶食品，即冲即食，营养丰富，老少皆宜；它改变传统藕粉冲泡的不足之处，速溶藕粉用90摄氏度以上开水冲泡后即可食用，是一种适合现代生活的理想食品，也是走亲访友的馈赠佳品。','S','','三佳','SANJIA'),(444,'汉高（中国）投资有限公司，Syoss丝蕴，源自日本，专业沙龙级美发品牌，卓效配方专为亚洲人发质设计，其无硅系列产品口碑极佳SYOSS丝蕴，源自日本专业沙龙美发品牌，与日本殿堂级资深发型师合作研发，优质配方专为亚洲人发质设计。继SYOSS丝蕴成功上市丝蕴深层修护、水润顺滑、滋养强韧及清润净屑四大洗护系列以及丝蕴专业造型品之后，现将全新丝蕴男士洗护及造型系列和丝蕴染发系列带给中国消费者，现在您可以通过使用SYOSS丝蕴专业洗护、造型及染发产品，体验到更加专业的沙龙级日常护理、造型和染发效果，秀发每天就像刚由发型师打理过一样。','S','','丝蕴','Syoss'),(445,'海天是国内专业的调味品生产和营销企业，溯源于清乾隆年间的佛山酱园，至今已有300年的历史，产品涵盖了酱油、蚝油、醋、调味酱、鸡精、味精、油类、小调味品等八大系列200多个规格和品种','H','','海天','HAITIAN'),(446,'哈尔滨啤酒集团有限公司创建于1900年，是中国最早的啤酒制造商，其生产的哈尔滨啤酒是中国最早的啤酒品牌，至今仍风行于中国各地。哈尔滨啤酒集团有限公司位于哈尔滨市香坊区油坊街20号，是中国大陆第五大啤酒酿造企业，共拥有13家啤酒酿造厂。哈啤集团的市场份额在哈尔滨约为66%，在全国为5%左右。目前，哈尔滨啤酒销往除西藏以外的全国其他省区，并远销英国、美国、俄罗斯、日本、韩国、新加坡、香港、台湾等30多个国家和地区。','H','','哈啤','Harbin'),(447,'\"桂林周氏顺发食品有限公司，创办于1991年，集纯蜂蜜、核桃粉、豆奶粉等营养食品的研发、生产、包装为一体的现代化大型企业桂林周氏顺发食品有限公司，位于举世闻名的旅游城市－桂林市郊区，环境幽雅、交通便利；公司创办于1991年，现占地面积四万多平方米。公司的主要产品有纯蜂蜜、蜂蜜膏、核桃粉、豆奶粉、燕麦片、芝麻糊等营养食品；公司拥有现代化的生产设备、高标准生产厂房、自动化生产线，完善的质量检测设备和一批高素质的专业技术人员，公司率先通过GMP和食品安全生产（QS450306013297）认证，曾获得或被授予:“广西食品行业抵制假冒伪劣活动-------放心食品承诺单位”、“重合同守信用企业”、“中国蜂产品协会团体会员”等荣誉称号。公司遵循“以质量求生存、以品质求发展、向管理要效益”这一经营理念;在力创名优品牌上不断前进，始终把改革创新作为企业发展的动力，不断加快技术改进，加大创新力度，积极开发新产品，提高服务质量；公司拥有专业、前沿的市场推广体系和高素质的营销队伍及专业的公司管理团队，公司愿与各地客商携手并进，共谋发展！ 周氏产品系列： 1、纯蜂蜜系列2、蜂蜜饮品系列3、营养麦片、燕麦片系列4、核桃粉系列5、豆奶粉系列； 6、芝麻糊系列7、营养早餐列、8、莲子羹系列9、藕粉系列。\"','Z','','周氏','ZHOUSHI'),(448,'\"广东蓬盛实业有限公司，橄榄菜十大品牌，广东省著名商标，澄海市名牌产品，拥有潮汕传统腌制工艺，集布产/收购/加工/出口果蔬制品的专业厂家 我厂是集布产、收购、加工和出口果蔬制品的专业厂，拥有厂房面积十万平方米，管理严密，技术力量雄厚，采用驰名世界的潮汕传统腌制工艺，结合现代高新技术，生产的注册商标“蓬盛”牌“香港橄榄菜”、“汕头咸菜皇”等产品，以其色、香、味俱佳，饮誉海内外，全部产品由中华人民共和国专利局认可，颁发专利证书。93年、95年参加荷\"','P','','蓬盛','PENGSHENG'),(449,'冠生园创建于1915年，已有101年的历史。冠生园是中国民族工业的名牌老字号企业。主要生产和经营糖果、蜂制品、酒类、面制品、味精、冷冻食品、保健食品、生物医药、休闲食品等近20个系列上千个品种',' ','','冠生园',' GUAN SHENG YUAN'),(450,'格力高集团是一个多元化事业的集团型食品企业。总公司在上海，在日本以生产休闲食品、冷饮、加工食品、健康食品的江崎格力高食品公司为中心，另外在东南亚设有泰国格力高、在欧洲和达能合资有法国格力高、在美国国内设有GlicoUSA公司','G','','格力高','GLICO'),(451,'蜂花是上海华银日用品有限公司旗下的品牌。 上海华银日用品有限公司成立于1985年,是一家集研制、生产为一体的洗发水、护发素专业制造商。本公司拥有雄厚的技术力量和强大的生产规模，生产的“蜂花”牌洗发水、护发素是最早流行于中国市场的洗护发产品，曾多次荣获优质产品称号。为满足不同消费者的需要，我公司在成功开发“蜂花”二和一去屑洗发露后，又向市场推出第三代“蜂花”植物精华洗发露、护发素。面向市场发展趋势，公司还积极创导全新的洗发护发概念，市场不断扩大。目前，“蜂花”护发素已发展成为多品种，多功能的系列产品；满足了广大消费者对护发的各种要求。本着“拥有质量，拥有市场”的经营理念','B','','蜂花','BEE&FLOWER'),(452,'丰大牌面条,食用油,面粉已先后荣获绿色食品标志,国家免检产品,中国国际农业博览会名牌产品,中国放心粮油产品,国家质检总局全国专项抽查质量合格产品等几十项国家级,省级奖项,产品销往北京,天津,长春,沈阳,哈尔滨,石家庄,济南,南京,武汉等全国大中城市,并享有较高的知名度和美誉度.','F','','丰大','FENGDA'),(453,'芬达汽水（Fanta）是1940年代在欧洲开始风行的饮料，上市以来深受广大消费者欢迎。风靡20年，于1960年被可口可乐公司所并购。并在原基础上加以改进。出现了橘子、草莓、葡萄、西瓜、青苹果、水蜜桃、青柠等众多口味。（芬达汽水为软性碳酸饮料。）','F','','芬达','Fanta'),(454,'泛指“北大荒”地域内所种植收获的大米，比东北大米更加具有地域局限性，同属“东北大米”。生长周期在180天左右，为其提供了得天独厚的自然条件，阳光雨露充足，又种植在极肥沃的黑土壤中，富含丰富氮、磷、钾等多种矿物元素，极其符合稻米生长的要求，以纯净无污染的河水或井水灌溉，独特地域优势，保证了大米独有的品质。','B','','北大荒','BEIDAHUANG'),(455,'滴露从核心产品——滴露消毒液，衍生出了一系列的健康除菌产品。目前在中国市场上架的包括：滴露衣物除菌液、滴露健康抑菌香皂、滴露健康抑菌洗手液、滴露免洗抑菌洗手液、滴露健康沐浴露、滴露健康抑菌香皂、滴露卫生湿巾、滴露PM2.5防护口罩等产品。[2] ','D','','滴露','Dettol'),(456,'德芙是世界最大宠物食品和休闲食品制造商美国跨国食品公司玛氏（Mars）公司在中国推出的系列产品','D','','德芙','DOVE'),(457,'大团结农业股份有限公司坐落在安徽省六安市叶集区，注册资金9027.2万元，注册商标“启航”。核心及主力产品以有机、清真食品为主导。启航6A冷榨有机山茶油已逐步成为国内顶级食用油的代表。大团结农业股份有限公司2008年投产之初，就把品牌建设和渠道建设放在首位，并于2013年成立了启航养生油有限公司，负责全国的营销工作。目前已经形成了“立足安徽、扎根江浙沪、拓展北广深、辐射全国”的营销格局，启航的发展势头快速而稳健。大团结农业股份有限公司是安徽省农业产业化龙头企业，安徽省粮食产业化龙头企业，安徽省林业产业化龙头企业，集科、农、工、贸于一体，拥有国内国际领先的油脂制取技术，一流的生产设备，历经八年的科技攻关独创了“6A冷榨工艺”，产品最大化保留了有机山茶油的天然营养，堪称“东方养生油”。','Q','','启航','QIHANG'),(458,'春光利用东郊椰林丰富的椰子资源优势和正宗、地道的椰乡文化，品牌塑造取得了明显成效。为了做出自己的特色，春光不断引入国外尖端生产线，高薪聘请技术专家，改进产品的口味、包装，坚持做海南的特色手信产品，争取打造成中国椰子食品行业“航母”。','C','','春光','CHUNGUANG'),(459,'成立于1995年的公牛电器，是国内领先的高档开关插座、转换器、家用LED灯的专业供应商，在提供优质产品和服务的同时，始终致力于为大众营造更安全的用电环境。秉承“忠信诚和、专业专注”的发展理念，公牛电器不仅将专业精神融入公司运营的每一个环节，还积极推动企业和谐文化建设','B','','公牛','BULL'),(460,'长城葡萄酒是全球500强企业中粮集团旗下驰名品牌，是中国葡萄酒第一品牌，是“中国名牌产品”和“行业标志性品牌”。连续多年产销量居全国第一。','G','','长城','GREATWALL'),(461,'北京丘比食品有限公司，成立于1925年日本，从事沙拉酱、果酱、意式面酱等产品的的研发、生产、加工、销售的大型跨国企业，北京丘比食品有限公司成立于1993年12月，是由北京市农工商联合总公司（现北京首都农业集团有限公司）、北京市东北旺农工商联合总公司（现北京市东北旺农场）、日本丘比株式会社共同创办的合资企业。','K','','丘比','KEWPIE'),(462,'北京绿伞化学有限公司创建于1993年6月，座落于中关村科技园区永丰高新技术产业基地，是一个研制、生产、销售环保型现代家庭及酒店清洁用品的高新技术企业。公司具有6大系列产品，包括衣物洗涤系列、水垢清除系列、居室清洁系列、纸制品系列、厨房清洁系列、卫生间清洁系列，种类近百种','L','','绿伞','LVSAN'),(463,'百年国货经典上海永字注水热水袋 ','Y','','永字','YONGZI'),(464,'奥妙OMO是英国联合利华公司旗下的家庭护理产品的品牌。1993年，“奥妙”正式进入中国。它的来到，为中国消费者带来了全新的洗涤概念。现在，“奥妙”家族已经拥有6种洗衣粉和3种洗衣皂','O','','奥妙','OMO'),(465,'奥利奥(Oreo)诞生于1912年，一上市便迅速成为美国最畅销的夹心饼干，是卡夫食品的超级明星和饼干之王，是全球巧克力味夹心饼干的代名词。关于\"奥利奥OREO\"名字的由来，众说纷纭，现在已经无从考证。一些人认为，奥利奥的名字来自英语，是\"白心黑人\"的意思。','O','','奥利奥','Oreo'),(466,'安徽省百春制药有限公司，知名蜂胶品牌，成立于1992年，安徽省著名商标，高新技术企业，专业生产经营以蜂产品为主的中药制剂及蜂系列营养保健品的企业','B','','百春','BAICHUN'),(467,'安徽麦堡食品工业有限公司，成立于一九九二年，公司注册资金200万元，是一家从事食品佐餐调料开发研究及生产的民营股份制公司，也是国内较早研究生产系列便捷型复合调味品的厂家之一。','M','','麦堡','MAIBAO'),(468,'\"安徽徽王食品有限公司，成立于2001年7月，是一家以干食用菌、干蔬菜、杂粮等安徽特色农产品以及“世界水果皇后”蓝莓为主营业务的现代化农业生产加工和种植企业。 徽王食品始终坚持“公司+基地+农户+市场”的农业产业化经营模式，保证产品从源头上的健康与绿色，同时与国内外大型卖场合作，主要客户有：沃尔玛、家乐福、麦德龙、乐购、北京华联、南京苏果、徽商红府、百大合家福等超市，让千家万户品尝到来自大山、来自田野、来自碧水、来自雨露云雾间的徽王特色农产品。\"','H','','徽王','HUIWANG'),(469,'安徽高乐纺织有限公司是一家专营纺织品的专业公司，如今发展成为集设计、开发、生产、销售、服务于一体的现代企业。主要出品“GOL高乐”牌毛、浴巾系列产品和“GOR高燃”牌针织内衣系列产品，本公司产品采用100%优质棉（经国家服装质量监督检验中心检验认可），质量按国家FZ62006-2004标准。产品质地柔软，吸水性强，图案新颖，花样繁多。本公司凭借先进的经营理念、卓越的品质和完善的售后服务，产品逐渐得到广大消费者的青睐，市场份额不断扩大。产品已在安徽、江苏、山东、浙江、湖北、江西等省份与全国知名连锁超市和连锁大卖场合作，销量在各超市、大卖场中均位于前列。','G','','高乐','GAOLE'),(470,'\"994年西麦从澳洲来到中国，在世界旅游名城——桂林开始了在中国大陆的健康食品事业。西麦把“关注健康，关爱家人”作为企业使命，秉承“诚信、务实、创新、双赢”经营理念，富有远见地实施了扎根于中国的本土化战略，采取稳健、灵活、个性融而为一的商业模式，并以引领行业发展的行事风范，锐意进取，持续创新，打造成为中国谷物食品行业的杰出代表。 十多年来，西麦在市场网络构建、品牌传播、产品研发、团队建设等方面取得了令同行瞩目的业绩，尤其在2001——2005年“二次创业”中，西麦初步搭建了现代化经营管理、规范化市场营销、优化产业结构、资本运作和人力资源管理五平台，为西麦事业打下了坚实的发展基础。\"','X','','西麦','XIMAI'),(471,'1961年，「雪碧」这一款柠檬味汽水饮料，由可口可乐公司推出的第三个品牌。「雪碧」汽水产品与可口可乐公司的其他饮料产品齐头并进，如今已经成为美国发展速度领先的主要非酒精饮料产品之一，并且是全球深受青睐的柠檬味汽水非酒精饮料产品之一。','S','','雪碧','Sprite'),(472,'1924年力士在美国首次推出第一块美容香皂。到现在，它已遍布全球100多个国家。主要市场包括阿拉伯，印度，巴西，中国等，在日本，力士占市场主导地位。2003年的销售额将近11亿美元。其产品包括洗发乳，润发素，沐浴露和香皂等。','L','','力士','LUX'),(473,'1886年，可口可乐在美国乔治亚州亚特兰大市诞生，自此便与社会发展相互交融，激发创新灵感。现在，它每天为全球的人们带来怡神畅快的美妙感受。目前，全球每天有17亿人次的消费者在畅饮可口可乐公司的产品，大约每秒钟售出19,400瓶饮料。目前为全球最大的饮料厂商[1]  。','C','','可口可乐','Coca-Cola'),(474,'“五洲”产品原由蒙城五洲食业有限公司生产，公司整体被雨润集团收购扩建后将成为全国最大、最专业的牛肉加工企业。公司创建于1980年，产品工艺源自民间流传3000年的牛肉干作坊制作方法，经过工厂化改造逐步形成的。1985年由安徽省土产进出口公司牵头为出口达标对公司进行第一次改造。1993年上海市副食品公司牵头对公司进行了第二次改造，帖牌加工“立丰”牌牛肉干供应上海市场。1999年与当代文化名人、著名笑星牛群合作成为第一个央视做广告的牛肉制品企业，在全国推广“五洲”品牌。2000年引进韩国设备改进蒸煮工艺，2003年引进日本设备更新烘干工艺，实现行业内第一个牛肉干加工流水线。把牛肉干从传统食品，土特产层次提高到高档、时尚的休闲食品层次，极大的丰富了新生富裕阶层对高品质生活的内容。','W','','五洲','WUZHOU'),(475,'“立白”是立白集团旗下第一大品牌，而作为中国洗涤用品领域的领导品牌，”立白“拥有全国销量第一的洗衣粉、洗洁精以及全国销量领先的洗衣皂、洗衣液和小液洗产品。根据国际权威的AC尼尔森数据显示，立白洗衣粉全国销量第一，全国市场份额占比为25%，全中国有近1/4的家庭都在使用立白洗衣粉；立白洗洁精连续多年占据全国销量第一，全国市场份额占比为40%。“洁白不伤手”的立白，正源源不断地为消费者提供健康优质的产品，让每个家庭都能享受洁净、健康的幸福生活。','L','','立白','LIBY'),(476,'“金龙鱼”是新加坡郭兄弟粮油私人有限公司所拥有的食用油品牌。1974年，郭兄弟集团在中国投资了嘉里粮油（中国）有限公司，从此开辟了中国市场。益海嘉里是丰益国际在华投资的全资子公司，是世界最大的小包装油生产商之一。在中国境内35个城市设有企业110多家，在最大的货运枢纽附近建立58个生产基地，现在益海嘉里规模宏大的生产、销售和物流网络，覆盖了中国多个省、市、自治区的2839个县市，拥有近350个销售处，1585个经销商5000多家分销商，超过100万个终端保证供应。','J','','金龙鱼','JINLONGYU'),(477,'“古越龙山”是唯一国宴专用黄酒，享有“东方名酒之冠”的美誉。在2005年《中国500最具有价值品牌》排行榜上，以13.91亿元品牌价值名列第355位，是中国黄酒行业唯一进入500强的知名品牌','G','','古越龙山','GUYUELONGSHAN'),(478,'“DARLIE、黑人牙膏”是好来化工集团旗下的优质口腔护理产品品牌，主要产品包括牙膏、牙刷及漱口水等。凭藉多年来对口腔护理专业的热诚，“DARLIE、黑人牙膏”以崭新的科技和创新理念，不断研发更新更优质的产品，致力满足消费者与时俱进的需求，让他们展现健康而自信的笑容。时至今日，DARLIE黑人牙膏已成为家喻户晓的畅销品牌，在中国、印尼、马来西亚、新加坡、泰国、越南、香港和台湾等市场均成为畅销品牌。','D','','黑人','DARLIE'),(479,'“好吃点”是一种饼干系列的品牌名。有香脆系列、层层松系列、高纤饼系列、酥仁系列、豆香工坊、苏打饼系列、杂粮系列、咸脆饼系列等多个系列数三十余种口味。','H','','好吃点','HAOCHIDIAN'),(480,'\"葱伴侣豆瓣酱,吃饭就是香!\"是它的广告词,它是山东烟台欣和味达美食品有限公司生产的,是可以蘸食蔬菜的酱,纯正的绿色食品对身体非常有易!','C','','葱伴侣','CONGBANLV'),(481,'浙江双枪竹木有限公司系浙江省竹制品协和会会长单位，成立于1995年7月15日，主要加工产品有：竹木工艺筷、砧板、牙签，以及竹制家居用品。是竹制品行业中规模最大、效益最好的企业之一，也是竹制品行业中第一个“中国驰名商标”的拥有企业，现已通过国家高新技术企业认定。目前有占地约13万平方米的杭州、庆元、龙泉三大加工基地，员工一千多人，年加工能力三个多亿，是中国竹制品行业的佼佼者，更是筷子、砧板、牙签行业真正的领军企业。与国内各大知名卖场均有合作，同类产品在沃尔玛、家乐福、麦德龙、大润发、欧尚、易初莲花、好又多、世纪华联等超市中平均占用率超过50%！','S','','双枪','SUNCHA'),(482,'\"RIO（锐澳）酒业自成立伊始，就致力于中国预调鸡尾酒市场的开拓与建立，并在2007年，产品即已覆盖全国市。 RIO（锐澳）酒业作为国内唯一一家专业生产鸡尾酒的企业，现已成为中国预调鸡尾酒市场的领军企业。 伴着整个市场逐步成熟，RIO（锐澳）势将书写预调鸡尾酒在中国的下一个传奇。\"','R','','锐澳','RIO'),(483,'\"云南白药品牌享誉中外，是中国止血愈伤、消炎消肿、活血化瘀类产品的百年品牌。云南白药牙膏是以牙膏为载体，借鉴国际先进口腔护理、保健技术研制而成的云南白药口腔护理保健产品。它内含云南白药活性成份，具有迅速抵制牙龈出血，修复口腔溃疡，改善牙龈肿痛，袪除口腔异味的作用，同时具有防止牙龈炎，牙周炎、牙龈萎缩等问题的作用。它选用高档软性硅磨料和高级润湿剂，膏体细腻，清新爽口。在日常刷牙中，即可使牙周、牙齿和口腔其它组织得到专业的护理、保健，令口腔更健康，牙齿更牢固，是新一代口腔护理、保健的理想产品。 \"','Y','','云南白药','YUNNAN BAIYAO'),(484,'安徽乡润农产品科技有限公司是一所专业生产加工大米的有限责任公司(自然人投资或控股),公司总部设在安徽省合肥市庐阳工业园天河路,安徽乡润农产品科技有限公司拥有先进的加工设备、完整的操作流程、科学的质量管理体系。目前主打“乡润”牌系列大米。同时代理“北大荒”系列大米、泰国“金轮”以及“俊佳”牌系列香米。安徽乡润农产品科技有限公司的十年诚信、雄厚实力、优质服务和产品质量获得业界的认可。','X','','乡润','XIANGRUN'),(485,'漕溪是安徽著名黄山毛峰品牌谢裕大旗下品牌，谢裕大品牌标注黄山毛峰的品质和象征。','C','','漕溪','CAOXI'),(486,'Big Boy','B','','Big Boy','Big Boy'),(487,'Doppelherz（双心）是德国著名保健品牌，致力于选取天然原材料研制高品质保健产品，是德国天然植物保健食品领域的领军企业魁士药业旗下最受喜爱的品牌之一。1911年，德国化学家Josef Peter Hennes，从草药和其他天然植物中提取了有效成分，制成双心草本能量调理液（用于心脏功能调理），“双心”的名称也由此而得。现在，双心已拓展产品种类，均达德国医药类DIN标准，深受德国及欧洲地区消费者信赖。','D','','双心','Doppelherz'),(488,'Ecoandino','E','','爱可浓','Ecoandino'),(489,'南非秘鲁','I','','印加','Inkanat'),(490,'Male Extra','M','','Male Extra','Male Extra'),(491,'Leadingedge health','L','','Leadingedge health','Leadingedge health'),(492,'南非秘鲁 Perubionatural','P','','Perubionatural','Perubionatural'),(493,'Southernature','S','915c8d0d-1450-4c71-81a2-76171f110740.jpg','澳绿康倍','Southernature'),(494,'丹麦珠宝品牌潘朵拉珠宝 (Pandora) 因打造妩媚亘永的优质珠宝风靡全球，是全球销售量第三大的珠宝品牌。潘朵拉珠宝 (Pandora) 以美丽的方式捕捉生命中的难忘时刻，打造出美轮美奂、工艺精湛的珠宝，从而获得了世界各地消费者的青睐。1982 年，潘朵拉珠宝 (Pandora) 于丹麦哥本哈根成立第一家零售店，现今已在47个国家设有超过一万个专柜，其中包括260家潘朵拉珠宝 (Pandora) 品牌概念店。潘朵拉珠宝 (Pandora) 品牌的灵感来源于希腊神话。','P','8646543b-5d88-4ffc-9b03-6f114740d3b1.jpg','潘多拉','PANDORA'),(495,'Sunyata','S','','Sunyata','Sunyata'),(496,'Puritan\'s Pride（普丽普莱），1960年创建于美国纽约长岛，美国营养食品航母企业NBTY Inc. 旗下公司，美国最大最全的保健品公司之一，全球最大的营养素生产企业，产品全部通过美国FDA认证。该公司从事维生素、矿物质、草药及有关健康、美容、减肥等健康食品的开发、研制、生产，销售超过1000种的营养品，拥有超过1900万的满意顾客，无论质量还是价格都是人们购买保健品的首选。','P','','普丽普莱','Puritan‘s Pride'),(497,'BL是全球最大的专业扬声器生产商，从原材料开发、喇叭单元的设计和生产、音箱的设计和生产一切都能全盘控制在自己的手中。JBL音箱的服务范围非常广泛，在专业领域上包括了电影院、大型音响工程、大型流动演出、录音室监听、乐队用的音响 ，以至娱乐场所如迪士科、歌舞厅、卡拉OK、酒吧……民用方面，从最高级的发烧音响，以至目前最流行的家庭影院组合……到处都可以看到JBL的身影。','J','','JBL','JBL'),(498,'秘鲁玛卡','L','','拉摩力拉','Lamolina'),(499,'美国威乐','V','','威乐','VigRX plus'),(500,'吉列（Gillette）是国际知名的剃须护理品牌，由“吉列之父”金·吉列（King C. Gillette）创办于1901年。到1917年，吉列品牌在美国国内的市场占有率已达80%，奠定了其在刮胡刀领域的领导地位。自20年代开始，吉列逐渐进入国际市场，并迅速成长为国际知名品牌。吉列一直是世界剃刀和刀片领域的领先品牌，其在全球市场的占有率高达65%，处于绝对领先的地位。2005年宝洁（P&G）以570亿美元并购吉列公司。','G','567b2ce2-615e-4f9e-a91c-c9a650642311.jpg','吉列','Gillette'),(501,'哈曼卡顿(Harman/Kardon)是哈曼国际工业（NYSE：HAR）的一个部门，专门生产制造家用与车用音响，总部位于美国纽约伍德布里。JBL、AKG、 Infinity也是属于哈曼集团旗下的品牌。Harman/Kardon于1953年由热爱音乐与艺术的Dr. Sidney Harman与Bernard Kardon两人创立。Harman/kardon哈曼卡顿音响是非常著名的顶级音响品牌，该公司旗下还有JBL、Becker、AKG、Infinity、Mark Levinson、Lexicon、 Revel 和Studer这几个著名的音响品牌，完全可以和BOSE相提并论！','H','366a840d-c11a-4442-af7d-8a4594596b42.jpg','哈曼卡顿','Harman/Kardon'),(502,'安普里奥·阿玛尼 (Emporio Armani) 是意大利著名品牌乔治·阿玛尼 (Giorgio Armani) 为年轻人设计的副线品牌。“安普里奥”(Emporio) 是意大利文，意思是“百货公司”，安普里奥·阿玛尼 (Emporio Armani) 喻意一间阿玛尼 (Armani) 百货公司，安普里奥·阿玛尼 (Emporio Armani) 的产品种类林林总总：有男装女装、鞋履、香水以至眼镜饰物等。','E','d42b4c0e-9cef-4d23-bc04-8dfc6d6cf64d.jpg','安普里奥·阿玛尼','Emporio Armani'),(503,'1909年，MUHI创立于日本富山县，迄今已有100余年的历史。 创业以来，弊公司有两点值得自豪的业绩；一是虫咬蚊叮药品方面，在日本国内久享盛誉，并且在香港、澳门、马来西亚、新加坡等国家和地区的市场占有率位居前列；二是在外用药制剂方面，本公司具有世界高水平的生产技术。 今后，本公司作为专业的外用药制剂生产厂家，将充分发挥我们独自研发的先进技术，为创造出效果更好，安全性更高的高品质商品而不断作出挑战。','M','9229f071-140c-4c96-a985-5fa38c43f756.jpg','池田模范堂','MUHI'),(504,'自1915年成立以来，在日本以及越来越多的国家和地区，佐藤制药已经成为一个非常熟悉的日用保健品公司。佐藤制药同时也是OTC领域的先驱，并且这些年来在市场需求的创新以及高效的产品方面不断的取得成功。','S','d8c20799-1dd9-4b96-af82-32196dd0194e.jpg','佐藤制药','Sato'),(505,'Four loko，中文名为四洛克。四洛克是由美国三名大学生发明的酒精型饮料，因为价格便宜，极易入口，而且在美国各大商店都能买到，所以自售卖起，就受到了美国青少年的热捧。传闻Four loko中的four的意思是，它代表了四种成分，即酒精、咖啡因、牛磺酸、瓜拿纳。','F','','四洛克','Four Loko'),(506,'GILIM 是韩国知名的坚果类零食品牌，以数十年来积累的核心技术为基础，严选世界各地的优质原材料，为了给消费者提供更多优质产品，不断提高加工技术，不断研究开发、投资，其优秀的产品质量得到世界性的认证。2015年全新的韩国GILIM 蜂蜜黄油杏仁，成为韩国各大超市便利店一票难求的NO.1美味零食，引韩国社交网络热议炫耀。','G','','GILIM','GILIM'),(507,'台湾马玉山食品工业有限公司，创立于1961 年，从草创的第一天开始，企业内部就有食品业是良心工业的共识，对于产品品质的部份下了极大的功夫。厂内设有完善的实验部门，为产品的品质确实做好把关的工作。每一个检验工作小细节，都是消费者健康的大关键，多年来，马玉山产品系列从来不轻忽。曾荣获HACCP、ISO9001国际品质认证，产品更是销售全球各大城市，广受各界消费者的喜爱。','G','','马玉山','GREENMAX'),(508,'ICA Sverige AB是瑞典一家大型零售企业集团。该公司始建于1938年，其总部设在Scandinavia ，而该公司在北欧国家是世界上最大的零售公司。ICA每家商店都拥有自主经营权，但组内协调运作。所有门店都配备了ICA的品牌产品，ICA麦片更是成为其自有品牌中的典范。','I','','ICA','ICA'),(509,'德国老牌公司August Storck KG推出Knoppers威化饼干，成为2015年最火爆代购。德国小朋友们最爱的威化饼干，风靡整个欧洲及澳洲新西兰。口感可媲美马卡龙，五层威化：费列罗巧克力+鲜牛奶+威化+榛仁巧克力酱+威化，口感丰富，低糖低卡路里。澳大利亚及欧洲各大超市均断货，上架即抢空，火爆程度可见一斑。','K','','Knoppers','Knoppers'),(510,'乐天集团于1948年在东京成立，最初是食品制造商，后在韩国发展，是全球著名的日韩联合企业。自1967年在韩国创立了第一家“乐天制果”起，乐天集团已走过了40余年的光辉历程。期间，乐天集团不断地将事业扩展到 食品、零售、石化、旅游、金融等多种产业，知名度及影响度均属领先地位。乐天立足韩国、日本，以中国、俄罗斯、 印度尼西亚及越南等国为中心展开全球化运作。','L','','乐天','Lotte'),(511,'Richeese（丽芝士）是印度尼西亚NABATI旗下创意美食品牌。丽芝士纳宝帝威化系列，威化配奶酪，创新美味无法抵挡。浓郁的小麦香，融入乳清奶酪粉，甜而不腻，入口既化，唇齿留香。丽芝士是新的品牌却因为创新的口感征服了东南亚的男女老少，2014年仅仅一年电商销量突破三个亿。','R','','丽芝士','Richeese'),(512,'Special ','S','','Special ','Special '),(513,'阿舍食堂原来是中国台湾一家传统制面厂，六年前使用酱油、香油等调配出简单酱料，推出阿舍干面后，收到热烈欢迎。2010年微风集团加入后，更是带入了专业企业经营模式和营销手法，维持阿舍干面的品牌定位，并同步推向其他地区，进一步推广了阿舍食堂品牌。同时阿舍食堂也朝多元化发展，陆续推出阿舍系列商品，如阿舍泡面、饮料等，朝更专业的食品公司迈进','阿','','阿舍食堂','阿舍食堂'),(514,'韩国ORION集团是于2001年9月从东洋集团中分离并创建的以制果为中心发展起来的年轻集团，产业涉及流通、媒体、电影、娱乐等各领域，旗下拥有16家公司。（株）ORION，ORION集团的始创公司，是东洋集团的创始人瑞南李洋球会长于1956年创建的。公司成立以来开发了以好丽友·派等产品为代表的世界著名品牌，稳步的发展使其成为韩国制果产业中的佼佼者，畅销东南亚、欧洲、南美、非洲、澳洲等60多个国家。','O','','好丽友(韩国)','ORION'),(515,'日本丸荣生物制药株式会社（Maruei Biopharma Co.,Ltd）成立于平成17年4月(2007年)，隶属于日本丸荣集团（Maruei Group Co.,Ltd），总部设于东京丸荣大厦，分别在静岡、横滨两地建有产品研发和生产基地。丸荣生物始终秉持着“从大自然中来，让自然的力量解决问题”的理念，运用先进的生产技术和专业的生物科学技术， 以天然的植物为原料，研发了各种优质产品。长期荣登日本乐天热销榜首。','M','','丸荣','MARUEI '),(516,'JIUR（九日）是韩国乐天制果中较大的进口商（包括可瑞安制果、好丽友制果、海太制果），汇集众多地道韩国休闲系列食品，畅销海内外。产品主要涉及韩国饮料、韩国糖果、韩国巧克力、韩国海苔、韩国柚子茶、韩国打糕、韩国酒、韩国调料等韩国食品，公司实力雄厚，严格保证产品质量，在消费者当中享有较高的地位。','J','','九日','JIUR'),(517,'日清食品集团，由创办人安藤百福先生一手创立。1958年8月25日，安藤先生在日本大阪发明了世界上最早的方便面“鸡汁拉面”，把“创造精神”作为日清食品集团的核心，且“方便面”被誉为二十世纪最伟大的发明之一。并在1971年推出的“CUP NOODLES”（合味道）是全球最早的容器面方便面产品。2015年日清食品将继续本着“美味优先”的宗旨，不断开发和创造出更强大的商品品牌，致力于为消费者提供安全、安心、方便又美味的食品。','N','','日清','NISSIN'),(518,'恬恬思','恬','','恬恬思','恬恬思'),(519,'张君雅小妹妹','张','','张君雅小妹妹','张君雅小妹妹'),(520,'Lidl于1930年成立，是德国知名的零售集团，总部设在内卡苏尔姆市，隶属于Schwarz控股公司旗下。Simply Sumptuous经典麦片旗下自有品牌Simply Sumptuous在整个欧盟区赫赫有名，富含营养丰富的水果坚，以低糖低盐的健康麦片受到欧洲人的青睐。','S','','立德尔','Simply Sumptuous '),(521,'Klarstein，是德国百年小家电、厨具品牌，其设计和创意总部在柏林，产品涉及家用电器、厨房设备、以及一些生活电器。Klarstein的一些设计非常新颖美观、色彩艳丽，不仅延续了德国传统工艺，更是在设计方面打破德国一向的沉闷冷峻，产生出一系列品质美观小家电，把厨房变成一种快乐的生活体验，畅销欧美，受到众多厨师和美食者的喜爱。','K','','Klarstein','Klarstein'),(522,'160多年前，160多年前，天梭成立于瑞士汝拉山区的小镇力洛克，而其总部至今仍位于那里。“瑞士制造”是天梭心中从不曾磨灭的烙印，天梭logo中的“+”和瑞士国旗相同，这是品质的象征，展现了品牌自1853年来不断传承的可靠质量。今天，天梭已成为腕表制造商和经销商-斯沃琪集团（Swatch Group）的一员。凭借着销售网络更广泛、品种更多样、价格却比任何其他瑞士品牌更具吸引力的腕表，天梭实践了他对”让卓越触手可及“的承诺。','T','3b8b87a1-ad7e-443a-a646-90c5d398d73f.jpg','天梭','TISSOT'),(523,'在婴幼儿营养方面，Gerber（嘉宝）积累了超过80年的专业经验，拥有全美知名的嘉宝婴幼儿营养研究中心。一直致力于为成长初期的婴幼儿（0-2岁）提供营养健康的食品。在全球范围内，“促进婴幼儿的健康成长和发育，并帮助他们尽早形成良好的饮食习惯”，是嘉宝不渝的使命。','G','4d8945b4-afd3-4211-9734-520871cdc5fc.jpg','嘉宝','Gerber'),(524,'巴西','A','','Apis','Apis'),(525,'BiotechUSA','B','','BiotechUSA','BiotechUSA'),(526,'Health Bank 保多康','H','','保多康','Health Bank'),(527,'韩国LG生活健康旗下最新的身体护理品牌：ON:THE BODY，由“国民初恋”裴智秀清纯代言。新出品的香水沐浴露，是韩国超人气沐浴露！天然花香迷人，无防腐剂。传承韩国古方配方，让肌肤享受SPA级的天然呵护。打造Q弹、水灵、细滑、白嫩的完美肌肤。','O','','ON:THE BODY','ON:THE BODY'),(528,'韩国专业药妆面膜 膜＂界神话丽得姿 韩国首尔大学皮肤专家 11年潜心研修 荣获5项发明专利，1项国家级科技荣誉   经皮肤科测试真正的药妆品牌','L','b1f46712-42f3-48ad-9b26-4ce2d253117d.png','丽得姿','Leaders'),(529,'高丽雅娜Coreana是韩国三大化妆品集团之一，品牌拥有基础护肤、彩妆、洗发、沐浴系列等产品，旗下还包括有Premium、Zain、Nokdu、Coreana Black Diamond、翡翠佳人、Senite비취가인、텐세켄、세니데、SHENIZ、BIODEFENSE、Tenseconds、LOCOMOTION等众多品牌。','C','0d0dc52f-9d6d-454a-9f06-4895d9f198ec.png','高丽雅娜','Coreana'),(530,'韩国Forencos品牌 深受韩国艺人喜爱的品牌崇尚自然，注入维他命、保湿成份及植物萃取精华，从基础护肤到各式彩妆一应俱全，可助你全面缔造美人形象。该品牌崇尚自然，在产品中注入维他命、保湿成分及植物萃取精华。','F','9d2f0572-9881-48e2-b7f1-c2baed89072c.png','芙恋可姿','Forencos'),(531,'1984年，欣兰化妆品公司诞生于台湾中部宁静的滨海地区-大甲。多年来，欣兰一直迈着平稳，求新的步伐，从事各项净肤，美颜用品的制造与研发，不断引入新科技资讯提升专业能力至国际水准。','D','af1cbf0a-2a4a-4896-8e03-a6ee6ad041da.gif','欣兰','DMC'),(532,'Dr.Jart+是来自韩国的药妆品牌，同时也是韩国的BB霜始祖。Dr.Jart+蒂佳婷品牌寓意为”Dr.”与”art”相结合，把理性、信任的专业背景与感性、热情、快乐的护肤艺术相融合的药妆品牌。','D','bb819c88-37fb-4bd8-b9ee-4258e2d9a099.jpg','蒂佳婷','Dr.jart+'),(533,'RE:CIPE在英文翻译里叫做“食谱”寓意着肌肤都需要像食物那样好的材料才能创造出健康的肌肤。','R','19c316ed-06c5-48b2-af33-6e358bf9a885.png','RE:CIPE莱斯璧','RE:CIPE'),(534,'碧唇Blistex是地道的美国品牌，该公司于1947年成立 当时只是一家以家族式经营为模式的小型公司，主要生产推销唇部护理产品 由于碧唇非常注重产品品质和产品的推陈出新，如今他们已发展成为一家全球性的大公司。','B','94b7c474-60fe-4d87-bc4a-af665bc8ae19.png','碧唇','Blistex'),(535,'CLIO诞生韩国1992年在工作过程中，一群韩国顶级化妆师发现市场上的彩妆产品，从质地到颜色的选择均非常缺乏，为彩妆师带来诸多不便。出于对艺术的热情以及对完美的追求，CLIO这个品牌终于在一九九三年诞生。 CLIO的名字源于希腊神话中冥想历史之神，是品质与高贵的象征。','C','d65a5b96-6ae5-4c8d-90a1-a70f141bcfbb.jpg','珂莱欧','Clio'),(536,'1','D','','杜碧丝','Dimples'),(537,'Coppertone是美国一家历史相当悠久的防晒产品公司，现隶属于默克集团，总部位于美国新泽西州。旗下产品包括水宝宝系列防晒霜。 Coppertone公司拥有北美洲最大的防晒研究中心，该中心在1972年率先提出使用SPF系统来测试防晒品的功能。','C','','科普特','Coppertone'),(538,'1','N','','娥佩兰','Naturie'),(539,'韩国rainbow彩虹集团一直在业内为一线面膜品牌做产品生产，现在韩国rainbow彩虹集团推出了自己牌子的面膜，并在韩国本土获得年度本土排行榜面膜第一名。 ','R','','彩虹','Rainbow'),(540,'欧米茄（OMEGA）是国际著名制表企业和品牌，英文名omega，代表符号“Ω”。由路易士·勃兰特始创于1848 年，欧米茄标志着制表历史上的光辉成就，傲视同侪，相当精致 。欧米茄以其先进制表技术，成为制表业的先锋达一百五十年之久。','O','d0e4c160-d7f0-4c72-850b-f58be2943616.jpg','欧米茄','Omega'),(541,'23years old是将被称为“therapy-cal”的医学和家庭护理之间的产品概念：与具有有效皮肤改善效果的，治愈系疗法相结合的品牌。','2','','23岁','23 years old'),(542,'1','T','','Tsubu night pack','Tsubu night pack'),(543,'日本护肤品牌，主要因其研制的蛇毒眼膜而出名。这款由Wave Corporation公司生产的 Spa treatment蛇毒眼膜由瑞士研制开发，是结合世界顶端生物技术的滋润型眼膜。','S','','Spa treatment','Spa treatment'),(544,'Maplelife','M','','美柏莱','Maplelife'),(545,'浪琴（LONGINES）于1832年在瑞士索伊米亚创立，拥有逾184年的悠久历史与精湛工艺，在运动计时领域亦拥有显赫传统与卓越经验。以飞翼沙漏为标志的浪琴表以优雅着称于世，作为全球领先钟表制造商斯沃琪集团旗下的著名品牌，浪琴表已遍布世界130多个国家。 作为世界锦标赛的计时器及国际联合会的合作伙伴，浪琴表品牌以其优雅的钟表享誉全球，亦是世界领先钟表制造商 Swatch Group S.A. 公司的旗下一员，浪琴表世家以飞翼沙漏为徽标，业务遍布全球多个国家。','L','f8052ce6-e5fc-4d56-a90e-25d123bb8b46.png','浪琴','LONGINES'),(546,'NU-LAX澳洲乐康膏自70年前澳大利亚药物学家在墨尔本研制开发以来，是对人类安全有效的润肠通便保健品。其功效和安全性已经通过澳洲TGA、美国FDA等许多国家的检验机构所证实。70年来，澳洲人已经形成一种习惯：每当便秘、痔疮、腹胀、厌食、疲乏、失眠、上火、口臭、青春痘、皮肤粗糙等问题发生时，家中老少，都会自己随意地嚼食一小块NU-LAX。','N','','NU-LAX','NU-LAX'),(547,'Weet-Bix是澳洲第一品牌的营养谷物早餐专家，是澳洲人民最喜欢选择的早餐品牌，几乎每个澳洲家庭都会购买这个牌子的早餐产品。澳大利亚的“国吃”麦片——每个澳大利亚人都会说：“澳大利亚孩子是Weet-Bix孩子”（Aussie kids are Weet-Bix kids），这可是著名的广告词呢。吃粗纤维的燕麦片，不仅利于身体健康，更是减肥瘦身的一大利器哦。','W','','Weet-Bix','Weet-Bix'),(548,'加拿大Ddrops维生素D公司，专业生产不同含量的维生素D滴剂。产品适用于成人和婴儿，安全无色，无味、植物型、吸收好、瓶口设计滴管，每一滴含量精确，服用最方便，在维生素D行业成为革命性的研发品，为越来越多人所追捧，特别受到婴幼儿父母的喜爱。','D','','Ddrops','Ddrops'),(549,'从今天起追溯到大约200年前，东北地方的武家・佐竹藩的御医藤井玄渊创制了止咳用的新和汉药。这就是「龙角散」的起源。随着时代的变迁，到了明治时期，「龙角散」开始作为一般药品销售，并立刻成了当时的畅销商品。然后到了明治27年，经由藤井家的子孙得叁郎对「龙角散」进行改良，确立了细粉状制剂的制备技术，完成了现在的「龙角散」。','R','','龙角散','Ryukakusan'),(550,'lamisil是瑞士诺华制药，产地瑞士！ 世界上最好的脚气药~复发率低、副作用少、安全性高 畅销欧美，澳大利亚，香港等国家地区。','L','','Lamisil','Lamisil'),(551,'QV是Ego旗下的护肤品牌之一，QV的历史要追溯到1975年， 当时的维多利亚女王医院（Queen Victoria Hospital），妇女儿童健康保健领域的先导者，向澳洲著名的药剂师 Gerala Oppenheim 提出要求，让他为医院的皮肤科病房研发一款特殊的护肤产品。Gerala Oppenheim 同意并研发了一款产品给他们，这款产品就是著名的QV Bath Oil( 是以医院的名字命名的)。QV Bath Oil 在当时非常的受欢迎，在短短的三年后，产品开始在药店销售。从此，QV护肤系列开始诞生。 QV系列护肤产品以无香精，无色，无刺激著称，受到了广大澳洲消费者的青睐。','Q','','QV','QV'),(552,'芳芯(femfresh®)为一系列由专家研发、通过英国皮肤科与妇产科测试,专为女性最私密敏感的肌肤设计,天天使用的私密肌肤洁净卫生用品。 ','F','','芳芯','Femfresh'),(553,'丽丝雅逐渐变黑系列累积45年以上经验，能逐渐将你的白发变黑，让头发重拾自然色彩。','R','','丽丝雅','Restoria discreet'),(554,'卧佛牌青草药膏萃取了多种草本精华，具有解毒消炎、清热化湿的功效，是泰国居家必备的用品。','卧','','卧佛牌','卧佛牌'),(555,'YANHEE是泰国知名保健医疗品牌。','Y','','YANHEE','YANHEE'),(556,'ANNA足贴产自清迈郊区的百年泰药园，是纯天然植物配方，无污染，无添加化学成份的健康保健品。','L','','兰纳','LANNA'),(557,'泰国知名通鼻产品。','P','','八仙筒','POY-SIAN'),(558,'柳屋本店总部位于日本桥，是美发、化妆品生产商，165年成立至今已有近400 年历史。创办人一直坚持产品使用最优质材料，以获取顾客的支持和信赖。护发乳 发根营养液和男士发蜡是品牌最畅销的产品。其目前主要的产品有发蜡，发油，染发膏、护发素、增毛膏等。',' ','','柳屋',' YANAGIYA'),(559,'撒隆巴斯（SaonpaS）是久光制药旗下的子品牌。自1847年进入贴剂行业以来时至今日已成长为日本该领域的领先企业久光制药的主打产品撒隆巴斯系列，更是被誉为贴剂领域的先驱者。 撒隆巴斯的产品商标目前已在全球多个国家注册，并受到广泛好评。久光制药将会继续着眼于全球业务的发展，推进新产品，的研究和开发。','S','','撒隆巴斯','SALONPAS'),(560,'乐敦制药株式会社是总部位于大坂市生野区巽西的一家日本制药公司。其前身信天堂山田安民药房于1899年创业。创办人是山田安民。现在的主要产品包括眼药水、化妆品和胃肠药。1988年将美国药厂曼秀雷敦纳入旗下。','R','','乐敦','ROHTO'),(561,'妮维雅全球销量第一的肌肤护肤品牌百年德国护肤品牌为女性提供专业的肌肤健康知识成为广大女性乐于亲近相伴左右的护肤品牌。 其品牌形象——“妮维雅能给肌肤最温和的呵护”已深入人心。在欧洲妮维雅更已成为皮肤保养的代名词。妮维雅产品在身体保养脸部保养防晒，唇部保养，个人清洁男士护肤等品类已稳居欧洲市场排名第一。 妮维雅花王是Beiersdorf与日本花王KAO的合作公司，针对日本市场设计推出了一系列现象级产品。花王KAO根据亚洲人皮肤全程研发制造，搭配百年德系配方，努力打造真正适合亚洲人的护 肤品牌。','N','','妮维雅','NIVEA'),(562,'日本知名药品研发公司。','N','','大判','Nichiban'),(563,'日本知名药厂。','O','','大塚制药','Otsuka'),(564,'日本知名药厂。','H','','久光制药','Hisamitsu'),(565,'碧柔(Biore)，是著名的全球500强企业，日本最大的日用消费品制造商——花王企业旗下的肌肤护理品牌，花王总部位于日本东京，在全球40多个国家设有工厂和办事处。作为一个家喻户晓的全球品牌，Biore碧柔自研发20多年来一直为消费者提供促进清洁、美丽与健康生活的系列产品，并以成为最受顾客支持与信赖的品牌为目标。花王株式会社成立于1887年，产品涉及化妆品等共300多种。2002年8月花王株式会社(Kao)(KAOCF)斥资3000万美元在创建了花王(中国)股份公司，从而一举将其在中国境内的三家企业纳入统一的管理之下。','B','','碧柔','Bioré '),(566,'曼秀雷敦 (Mentholatum) 公司1889年在美国创立，创办人希尔先生成功创制曼秀雷敦薄荷膏，迅即成为家喻户晓的必备良药，曼秀雷敦 (Mentholatum) 的英文名字“Mentholatum”是由“MENTHOL”（薄荷醇）及“PETROLATUM”（石腊油）组合而成。百多年后，(Mentholatum) 除生产薄荷膏外，还制造润唇膏等护肤品，以及眼药水、摩擦膏等OTC药品，畅销世界150多个国家和地区。','M','','曼秀雷敦','Mentholatum'),(567,'1','K','','高丝','Kose'),(568,'1','A','','Alovivi','Alovivi'),(569,'1','T','','太阳社','Taiyosha'),(570,'1','U','','尤妮佳','Unicharm'),(571,'1','A','','大赏','Avance'),(572,'1','藏','','藏元美人','藏元美人'),(573,'1','L','','Lululun','Lululun'),(574,'1','K','','贝印','KAI'),(575,'1','S','','莎娜','SANA'),(576,'1','S','','植秀村','ShuUemura'),(577,'1','C','','目元','CosmetexRoland'),(578,'1','S','','药师堂','SONBAHYU'),(579,'1','白','','白兔制药','白兔制药'),(580,'1','B','','BIOLINK','BIOLINK'),(581,'1','D','','DUO','DUO'),(582,'1','O','','OMI近江兄弟','OMI'),(583,'韩国海牌海苔，来自韩国的汉江，全部人工采摘文火加细盐烤熟，以香脆鲜著称。海牌海苔原材料采自天然无污染的海洋，现代先进加工工艺，保留天然风味。韩国高人气品牌，深受广大消费者的热爱，是韩国休闲食品的热销品牌。','海','','海牌','海牌'),(584,'丹尼尔·惠灵顿（Daniel Wellington）是来自瑞典的手表品牌，现总部位于瑞典东南部城市乌普萨拉（Uppsala）。多彩的尼龙表带，轻薄的表身、干净的表盘塑造了DW腕表百搭的书卷味的气质，让众多时尚达人爱不释手，在近年来的全球时尚圈掀起了一股绅士表款的风潮。在国外，它被称作是全球最热的腕表品牌，在Facebook和Twitter上都有极大的粉丝群，全球各大网站处处都可以看见它的踪影，发展至今，Daniel Wellington已经一跃成为各路时尚达人们提升格调的新兴腕表。','D','14ce0d9e-659f-43f2-9589-b2dbdb76d93c.jpg','丹尼尔·惠灵顿','Daniel Wellington'),(585,'1','S','','SLIMMING TRANSIT','SLIMMING TRANSIT'),(586,'M∙A∙C彩妆创立于1984年，原创加拿大，现为美国雅诗兰黛旗下所有。第一支M∙A∙C彩妆 是为了满足专业彩妆的摄影需要，在镁光灯下诞生的。从第一批产品开始，M∙A∙C化妆品就以其丰富的色彩和独特的配方取得了成功，奠定了专业彩妆品牌的地位。','M','3a2a135c-8b1d-4868-8890-e3dfb222710a.jpg','魅可','MAC'),(587,'美国Schiff 是美国著名保健品生产厂家，天然营养产品领域中的领导品牌。其GMP生产标准通过NNFA认证，产品品质的统一性、纯净性和稳定性成为业界标杆。主打商品维骨力，深受中国群众的喜爱，维骨力在中老年人心中占重要的地位。','S','','Schiff','Schiff'),(588,'1971年成立于美国，是全球最大的连锁咖啡，拥有30多款全球顶级的咖啡豆。多次被美国《财富》杂志评为“最受尊敬的企业”，深受全球人民的喜爱，让整个世界为之着迷。回溯多年历史，星巴克的技巧纯熟的咖啡师一直用心制作星巴克的经典与饮品。不同于普通的阿拉比卡咖啡豆，星巴克的阿拉比卡咖啡豆产自优质的种植地。对于咖啡豆品质的严格把控，星巴克始终不遗余力地恪守高标准。','S','','星巴克','Starbucks'),(589,'LongChamp（珑骧）创建于1984年，法国经典奢侈品牌，以优质皮革、创新工艺和平实售价闻名全球，其经典折叠包被称为法国“国民包”，是巴黎女人必备的心水之物。早年珑骧更被法国精品业联合会 (Comité Colbert) 邀请成为会员，身负向全世界推广法国精品的使命。自从邀请意大利著名时尚摄影师马里奥·索兰提(Mario Sorrenti) 掌镜，由英国名模凯特·莫斯 (Kate Moss) 担任代言的广告，珑骧 (Longchamp) 便起死回生般地拥有了新的活力。','L','a8ddb222-0474-4533-8042-5c2f64f7f060.jpg','珑骧','LongChamp'),(590,'Salvatore Ferragamo（菲拉格慕）由同名设计师创立于1927年，经久不衰的意大利经典品牌。百年匠心，造就卓尔不群的贵族风范。菲拉格慕以制鞋起家，是皮革制品、配件、服装和香氛的世界顶级设计品牌之一。奥黛丽赫本、苏菲亚罗兰、玛丽莲梦露等都曾是他忠实的支持者。秉承了意大利的传统设计精神，不但采用非常优质的材料，更配合精湛的工艺，时尚优雅与质量并重。','S','06e517e1-e96e-4275-ac0b-e464236e4f29.jpg','菲拉格慕','Salvatore Ferragamo'),(594,'完美的质地和创造力，经典与现代的巧妙结合，这些是Tod\'s集团得以长期占据国际市场重要地位的战略原则，作为世界制鞋业和皮革业的引领者，主打品牌为Tod\'s，同时还有Hogan以及奢侈服饰品牌Fay。公司拥有意大利最大的奢侈鞋品的生产中心，总部坐落于安科纳，那里是全球最集中的制鞋区域——在不超过50平方公里的区域，集中了超过2700个大大小小的实验室。','T','bf181a9b-7dd2-4cae-a0a6-0de5bf8c2fc3.jpg','托德斯','Tod\'s'),(595,'GAIA，意思是大地母亲之灵，是澳大利亚畅销的婴儿沐浴护肤品牌。澳洲产妇在出院的时候，医院送给新生妈妈的礼物中就有一整套这个品牌。产品含有丰富的有机认证成分，并且全属天然植物成分，给宝宝最安全的呵护，是妈妈最放心的选择。','G','34972a9c-781f-4e61-bae7-1b5baa5d17cc.jpg','盖亚','GAIA'),(596,'JACK N\'JILL（杰克和吉尔），澳洲专业宝宝牙膏生产厂家，只生产高品质宝宝有机牙膏和环保可降解牙刷。1949年成立于澳大利亚，现已在全球范围内销售。在EWG权威评测组织的皮肤深层-个人护理产品的安全性数据库中，该牙膏的评级伤害系数为零，是最安全的牙膏评级，天然、安全、可吞咽，不含任何有害化学成分。JACK N\'JILL也设计和制造由非转基因玉米淀粉制成的婴幼儿、儿童牙刷，可生物降解、回收。','J','458c6f5f-a1a3-4be7-af63-ca182020ef1d.jpg','杰克吉尔','Jack N\'Jill'),(597,'美可卓奶粉采用了全球领先的湿混工艺。湿混工艺是在新鲜奶源还在液体的状态下加入各种营养元素，然后进行均匀混合，最后将配制好各种营养素的鲜奶直接进行低温喷雾干燥，全程无菌化！湿混配制的奶粉可确保每一粒奶粉颗粒的营养成分都完全均匀一致。因此，每一勺美可卓奶粉都精确包含了等量的营养成分。','M','fcaf4709-99e8-481c-9e7b-4189b2174885.jpg','美可卓','Maxigenes'),(598,'Nature’s Way 是澳大利亚排名前三的健康营养品公司PharmaCare旗下的高端保健品、奶粉品牌。PharmaCare 公司创立于1985年，提供一系列高品质营养保健品，主打澳洲排名领先的综合儿童营养保健子品牌Kids Smart（佳思敏）。Nature’s Way得益于澳洲洁净的自然环境，严格管控的产品品质，在澳洲市场家喻户晓，成为澳洲家庭和游客必买的食品保健品牌。','N','3a6ead79-6f74-4667-9264-86588e800d76.jpg','佳思敏','Nature\'s Way'),(599,'Ostelin奥斯特林是世界第三大跨国制药集团，总部位于法国巴黎的Sanofi-Aventis公司旗下，专注于改善人体钙水平及维生素D水平的产品品牌。他们倡导“Put the D Back in Your Day”！Ostelin的钙、维D系列产品一直广受信任，是澳洲专业生产钙片和维他命D的品牌（除了钙及维D外不生产任何其他产品),并仅在澳洲药房出售，是儿童、成人安全有效补钙的首选。','O','505d2bed-ff2a-4b57-b309-8630e9040cfe.jpg','奥斯特林','Ostelin'),(600,'Banana Boat (香蕉船)是在SUNCARE领域享有盛名的美国品牌。Banana Boat隶属Playtex公司，总部位于美国Connecticut,是专业的防晒品牌。该品牌占全球防晒品５％的市场份额，其中，拉美占有率达 17.3％，北美达11.7％。','B','46e97e75-94b7-4a26-9f92-cc45262d2629.png','香蕉船','Banana Boat'),(601,'澳大利亚','B','','Breath Pearls ','Breath Pearls'),(602,'澳洲ego大药厂是皮肤科药妆的知名品牌。50年来除了澳洲本土，还行销10多个国家和地区。其中QV就是澳洲最大药房ego集团旗下的家庭保养品牌。Ego QV是澳洲家庭医生推荐敏感肌肤都可以使用的品牌，它的雪花膏适合日常保养，也适用于皮炎、牛皮癣、湿疹等皮肤问题，滋润度适合一年四季使用。','E','85b5a93d-ba09-448f-bc3c-ef931793eff2.png','意高','EGO'),(603,'澳大利亚','C','','圣诺','Cenovis'),(604,'新西兰保健品牌Healtheries 贺寿利 创立于1904年，已有百年历史，崇尚健康，给幸福安乐的人们带来健康补充。他们有超过750种不同的产品，跨越多种不同的保健品分类。Healtheries 贺寿利好口碑的产品包括维他命和矿物质系类，大蒜及草本萃取系列，天然食品系列，以及专为儿童配方的保健品系列。 如今，贺寿利走出新西兰，致力于将高品质的保健品带到世界的各个角落，将世界先进的科研成果融入产品研发制造中。','H','','贺寿利','Healtheries'),(605,'DJ&A','D','','DJ&A','DJ&A'),(606,'Maltesers（麦提莎），是糖果出品人美国玛氏食品的品牌。麦提莎巧克力小球发明家是Forrest Edward Mars, Sr. 内含麦芽、麦精、蜂蜜等，外包巧克力，在1936年当时称为“能量小球”。最初出品时，麦提莎只有牛奶巧克力味。到2002年推出白巧克力味，黑巧克力味，2006年推出咖啡巧克力味。国内的麦丽素外包装与麦提莎非常接近。','M','','麦提莎','Maltesers'),(607,'CapriLac是NuLac公司旗下主打品牌之一。NuLac食品是一家于2000年中期在澳大利亚成立的家族企业。公司在澳大利亚以及新西兰的奶制品生产、食品技术和乳制品领域拥有丰富的经验，所有产品的原材料均来自NuLac Foods自有的两个家族牧场，同时在自己的工厂里加工完成，纵向合并确保了公司乳制品的质量，为消费者提供上佳的产品。','C','','CapriLac','CapriLac'),(608,'campina在荷兰是家喻户晓的奶粉品牌!这款奶粉是荷兰家庭常备品，出门旅游外出也常常随身携带。小巧的袖珍外包装，独立的小内包装，让你喝多少冲多少不会影响剩下奶粉的品质，也便于保存！让人爱不释手！','C','','Campina','Campina'),(609,'Davitamon（达维特）是荷兰维生素大牌，源于1928年，接近90年，历史悠久，欧盟品质，安全有保证！Davitamon根据最新的科学见解，制定每个人群适合的维生素种类、含量与合理搭配，为每个人提供一个有益健康的饮食补充。','D','','达维特','Davitamon'),(610,'Optimax是荷兰最有信誉的食品补充剂和保健品供应商Nutrivital Holland b.v.（荷兰养分&生命团体）旗下保健品牌。1983 年研发，现畅销整个欧洲，尤其以儿童保健品最为有名，已多年欧洲销量第一。Optimax为成长中的儿童提供拥有可爱形态和水果美味的保健产品，包含了成长所需的维生素和矿物质。天然不含人工添加物，人工色素，使用天然蔬果的颜色（如红甜菜），以及调味料（如草莓）。','O','','Optimax','Optimax'),(611,'AIRBORNE（艾尔邦尼）是一家新西兰本土公司，公司创立于1926年，是新西兰最早的蜂蜜品牌。Airborne是新西兰最大的蜂蜜出口企业，并以独有的新西兰天然花蜜著称。其公司下的Clover，Rata，Tawari，Manuka更是享誉世界。公司生产的保健系列Health Manuka 蜂蜜为其公司最高品质产品，并获得Active AAH认证， 这也是新西兰为数不多的几家公司才有的殊荣。','A','','艾尔邦尼','AIRBORNE'),(612,'1','P','','Pro-life','Pro-life'),(613,'享誉世界近百年的西梅产品SUNSWEET GROWERS INC，一问市便受到广大消费者的欢迎，乃现今全球最大的干果种植及加工企业，包括蔓越莓、杏及西梅等，西梅干的年产量超过5吨，占世界总产量逾三分之一，以产量计算堪称全球第一。','S','','日光牌','Sunsweet'),(614,'Arnott’s饼干在澳大利亚一直是同行业中的销售冠军，它旗下的夹心饼干系列和Tim Tam巧克力饼干系列更是让人赞不绝口。自1964年出现在超市货架上至今，Tim Tam无疑成为了纽澳最受欢迎的巧克力饼干。据称用于制作Tim Tam的巧克力是由Arnott’s特别研制的，含有淡淡的焦糖味，其所用奶油则来自香草，黄油以及巧克力的的绝妙混合，令Tim Tam的口味在眾多巧克力饼干中能独树一帜。','A','','雅乐思','ARNOTT\'S'),(615,'挪威鱼油第一品牌LIFELINE CARE，是誉满全球的挪威国宝级宝宝鱼油品牌。作为挪威国内鱼油市场的龙头老大，其产品深受挪威国内消费者的喜爱，客户人群在挪威已达百万级别。LIFELINE CARE取材自挪威最优质的深海天然渔场，深海鱼的EPA、DHA和OMEGA-3含量更高。且LIFELINE CARE产品是由临床医生和药剂师共同研制的，其维生素和矿物质的含量符合对孕妇和产妇的官方推荐量。','L','','Lifeline Care','Lifeline Care'),(616,'1','P','','佩迪克','Pediakid'),(617,'1','N','','Nordbarn','Nordbarn'),(618,'Centrum（善存），是惠氏全球的优秀一员，是世界最大的药品制造商辉瑞制药旗下著名的保健品品牌，医生首推的维生素保健品，主打产品为维生素、矿物质补充剂，全球十大OTC品牌之一。以其卓越的品质不仅赢得了众多消费者的认知，先进的研究以及开发水平在改善人类生活品质上更是享有盛誉。','C','','善存','Centrum'),(619,'1','D','','DAS gesunde plus','DAS gesunde plus'),(620,'1','s','','skingain','skingain'),(621,'广源良，台湾的资深本土品牌，1986年由施仲广先生与伙伴于台湾彰化县创立。二十多年来，广源良秉持的是不变的「自然的坚持、亲切的品牌」经营理念。采用台湾的草本植物、研发天然的保养品。近年来，广源良的努力有目共睹，从早期丝瓜水单一产品，到「丝瓜水、丝瓜露、绿豆粉」成为广源良最热销长红的明星商品，目前产品更外销至东南亚、大陆...等海外市场，成功原因就在于无可取代的台湾本土味道。','C','0c44c836-5e91-4d42-a0c1-973875df9217.jpg','广源良','Cucumber'),(622,'Body Natur美体舒是一个脱毛产品及私密护理的专业品牌，产品阵容可以满足各种不同的脱毛需求。配方、生产、设计和是由位于西班牙瓦伦西亚的Viokox唯克思实验室所研发、生产。自1987年以来，Viokox唯克思化妆品有限公司已建立了声誉，所有Body Natur美体舒的产品含有天然成份，非常适合敏感性肌肤，且经皮肤科医学测试，不含人工色素，无过敏源。','b','e0968514-da72-4b67-a36a-60aa0b463c3e.png','美体舒','bodynatur'),(623,'韩国IMYSS爱蜜诗品牌成立于2005年，起初以天然面膜产品 席卷日韩市场，后产品线延伸至爽肤水、乳霜等基础护理领 域及彩妆领域。依托强大的生物科技研发技术，秉承‘’天然、安全、呵护‘’的品牌 承诺，IMYSS爱蜜诗的原料均来自于韩国本土、法国及墨西哥的生态生产基地，严格按照韩国CGMP标准进行产品的生产与包装，保 证产品的安全高质。','I','70bc8085-a10a-46bf-8bc3-4f34c14129a4.png','爱蜜诗','IMYSS'),(624,'herbaflor属于保黛宝 Bettina Barty旗下品牌。','h','','赫贝弗','herbaflor'),(625,'资生堂“AQUAIR水之密语”系列被称为滋润补水之神品，水之密语是资生堂旗下的高档洗护品牌。产品线包括各大洗护发系列，免洗系列和沐浴系列。此系列包括洗发露、护发素、焗油膏、啫喱水、定型摩丝、精华油、喷雾、沐浴露、洁面乳、面霜、护手霜等。','A','d41b1523-7be7-436e-b685-083ef42d1c4a.jpg','水之密语','AQUAIR');

/*Table structure for table `th_channel` */

DROP TABLE IF EXISTS `th_channel`;

CREATE TABLE `th_channel` (
  `channel_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '栏目ID',
  `channel_code` varchar(64) NOT NULL COMMENT '栏目编号',
  `channel_name` varchar(128) NOT NULL COMMENT '栏目名称',
  `activity_id` varchar(32) NOT NULL COMMENT '当前栏目下所有活动ID(活动表的主键)',
  `cgroup` varchar(128) NOT NULL COMMENT '栏目所属组',
  `banner_addr` varchar(256) DEFAULT NULL COMMENT '栏目banner',
  `link` varchar(256) DEFAULT NULL COMMENT '链接地址',
  `is_delete` tinyint(4) DEFAULT '0' COMMENT '0 正常 1 删除',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `operator` varchar(64) DEFAULT '""' COMMENT '操作人',
  `company_id` varchar(16) NOT NULL COMMENT '所属公司',
  PRIMARY KEY (`channel_id`)
