/*Table structure for table `th_hot_search` */

DROP TABLE IF EXISTS `th_hot_search`;

CREATE TABLE `th_hot_search` (
  `hot_search_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录Id',
  `carousel_content` varchar(500) DEFAULT NULL COMMENT '搜索框轮播提示词内容',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `operator` varchar(64) DEFAULT NULL COMMENT '操作人',
  `company_id` varchar(16) NOT NULL COMMENT '所属公司Id',
  `common_content` varchar(500) DEFAULT NULL COMMENT '大家都在搜索提示词内容',
  PRIMARY KEY (`hot_search_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4;

