/*Table structure for table `th_item` */

DROP TABLE IF EXISTS `th_item`;

CREATE TABLE `th_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `itemCode` varchar(64) NOT NULL COMMENT 'ITEM唯一编码',
  `title` varchar(512) NOT NULL COMMENT 'item头',
  `shortTitle` varchar(512) DEFAULT NULL COMMENT 'item简头',
  `activityTitle` varchar(512) DEFAULT NULL COMMENT 'Item活动头',
  `recommend` varchar(512) DEFAULT NULL COMMENT 'Item推荐头',
  `upc` varchar(64) DEFAULT NULL COMMENT 'upc编码',
  `price` decimal(10,2) NOT NULL COMMENT '售价',
  `marketPrice` decimal(10,2) DEFAULT NULL COMMENT '市场价',
  `maxBuyCount` int(11) DEFAULT NULL COMMENT '最大购买数量',
  `type` varchar(10) DEFAULT NULL COMMENT 'item类型 单品,单品套装,组合套装',
  `company` int(11) DEFAULT NULL COMMENT '所属公司',
  `operator` varchar(512) DEFAULT NULL COMMENT '操作人',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `recordCode` varchar(512) DEFAULT NULL COMMENT '备案号',
  `mainUri` varchar(512) DEFAULT NULL,
  `cate1` int(11) DEFAULT NULL COMMENT '基础一级分类',
  `cate2` int(11) DEFAULT NULL COMMENT '基础二级分类',
  `cate3` int(11) DEFAULT NULL COMMENT '基础三级分类',
  `unitsId` int(11) DEFAULT NULL COMMENT '计量单位ID',
  `shelfLife` int(11) DEFAULT NULL COMMENT '保质期',
  `realWeight` bigint(20) DEFAULT NULL COMMENT '净重',
  `netWeight` bigint(20) DEFAULT NULL COMMENT '毛重',
  `packageLong` int(11) DEFAULT NULL COMMENT '长',
  `packageWidth` int(11) DEFAULT NULL COMMENT '宽',
  `packageHigh` int(11) DEFAULT NULL COMMENT '高',
  `countryId` int(11) DEFAULT NULL COMMENT '国家ID',
  `warning` varchar(1024) DEFAULT NULL COMMENT '禁忌',
  `brandId` int(11) DEFAULT NULL COMMENT '品牌ID',
  `pdDate` datetime DEFAULT NULL COMMENT '生产日期',
  PRIMARY KEY (`id`),
  UNIQUE KEY `u_upc` (`upc`)
) ENGINE=InnoDB AUTO_INCREMENT=1214 DEFAULT CHARSET=utf8mb4;

