/*Table structure for table `th_main_order` */

DROP TABLE IF EXISTS `th_main_order`;

CREATE TABLE `th_main_order` (
  `mainId` varchar(64) NOT NULL,
  `status` int(11) NOT NULL COMMENT '订单状态  1、待支付 2、待接单 3、拣货中 4、待发货 5、发货中 6、已完成 7、已取消',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `storeId` varchar(64) NOT NULL COMMENT '门店ID',
  `deliveryMethod` int(11) NOT NULL COMMENT '配送方式 1、送货上门',
  `paymentTime` timestamp NULL DEFAULT NULL COMMENT '付款时间',
  `userName` varchar(40) DEFAULT NULL COMMENT '用户名称',
  `userId` varchar(40) NOT NULL COMMENT '用户ID',
  `pickerId` varchar(40) DEFAULT NULL COMMENT '拣货员ID',
  `deliveryManId` varchar(40) DEFAULT NULL COMMENT '送货员ID',
  `createTime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `deliveryTime` timestamp NULL DEFAULT NULL COMMENT '配送时间',
  `consignee` varchar(40) NOT NULL COMMENT '收件人',
  `consigneePhone` varchar(60) NOT NULL COMMENT '收件人电话',
  `consigneeCity` varchar(40) NOT NULL COMMENT '收件人地址',
  `commodityPrice` decimal(10,2) NOT NULL COMMENT '商品总额',
  `deliverFee` decimal(10,2) NOT NULL COMMENT '配送费',
  `preferentialFee` decimal(10,2) NOT NULL COMMENT '优惠费',
  `totalPrice` decimal(10,2) NOT NULL COMMENT '实付款',
  `mapPoint` varchar(100) NOT NULL COMMENT '收货人地图点',
  `consigneeRegion` varchar(40) NOT NULL COMMENT '小区/大厦/学校',
  `consigneeBuildingNO` varchar(40) NOT NULL COMMENT '楼号-门牌号',
  `numberOfPackages` int(11) NOT NULL COMMENT '原单总件数',
  `userPhone` varchar(60) NOT NULL COMMENT '用户联系电话',
  `activeTime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '有效截止时间',
  `payNo` varchar(60) DEFAULT NULL COMMENT '支付号',
  `tradeNo` varchar(60) DEFAULT NULL COMMENT '交易号',
  `paymoney` decimal(10,2) DEFAULT NULL COMMENT '支付金额',
  `payType` varchar(45) DEFAULT NULL,
  `outOfStockInfo` varchar(200) NOT NULL COMMENT '缺货备注信息',
  `signTime` timestamp NULL DEFAULT NULL COMMENT '签收时间',
  `cancelTime` timestamp NULL DEFAULT NULL COMMENT '取消时间',
  `pickRemark` varchar(200) DEFAULT NULL COMMENT '拣货备注',
  PRIMARY KEY (`mainId`)
