/*Table structure for table `th_object_permission` */

DROP TABLE IF EXISTS `th_object_permission`;

CREATE TABLE `th_object_permission` (
  `objectId` int(11) NOT NULL COMMENT '对象ID',
  `objectType` int(11) NOT NULL COMMENT '对象类型 1、用户  2、角色',
  `permission` varchar(30) NOT NULL COMMENT '权限',
  `permissionId` int(11) NOT NULL COMMENT '权限ID',
  PRIMARY KEY (`permissionId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='对象权限表';

