  `afterStatus` int(11) NOT NULL COMMENT '操作后状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2512 DEFAULT CHARSET=utf8mb4 COMMENT='订单流水表';

