/*Table structure for table `th_order_product` */

DROP TABLE IF EXISTS `th_order_product`;

CREATE TABLE `th_order_product` (
  `subId` varchar(64) NOT NULL COMMENT '商品单号',
  `productId` varchar(64) NOT NULL COMMENT '产品ID',
  `price` decimal(10,2) NOT NULL COMMENT '商品价格',
  `originalNumber` int(11) NOT NULL COMMENT '购买数量',
  `mainId` varchar(64) NOT NULL COMMENT '主单号',
  `productPictureUrl` varchar(100) DEFAULT NULL COMMENT '产品图片地址',
  `productName` varchar(60) DEFAULT NULL COMMENT '产品名称',
  `preferentialPrice` decimal(10,2) DEFAULT NULL COMMENT '优惠后价格',
  `productCode` varchar(64) NOT NULL COMMENT '商品编号',
  `outOfStockNumber` int(11) DEFAULT NULL COMMENT '缺货数量',
  `storeId` varchar(64) NOT NULL COMMENT '门店ID',
  `storeName` varchar(64) NOT NULL COMMENT '门店名称',
  `currentNumber` int(4) NOT NULL,
  PRIMARY KEY (`subId`)
