/*Table structure for table `th_page_style` */

DROP TABLE IF EXISTS `th_page_style`;

CREATE TABLE `th_page_style` (
  `style_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '页面类型主键Id',
  `style_code` varchar(64) NOT NULL COMMENT '页面类型编码',
  `type` int(11) NOT NULL COMMENT '类型(首页、模板活动、购物车)',
  `title` varchar(128) NOT NULL COMMENT '页面标题',
  `page_desc` varchar(128) NOT NULL COMMENT '页面描述',
  `logo_address` varchar(256) NOT NULL COMMENT 'logo地址',
  `attr_size` int(11) NOT NULL COMMENT '属性列表个数',
  `is_delete` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0 正常 1删除',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '跟新时间',
  PRIMARY KEY (`style_id`)
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=utf8;

