/*Table structure for table `th_product` */

DROP TABLE IF EXISTS `th_product`;

CREATE TABLE `th_product` (
  `pid` bigint(20) NOT NULL AUTO_INCREMENT,
  `productCode` varchar(64) NOT NULL COMMENT '商品唯一编码',
  `productNameCn` varchar(512) NOT NULL COMMENT '商品中文名',
  `productNameEn` varchar(512) NOT NULL COMMENT '商品英文名',
  `spuId` bigint(20) NOT NULL COMMENT 'SPUID',
  `brandId` bigint(20) NOT NULL COMMENT '品牌ID',
  `brandNameEn` varchar(32) DEFAULT NULL,
  `brandLogo` varchar(128) DEFAULT NULL,
  `brandNameCh` varchar(32) DEFAULT NULL,
  `categId1` bigint(20) NOT NULL COMMENT '一级类目ID',
  `categId2` bigint(20) NOT NULL COMMENT '二级类目ID',
  `categId3` bigint(20) NOT NULL COMMENT '三级类目ID',
  `upcCode` varchar(128) DEFAULT NULL COMMENT 'UPC条形码',
  `realWeight` bigint(20) NOT NULL DEFAULT '0' COMMENT '净重',
  `netWeight` bigint(20) NOT NULL DEFAULT '0' COMMENT '含包装重量',
  `packageLong` int(11) NOT NULL DEFAULT '0' COMMENT '含包装长（厘米）',
  `packageWidth` int(11) NOT NULL DEFAULT '0' COMMENT '含包装宽(厘米)',
  `packageHigh` int(11) NOT NULL DEFAULT '0' COMMENT '含包装高(厘米)',
  `unitsId` int(11) NOT NULL COMMENT '计量单位ID',
  `countryId` int(11) NOT NULL COMMENT '原产国ID',
  `countryName` varchar(50) DEFAULT NULL,
  `countryLogo` varchar(512) DEFAULT NULL,
  `shelfLife` int(11) NOT NULL DEFAULT '0' COMMENT '保质期（天）',
  `choiceDesc` text COMMENT '小编推荐',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`pid`),
  UNIQUE KEY `u_productCode` (`productCode`),
  UNIQUE KEY `u_upcCode` (`upcCode`)
) ENGINE=InnoDB AUTO_INCREMENT=1611 DEFAULT CHARSET=utf8mb4;

