/*Table structure for table `th_product_attr` */

DROP TABLE IF EXISTS `th_product_attr`;

CREATE TABLE `th_product_attr` (
  `productAttrId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品属性ID',
  `spuId` bigint(20) NOT NULL COMMENT 'spuId',
  `productCode` varchar(64) NOT NULL COMMENT '商品唯一ID',
  `itemCode` varchar(64) DEFAULT NULL COMMENT 'item唯一ID',
  `attrId` bigint(20) NOT NULL COMMENT '属性ID',
  `attrValueId` bigint(20) DEFAULT NULL,
  `isMain` int(11) DEFAULT '0' COMMENT '是否主规格 1:是',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`productAttrId`),
  KEY `p_spu` (`spuId`)
