/*Table structure for table `th_product_categ` */

DROP TABLE IF EXISTS `th_product_categ`;

CREATE TABLE `th_product_categ` (
  `categId` bigint(20) NOT NULL COMMENT '类目ID',
  `categLevel` int(11) NOT NULL COMMENT '分类层级',
  `parentCategId` bigint(20) NOT NULL DEFAULT '0' COMMENT '父分类ID',
  `categName` varchar(128) NOT NULL COMMENT '类目名称',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`categId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `th_product_categ` */

/*Table structure for table `th_product_categ_attr` */

DROP TABLE IF EXISTS `th_product_categ_attr`;

CREATE TABLE `th_product_categ_attr` (
  `categAttrId` bigint(20) NOT NULL AUTO_INCREMENT,
  `categId` bigint(20) NOT NULL COMMENT '类目ID',
  `attrId` bigint(20) NOT NULL COMMENT '属性ID',
  `isMain` int(11) NOT NULL DEFAULT '0' COMMENT '是否主属性 1：主属性',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`categAttrId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `th_product_categ_attr` */

/*Table structure for table `th_product_imgs` */

DROP TABLE IF EXISTS `th_product_imgs`;

CREATE TABLE `th_product_imgs` (
  `imgId` bigint(20) NOT NULL COMMENT '相册ID',
  `productCode` varchar(64) NOT NULL COMMENT '商品唯一编码',
  `productImg` varchar(512) NOT NULL COMMENT '图片地址',
  `imgType` int(11) NOT NULL COMMENT '图片类型 1：展示图 2：商品详情',
  `isDefault` int(11) NOT NULL DEFAULT '0' COMMENT '是否默认',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序编号',
  `platId` int(11) NOT NULL DEFAULT '1' COMMENT '平台ID 1：PC 2：手机',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`imgId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='商品相册表';

