/*Table structure for table `th_store` */

DROP TABLE IF EXISTS `th_store`;

CREATE TABLE `th_store` (
  `storeId` varchar(50) NOT NULL COMMENT '门店主键',
  `storeCode` varchar(100) DEFAULT NULL COMMENT '门店编号',
  `displayName` varchar(200) NOT NULL COMMENT '门店前端显示名称',
  `fullName` varchar(200) NOT NULL COMMENT '门店全名称',
  `storeType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '门店类型(0:便利店 1:中超 2:大超)',
  `cityCode` varchar(20) DEFAULT NULL COMMENT '门店所在城市编号',
  `cityName` varchar(30) DEFAULT NULL COMMENT '城市名称',
  `address` varchar(200) DEFAULT NULL COMMENT '门店地址',
  `openTimeStart` varchar(50) NOT NULL COMMENT '营业开始时间',
  `openTimeEnd` varchar(50) NOT NULL COMMENT '营业结束时间',
  `telephone` varchar(20) DEFAULT NULL COMMENT '门店电话',
  `storeState` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0: 关闭营业 1: 营业中',
  `paymentType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付方式(0:在线支付)',
  `deliveryType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '配送方式(0:配送到家)',
  `deliveryInfo` varchar(300) DEFAULT NULL COMMENT '配送信息',
  `gpsEw` varchar(50) NOT NULL COMMENT 'gps经度',
  `gpsNs` varchar(50) NOT NULL COMMENT 'gps纬度',
  `serviceArea` varchar(600) DEFAULT NULL COMMENT '配送范围',
  `serviceInfo` varchar(600) DEFAULT NULL COMMENT '服务信息',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '插入时间',
  PRIMARY KEY (`storeId`)
